(2779, '_transient_wc_addons_section_import_export', 'O:8:"stdClass":1:{s:8:"products";a:9:{i:0;O:8:"stdClass":5:{s:5:"title";s:25:"Order/Customer CSV Export";s:5:"image";s:118:"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAYCAQAAACRxV9RAAAADklEQVR42mNkYGCkBgIAA8wAGRmQESkAAAAASUVORK5CYII=";s:7:"excerpt";s:69:"Export orders and customers from WooCommerce to a CSV file with ease.";s:4:"link";s:117:"https://woocommerce.com/products/ordercustomer-csv-export/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons";s:5:"price";s:10:"&#36;79.00";}i:1;O:8:"stdClass":5:{s:5:"title";s:24:"Product CSV Import Suite";s:5:"image";s:118:"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAYCAQAAACRxV9RAAAADklEQVR42mNkYGCkBgIAA8wAGRmQESkAAAAASUVORK5CYII=";s:7:"excerpt";s:91:"Import, merge, and export products and variations to and from WooCommerce using a CSV file.";s:4:"link";s:117:"https://woocommerce.com/products/product-csv-import-suite/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons";s:5:"price";s:11:"&#36;199.00";}i:2;O:8:"stdClass":5:{s:5:"title";s:38:"Customer/Order/Coupon CSV Import Suite";s:5:"image";s:118:"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAYCAQAAACRxV9RAAAADklEQVR42mNkYGCkBgIAA8wAGRmQESkAAAAASUVORK5CYII=";s:7:"excerpt";s:66:"Import both customers and orders into WooCommerce from a CSV file.";s:4:"link";s:123:"https://woocommerce.com/products/customerorder-csv-import-suite/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons";s:5:"price";s:10:"&#36;79.00";}i:3;O:8:"stdClass":5:{s:5:"title";s:31:"Customer/Order XML Export Suite";s:5:"image";s:118:"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAYCAQAAACRxV9RAAAADklEQVR42mNkYGCkBgIAA8wAGRmQESkAAAAASUVORK5CYII=";s:7:"excerpt";s:100:"Easily export orders from your WooCommerce to XML and download or automatically upload them via FTP.";s:4:"link";s:123:"https://woocommerce.com/products/customerorder-xml-export-suite/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddon