(21, 1, '2017-07-06 00:44:19', '2017-07-05 22:44:19', 'Несмотря на то, что сегодня большей популярностью стали пользоваться беспроводные наушники, все же основным преимуществом проводных наушников остается безупречное качество звука. Так как с помощью проводов, качество звучания мелодии или голоса передается намного быстрее и четче. Несмотря на инновационные разработки профессиональных технологов такого чистого звучания с беспроводными наушниками добиться очень сложно. Также, немаловажным является и комфортное подкручивание звука, которое чаще всего расположено на проводе гарнитуры.\r\n\r\nПрослушивание музыки никогда не было таким стильным и комфортным! Гарнитура <b>Swank</b> от <i>Promate</i> оснащена плотно прилегающими к уху 10 мм динамиками, обладает хорошей шумоизоляцией, широким частотным ответом и чистым и четким звуком. Модель идеально подойдет как для прослушивания музыки, так и для разговоров по телефону.\r\n\r\nСтильно, ярко — ваш личный выбор звука!\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Компактная и модная гарнитура</li>\r\n 	<li>Спортивный дизайн динамиков</li>\r\n 	<li>Усиленный 3.5 мм плоский аудио-кабель длиной 1.2 м</li>\r\n 	<li>Встроенный микрофон и кнопка управления вызовами</li>\r\n 	<li>Кристально чистый звук и встроенная пассивная шумоизоляция</li>\r\n 	<li>Совместима со всеми аудиоустройствами, смартфонами и планшетами оснащенными 3.5 мм аудио-разъемом</li>\r\n 	<li>3 размера мягких силиконовых вкладышей</li>\r\n</ul>', 'Проводные наушники Swank', '<table style="width: 100%"><tbody><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Тип наушников </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">Вкладыши</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Тип подключения </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">Проводное</td></tr><tr><td style="padding-bottom: 20px;width: 48%