(28, 1, '2017-07-06 00:44:20', '2017-07-05 22:44:20', 'Несмотря на то, что сегодня большей популярностью стали пользоваться беспроводные наушники, все же основным преимуществом проводных наушников остается безупречное качество звука. Так как с помощью проводов, качество звучания мелодии или голоса передается намного быстрее и четче. Несмотря на инновационные разработки профессиональных технологов такого чистого звучания с беспроводными наушниками добиться очень сложно. Также, немаловажным является и комфортное подкручивание звука, которое чаще всего расположено на проводе гарнитуры.\r\n\r\nПрослушивание музыки во время занятий спортом никогда не было таким стильным и комфортным! <b>Vent</b> от <i>Promate</i> — это модная стереогарнитура, которая позволяет прочувствовать музыку без ущерба для стиля. Модель обладает встроенным универсальным микрофоном, который позволяет в полной мере использовать функции вашего мобильного телефона во время прослушивания любимой музыки. Vent — сбалансированная музыка высоких и низких частот для городского образа жизни!\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Стильная легкая гарнитура с линейным входом</li>\r\n 	<li>Полностью настраиваемые</li>\r\n 	<li>Встроенный микрофон</li>\r\n 	<li>Провод с оплеткой</li>\r\n 	<li>Люксовые материалы для исключительного комфорта при долгом прослушивании музыки</li>\r\n</ul>', 'Проводные наушники Vent', '<table style="width: 100%"><tbody><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Тип наушников </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">Закрытые</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Тип подключения </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">Проводное</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Интерфейс проводного подключения</td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%"> 1 x mini-jack (разъем 3.5 мм)</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Кабель </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">Односторонний</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Диапазон частот наушников </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">20 - 20 000 Гц</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Сопротивление </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">32 Ом</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Чувствительность наушников </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">98 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Максимальная входная мощность наушников </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">20 мВт</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Конструкция микрофона </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">Размещенный на проводе</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Чувствительность микрофона </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">-42 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Дополнительные возможности </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">40 мм динамики </br> Провод с оплеткой </br> Складываемая конструкция </br> Мягкая ткань на оголовье </br> Регулировка расположения чашек динамиков</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Длина шнура </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">1.5 м</td></tr><tr><td style="padding-bottom: 20px;width: 48%;vertical-align: top">Вес </td><td style="padding-bottom: 20px;width: 2%">&nbsp;</td><td style="vertical-align: top;width: 48%">130 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', '%d0%bf%d1%80%d0%be%d0%b2%d0%be%d0%b4%d0%bd%d1%8b%d0%b5-%d0%bd%d0%b0%d1%83%d1%88%d0%bd%d0%b8%d0%ba%d0%b8-vent', '', '', '2017-07-06 00:44:28', '2017-07-05 22:44:28', '', 0, 'http://1076992.bc254240.web.hosting-test.net/?product=import-placeholder-for-5842', 0, 'product', '', 0),
