(59, 1, '2017-07-06 00:45:47', '2017-07-05 22:45:47', '<label> Ваше имя (обязательно)\n    [text* your-name] </label>\n\n<label> Ваш e-mail (обязательно)\n    [email* your-email] </label>\n\n<label> Тема\n    [text your-subject] </label>\n\n<label> Сообщение\n    [textarea your-message] </label>\n\n[submit "Отправить"]\npromate "[your-subject]"\n[your-name] <wordpress@1076992.bc254240.web.hosting-test.net>\nОт: [your-name] <[your-email]>\nТема: [your-subject]\n\nСообщение:\n[your-message]\n\n-- \nЭто сообщение отправлено с сайта promate (http://1076992.bc254240.web.hosting-test.net)\nnbilanenko@gmail.com\nReply-To: [your-email]\n\n0\n0\n\npromate "[your-subject]"\npromate <wordpress@1076992.bc254240.web.hosting-test.net>\nСообщение:\n[your-message]\n\n-- \nЭто сообщение отправлено с сайта promate (http://1076992.bc254240.web.hosting-test.net)\n[your-email]\nReply-To: nbilanenko@gmail.com\n\n0\n0\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nПоле обязательно для заполнения.\nПоле слишком длинное.\nПоле слишком короткое.', 'Контактная форма 1', '', 'publish', 'closed', 'closed', '', '%d0%ba%d0%be%d0%bd%d1%82%d0%b0%d0%ba%d1%82%d0%bd%d0%b0%d1%8f-%d1%84%d0%be%d1%80%d0%bc%d0%b0-1', '', '', '2017-07-06 00:45:47', '2017-07-05 22:45:47', '', 0, 'http://1076992.bc254240.web.hosting-test.net/?post_type=wpcf7_contact_form&p=59', 0, 'wpcf7_contact_form', '', 0),
(84, 1, '2017-07-06 01:19:17', '2017-07-05 23:19:17', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://www.promate.loc/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-07-06 01:19:17', '2017-07-05 23:19:17', '', 2, 'http://1076992.bc254240.web.hosting-test.net/2-revision-v1/', 0, 'revision', '', 0),
