(5817, 1, '2016-12-10 16:56:41', '2016-12-10 14:56:41', 'Несмотря на то, что сегодня большей популярностью стали пользоваться беспроводные наушники, все же основным преимуществом проводных наушников остается безупречное качество звука. Так как с помощью проводов, качество звучания мелодии или голоса передается намного быстрее и четче. Несмотря на инновационные разработки профессиональных технологов такого чистого звучания с беспроводными наушниками добиться очень сложно. Также, немаловажным является и комфортное подкручивание звука, которое чаще всего расположено на проводе гарнитуры.\r\n\r\n<b>Promate Swish</b> — стильная стереогарнитура, идеальная для активного образа жизни. Небольшой, но стильный динамик, идеальное шумоподавление, четкий и чистый звук, встроенный микрофон — что еще нужно, чтобы наслаждаться музыкой и не упускать из внимания ваш смартфон? Универсальна и совместима с любыми аудиоустройствами, смартфонами или планшетами. Модель отличает стильным минимализм.\r\n\r\nСтильно, ярко — ваш личный выбор звука!\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Модная стереогарнитура</li>\r\n 	<li>Усиленный аудиокабель</li>\r\n 	<li>Встроенный микрофон и кнопка управления вызовами</li>\r\n 	<li>Кристально чистый звук и шумоизоляция</li>\r\n 	<li>Совместимы со всеми аудиоустройствами, планшетами и смартфонами</li>\r\n</ul>', 'Проводные наушники Swish', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Вкладыши</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип подключения </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Проводное</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейс проводного подключения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 x mini-jack (разъем 3.5 мм)</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Наличие активного шумоподавления </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Двухсторонний</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 - 20 000 Гц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">16 Ом</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">112 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Максимальная входная мощность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15 мВт</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Конструкция микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Размещенный на проводе</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">38 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные возможности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">10 мм динамики </br> Встроенная пассивная шумоизоляция </br>3 размера мягких силиконовых вкладышей</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина шнура </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1.2 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">24 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'provodnye-naushniki-swish', '', '', '2016-12-10 16:56:41', '2016-12-10 14:56:41', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-swish/', 0, 'product', '', 0),
