(5832, 1, '2016-12-10 16:56:46', '2016-12-10 14:56:46', 'Несмотря на то, что сегодня большей популярностью стали пользоваться беспроводные наушники, все же основным преимуществом проводных наушников остается безупречное качество звука. Так как с помощью проводов, качество звучания мелодии или голоса передается намного быстрее и четче. Несмотря на инновационные разработки профессиональных технологов такого чистого звучания с беспроводными наушниками добиться очень сложно. Также, немаловажным является и комфортное подкручивание звука, которое чаще всего расположено на проводе гарнитуры.<span id="copyinfo"></span>\r\n\r\nПрослушивание музыки во время занятий спортом никогда не было таким стильным и комфортным! Гарнитура <strong>Promate</strong> <b>Aurus</b>  являет собой простое и элегантное, универсальное решение. Модель совместима с любыми аудиоустройствами оснащенными 3.5 мм аудио-разъемом, имеет уникальный и динамичный дизайн вкладышей, мягкие силиконовые части динамика и суперширокую частотную характеристику. Идеально подходит для ценителей качественного звучания и комфорта!\r\n<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nСтильно, ярко — ваш личный выбор звука!\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>Универсальные Hands-free стереонаушники совместимые со всеми аудио продуктами</li>\r\n 	<li>Динамичный дизайн</li>\r\n 	<li>Встроенный в кабель микрофон и универсальная кнопка управления звонками</li>\r\n 	<li>Широкий частотный диапазон</li>\r\n 	<li>Удобный коннектор, предотвращающий спутывание проводов</li>\r\n 	<li>Мягкие силиконовые вкладки (три размера в комплекте (S/M/L)) для максимального комфорта</li>\r\n 	<li>Доступны в красном, белом и черном цветовом решении</li>\r\n 	<li>Выполнены из ABS пластика и экранированного провода</li>\r\n</ul>\r\n</div>', 'Проводные наушники Aurus', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Вкладыши</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип подключения </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Проводное</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейс проводного подключения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 x mini-jack (разъем 3.5 мм)</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Двухсторонний</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 - 20 000 Гц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">16 Ом</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">98 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Максимальная входная мощность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 мВт</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Конструкция микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Размещенный на проводе</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">-41 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные возможности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">9 мм динамики </br> Удобный коннектор, предотвращающий спутывание проводов </br> Три мягких силиконовых вкладки (размера S/M/L) для максимального комфорта </br> Выполнены из ABS пластика и экранированного провода</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина шнура </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1.25 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">33 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'provodnye-naushniki-aurus', '', '', '2016-12-10 16:56:46', '2016-12-10 14:56:46', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-aurus/', 0, 'product', '', 0),
