(5844, 1, '2016-12-10 16:56:46', '2016-12-10 14:56:46', 'Несмотря на то, что сегодня большей популярностью стали пользоваться беспроводные наушники, все же основным преимуществом проводных наушников остается безупречное качество звука. Так как с помощью проводов, качество звучания мелодии или голоса передается намного быстрее и четче. Несмотря на инновационные разработки профессиональных технологов такого чистого звучания с беспроводными наушниками добиться очень сложно. Также, немаловажным является и комфортное подкручивание звука, которое чаще всего расположено на проводе гарнитуры.\r\n\r\nПрослушивание музыки во время занятий спортом никогда не было таким стильным и комфортным! <b>Urban</b> от <i>Promate</i> — проводные наушники-гарнитура, произведенные из лучших акустических материалов и предназначенные для удовлетворения требований даже крайне требовательных аудиофилов.\r\n\r\nМягкие роскошные кожаные накладки на уши предназначены для обеспечения оптимального комфорта. Наушники имеют встроенный микрофон, что позволяет также их использовать для разговоров по телефону. Эти воистину качественные универсальные наушники совместимы с любыми аудио устройствами, планшетами и смартфонами с 3.5 мм аудио-разъемом.\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Регулировка для максимального комфорта</li>\r\n 	<li>Полированная кожа на амбушюрах</li>\r\n 	<li>Технология и стиль в одном корпусе</li>\r\n 	<li>Пассивное шумоподавление</li>\r\n 	<li>Очень низкий уровень искажений</li>\r\n 	<li>Встроенная кнопка управления вызовами и микрофон</li>\r\n 	<li>Кристально чистый звук</li>\r\n 	<li>Усиленный аудиокабель</li>\r\n 	<li>Складной дизайн для портативности</li>\r\n 	<li>Универсальнны: совместимы со всеми устройствами с 3.5 мм аудио-разъемом</li>\r\n</ul>', 'Проводные наушники Urban', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Закрытые</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип подключения </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Проводное</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейс проводного подключения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 x mini-jack (разъем 3.5 мм)</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Односторонний</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 - 20 000 Гц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">32 Ом</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">105 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Максимальная входная мощность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">100 мВт</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Конструкция микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Размещенный на проводе</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные возможности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">40 мм динамики </br> Низкий уровень искажений </br> Складываемая конструкция чашек динамиков</br> Усиленный аудио-кабель </br> Полированная кожа на амбушюрах</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина шнура </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1.2 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">156 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'provodnye-naushniki-urban', '', '', '2016-12-10 16:56:46', '2016-12-10 14:56:46', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-urban/', 0, 'product', '', 0),
