d><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">16 Ом</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">103 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Конструкция микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Размещенный на проводе</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">-42 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные возможности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Драйверы 10 мм </br> Пассивное шумоподавление</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина шнура </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1.2 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">21 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'provodnye-naushniki-lacey', '', '', '2016-12-10 16:56:46', '2016-12-10 14:56:46', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-lacey/', 0, 'product', '', 0),
