(5860, 1, '2016-12-10 16:56:51', '2016-12-10 14:56:51', '<b>Promate Jazzy</b> идеальны для занятий в спортзале или беговой дорожке. Они для людей, ведущих активный образ жизни.\r\n\r\nПлотно прилегают к уху, что позволяет минимизировать внешние шумы и обеспечить кристальную ясность звука и глубокие басы. Наушники универсальны и совместимы с любым аудиоустройством, планшетом или смартфоном.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Модная гарнитура</li>\r\n 	<li>Усиленный аудиокабель</li>\r\n 	<li>Специально разработанные заушные крючки</li>\r\n 	<li>Встроенный микрофон и кнопка управления вызовами</li>\r\n 	<li>Кристально чистый звук и шумоизоляция</li>\r\n 	<li>Универсальны и совместимы с планшетом, смартфонами и другими устройствами</li>\r\n 	<li>3 размера силиконовых вкладок</li>\r\n</ul>', 'Проводные наушники Jazzy', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Вкладыши</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип подключения </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Проводное</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейс проводного подключения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 x mini-jack (разъем 3.5 мм)</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Наличие активного шумоподавления </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Двухсторонний</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 - 20 000 Гц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">16 Ом</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">112 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Максимальная входная мощность наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15 мВт</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Конструкция микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Размещенный на проводе</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">38 ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные возможности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">10 мм динамики</br> Встроенная пассивная шумоизоляция</br> 3 размера мягких силиконовых вкладышей</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина шнура </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1.2 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-