(5875, 1, '2016-12-10 16:56:55', '2016-12-10 14:56:55', 'Если вы ценитель ретро-мелодий и дискотеки 80-х — то вам наверняка подойдут <b>Promate Tone</b>, оформленные в ретро-стиле.\r\n\r\nВ этих наушниках соединены стиль, комфорт и кристально чистый звук. 1.2 метровый кабель включает в себя встроенный микрофон и кнопку для доступа к функции вызова телефонного звонка.\r\n\r\n<b>Особеннсоти:</b>\r\n<ul>\r\n 	<li>Ретро стиль</li>\r\n 	<li>Наушники с покрытием из лакшери-кожи</li>\r\n 	<li>технология и стиль в одном корпусе</li>\r\n 	<li>Пассивная шумоизоляция</li>\r\n 	<li>Встроенный микрофон и кнопка управления вызовами</li>\r\n 	<li>Кристально чистый звук</li>\r\n 	<li>Усиленный аудиокабель</li>\r\n 	<li>Универсален и совместим со всеми аудиоустройствами, планшетами и смартфонами</li>\r\n</ul>', 'Проводные наушники Tone', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Открытые</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип подключения </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Проводное</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейс проводного подключения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 x mini-jack (разъем 3.5 мм)</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Двухсторонний</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот наушников </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 - 20 000 Гц</td></tr><tr><td style="padding