(5897, 1, '2016-12-10 16:57:00', '2016-12-10 14:57:00', '&nbsp;\r\n\r\n<b>Promate Vogue</b> — универсальные наушники-вкладыши с встроенным пультом ДУ и микрофоном для музыки и звонков. Почувствуйте музыкальную гармонию с помощью 10 мм динамиков, которые обеспечивают наилучшее звучание.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Пассивное шумоподавление: <b>Vogue</b> обеспечивают кристально чистый звук с помощью улучшенных амбушюр которые блокируют шум вокруг</li>\r\n 	<li>Не запутывающийся шнур: шнур, сделанный из качественных материалов, не запутывается и улучшает дизайн наушников</li>\r\n 	<li>Встроенный микрофон: <b>Vogue</b> также имеет встроенный микрофон, который позволяет совершать и принимать звонки одним нажатием кнопки</li>\r\n 	<li>Дизайн браслета: Уникальный дизайн <b>Vogue</b> позволяет вам носить наушники на запястье</li>\r\n 	<li>Стильный дизайн: Очень легкие и стильные наушники, удобны при носке на запястье и идеально подходит под вашу форму уха</li>\r\n</ul>', 'Проводные наушники Vogue', 'Диаметр динамика: 10mm\r\nСопротивление: 16 ± 15%\r\nДиапазон воспроизводимых частот: 20Hz- 20кГц\r\nЧувствительность: 95 дБ ± 3 дБ\r\nДлина кабеля: 1,2 м', 'publish', 'open', 'closed', '', 'provodnye-naushniki-retro-2', '', '', '2016-12-10 16:57:00', '2016-12-10 14:57:00', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-retro-2/', 0, 'product', '', 0),
