(5900, 1, '2016-12-10 16:57:00', '2016-12-10 14:57:00', '<b>Promate</b> – это инновационная компания по созданию высокотехнологичных, стильных и динамичных аксессуаров для телефонов и гаджетов. Имея такие аксессуары можно с легкостью выделяться среди других и быть всегда в тренде. В ассортименте компании можно найти оригинальные аксессуары для телефонов, гаджетов, планшетов, автомобилей и даже мотоциклов разработанных с учетом последних достижений науки и техники. Такие новаторские решения на рынке периферийных устройств будут всегда актуальны, так как с ними непросто удобно и комфортно, но еще и модно!\r\n\r\nНесмотря на то, что сегодня большей популярностью стали пользоваться беспроводные наушники, все же основным преимуществом проводных наушников остается безупречное качество звука. Так как с помощью проводов, качество звучания мелодии или голоса передается намного быстрее и четче. Несмотря на инновационные разработки профессиональных технологов такого чистого звучания с беспроводными наушниками добиться очень сложно.\r\n\r\n<b>Promate earMate-Uni1</b> — универсальные стерео наушники. Наслаждайтесь вашими любимыми песнями с этими удивительными наушниками, будь то ваши ежедневные тренировки или рабочие дни, <b>eaMate-uni1</b> будет вашим идеальным спутником для музыки.\r\n\r\nНаушники <b>earMate-uni1</b> является универсальным аксессуаром и предназначены для всех устройств, поддерживающих 3.5 мм разъем.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Эргономичный дизайн, в сочетании с мягкими силиконовыми амбушюрами обеспечивают комфорт при прослушивании</li>\r\n 	<li>earMate-uni1 изолирует фоновый шум идеально, чтобы улучшить качество звучания</li>\r\n 	<li>Супер широкий частотный диапазон обеспечивает кристально чистый звук</li>\r\n</ul>', 'Проводные наушники earMate-Uni1', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диаметр динамика</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">9мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">96 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон воспроизводимых частот</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20-20000Hz</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">16</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходная мощность</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">3 мВт</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1,2 м</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'provodnye-naushniki-earmate-uni1', '', '', '2016-12-10 16:57:00', '2016-12-10 14:57:00', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-earmate-uni1/', 0, 'product', '', 0),
