vertical-align: top;">Входной разъем</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">3,5 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1,5 м</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'provodnye-naushniki-thump', '', '', '2016-12-10 16:57:00', '2016-12-10 14:57:00', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/provodnye-naushniki-thump/', 0, 'product', '', 0),
