(5913, 1, '2016-12-10 16:57:05', '2016-12-10 14:57:05', 'Мультифункциональные беспроводные стереонаушники <b>Promate Solix-1</b> с технологией цифрового шумоподавления созданы для интенсивных тренировок: Надежно держится в ухе во время тренировки. Форма крепления за уши позволяет получить идеальную фиксацию.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li><b>Защита от воды и пота:</b> Solix-1 водо и ударостойкие. Они разработаны с целью выдержать любые упражнения в любых условиях</li>\r\n 	<li><b>Беспроводное преимущество:</b> Не позволяйте проводам мешать вашей тренировке. Наслаждайтесь полной свободой от проводов</li>\r\n 	<li><b>Крепление за голову:</b> Супер легкий и удобный дизайн делает Solix-1 идеальными наушниками для занятий спортом</li>\r\n 	<li><b>Wireless Fidelity:</b> Теперь качество звука не будет меняться во время прослушивания музыки в беспроводном режиме, так как в Solix-1 встроен чип с aptx Audio Technology для высочайшего качества звука</li>\r\n 	<li><b>Функция громкой связи:</b> Принимать звонки с вашего устройства одним нажатием кнопки в кристально чистом качестве благодаря ультра-чувствительному встроенному двойному микрофону, который позволяет использовать Solix-1 в качестве устройства громкой связи</li>\r\n 	<li><b>Батарея, которая не заканчивается:</b> Мощная аккумуляторная батарея в 120mAh обеспечивает воспроизведения музыки до 4-х часов, в режиме ожидания до 45 часов и в режиме разговора до 7 часов</li>\r\n</ul>\r\nПодключите 2 устройства одновременно: Функциональные возможности Solix-1 позволяют подключать 2 устройства одновременно<span id="copyinfo">.\r\n</span>', 'Беспроводные наушники Solix-1', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диаметр динамика</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">40мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">110 дБ ± 3 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Частота</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20Гц-20кГц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">32</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Входной разъем</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">3,5 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1,5 м</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'besprovodnye-naushniki-solix-1', '', '', '2016-12-10 16:57:05', '2016-12-10 14:57:05', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/besprovodnye-naushniki-solix-1/', 0, 'product', '', 0),
