(5916, 1, '2016-12-10 16:57:05', '2016-12-10 14:57:05', '<b>Promate Astro </b>— имеет пассивное шумоподавление, встроенные сенсорные кнопки управления музыкой и звонками.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li><b>Без провода:</b> Не важно где вы находитесь, всегда будьте со своей музыкой с помощью Astro — беспроводными стерео наушниками</li>\r\n 	<li><b>Улучшенная акустика:</b> Ощутите акустическое блаженство с помощью беспроводной технологии, которая позволит вам почувствовать вашу любимую музыку так же как и услышать</li>\r\n 	<li><b>Длительный срок службы батареи:</b> Встроенная перезаряжаемая литий-полимерная батарея, поддерживает до 6 часов проигрывания музыки/ разговора.</li>\r\n 	<li><b>Пассивное шумоподавление:</b> Наслаждайтесь любимой музыкой без каких-либо помех</li>\r\n 	<li><b>Эргономичный дизайн:</b> Созданы для комфорта. Удобная эргономика и мягкие амбюшуры обеспечивают комфорт при ношении и максимально качественное шумоподавление</li>\r\n 	<li><b>Портативность:</b> Ультра-легкий дизайн делает Astro очень портативным аксессуаром для повседневного использования</li>\r\n 	<li><b>Прочная конструкция:</b> Эта гарнитура сделана прочно, чтобы обеспечить постоянное использование не теряя форму<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Беспроводные наушники Astro', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Версия Bluetooth</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">3</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Набор микросхем Bluetooth: </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Jianrong 6631B</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Входное напряжение: </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">3,7 В</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">2x10MW</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">32Ω</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Частота</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 Гц ~ 20 кГц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">38dB ± 3дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Время зарядки</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">~ 2 часа</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Время звучания</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">~ 6 часов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость батареи</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">300mAh</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'besprovodnye-naushniki-astro', '', '', '2016-12-10 16:57:05', '2016-12-10 14:57:05', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/besprovodnye-naushniki-astro/', 0, 'product', '', 0),
