(5923, 1, '2016-12-10 16:57:05', '2016-12-10 14:57:05', '<b>Promate Ace</b> — беспроводная гарнитура для разговора и проигрывания музыки.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Различное использование: отвечайте на звонки или слушайте музыку на ходу без проводов</li>\r\n 	<li>Гарнитура совместима с абсолютно всеми устройствами</li>\r\n 	<li>Встроенный микрофон обеспечивает четкое звучание во время разговора</li>\r\n 	<li>Современный дизайн будет гармонично подчеркивать ваш стиль</li>\r\n 	<li>Ace поддерживает функцию подключения сразу нескольких устройств</li>\r\n 	<li>Благодаря беспроводным технологиям, Ace занимает очень мало места и вы сможете хранить его даже в вашем кошельке</li>\r\n 	<li>Мягкие ушные вкладыши обеспечивают комфорт и надежную фиксацию в ухе</li>\r\n 	<li>Аккумулятор обеспечивает длительное прослушивание вашей любимой музык<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Bluetooth Гарнитура Ace', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Версия Bluetooth</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> v4.1 + EDR</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Профили Bluetooth</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> HSP, HFP, A2DP</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Входное напряжение: </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">5V</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Bluetooth Частота</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 2,4 ГГц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Сопротивление</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align