(5949, 1, '2016-12-10 16:57:09', '2016-12-10 14:57:09', 'Обеспечьте ваш MacBook Air этой легкой, изящной и тонкой защитой. Изготовленный из влагоустойчивой кожи высшего качества с внешней стороны и отделанный мягкой замшей с внутренней, MacLine-Air11 защищает ваш дорогой MacBook Air от всяких мелких неприятностей (потертости, царапины и т.д.) куда бы вы не пошли. Технические вырезы обеспечивают легкий доступ ко всем портам и кнопкам управления. Гениально разработанные перфорированные отверстия на задней крышке позволяют Вашему MacBook Air охлаждаться так, как он это делал без чехла.\r\n\r\n<b>Совместимость:</b> MacBook Air 11"\r\n\r\n<b>Возможности</b>:\r\n<ul>\r\n 	<li>Стильный, легкий, тонкий</li>\r\n 	<li>Изготовлен из влагоустойчивой кожи высшего качества, внутренняя отделка — из мягкой замши</li>\r\n 	<li>Легкий доступ по всем портам, кнопкам управления и т.д.</li>\r\n 	<li>Перфорированные отверстия позволяют охлаждаться компьютеру так, как он это делал без чехла<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Накладка на Macbook-11 Air macline-11 air', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защелка</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">11"-13"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Натуральная кожа</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'nakladka-na-macbook-11-air-macline-11-air', '', '', '2016-12-10 16:57:09', '2016-12-10 14:57:09', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/nakladka-na-macbook-11-air-