(5952, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate Rustic</b> — прочный беспроводной динамик с функцией громкой связи.\r\n\r\n<b>Компактный дизайн:</b> легкий корпус высокого качества.\r\n\r\n<b>Прекрасный чистый звук: </b>наслаждайтесь прослушиванием музыки, кристально чистой, благодаря технологии DSP 3D объемного стереозвука.\r\n\r\n<b>Уникальный и ультрапортативный динамик:</b> гладкий цилиндрический корпус для более удобного перемещения.\r\n\r\n<b>Ударопрочный дизайн:</b> устойчивость к истиранию поверхности, защита от случайных падений.\r\n\r\n<b>Handsfree функция:</b> в то время как Rustic подключен к вашему устройству, вы сможете отвечать на телефонные звонки через соединение Bluetooth или кабель Aux.\r\n\r\n<b>Аккумулятор:</b> безгранично прослушивайте музыку без проводов с мощным аккумулятором до 4 часов.\r\n\r\n<b>Удобство использования:</b> легкие в использовании элементы управления для воспроизведения музыки и ответа на звонки.\r\n\r\n<b>Универсальное подключение:</b> прослушивайте музыку без проводов с любого устройства, поддерживающего Bluetooth.\r\n\r\n<b>Micro-SD слот:</b> Micro-SD карта для прослушивания музыки, максимум 32 ГБ.\r\n\r\n<b>Множество вариантов подключения:</b> MP3-плееров и других устройств.<span id="copyinfo">\r\n</span>\r\n\r\n</div>', 'Bluetooth Колонка Rustic', 'Формат акустики 2.0\r\nИнтерфейсы microSD-ридером\r\nBluetooth\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Комбинированное исполнение (пластик, металл)\r\nСистема кодирования звука Dolby\r\nВыходная мощность 2 х 3 Вт\r\nКоличество одновременных Bluetooth-соединений Одно подключение\r\nДиапазон частот 60 - 20 000 Гц\r\nЗащита Покрытие устойчивое к изнашиванию\r\nДополнительно Bluetooth v2.1+EDR\r\nПрофили Bluetooth: HFP, HSP, A2DP\r\nРадиус действия: до 10 м\r\nВстроенный микрофон\r\nСопротивление: 4 Ом\r\nПрактичный карабин\r\nВстроенный аккумулятор\r\nЕмкость аккумулятора: 800 мА*ч\r\nDSP 3D объемный стереозвук\r\nКомплект Bluetooth динамик\r\nКарабин\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 150 х 50 х 50 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-rustic', '', '', '2016-12-10 16:57:14', '2016-12-10 14:57:14', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-rustic/', 0, 'product', '', 0),
