(5954, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', '<strong>Promate Medal</strong> превратит вашу обычную прогулку в дискотеку, а выезд на пикник или поход — на пляж в веселую вечеринку. Четкое и чистое звучание удовлетворит запросы даже требовательных пользователей. Прослушивание музыки с вашего телефона не потребует проводов. Так же Medal может использоваться как handsfree.\r\n\r\n<strong>Особенности: </strong>\r\n<ul>\r\n 	<li>Потоковое воспроизведение звука с любого носителя поддерживающего Bluetooth</li>\r\n 	<li>Возможность сопряжения с телефоном и использования как handsfree</li>\r\n 	<li>Компактный и портативный, легко носить с собой куда и когда угодно</li>\r\n 	<li>Карабин для крепления к лямке рюкзака или к ремню</li>\r\n 	<li>Синхронизируется с iPad, iPhone, iPod touch, Android и другими девайсами на расстоянии до 10 метров</li>\r\n 	<li>Легкие элементы управления для воспроизведения музыки и разговора по handsfree</li>\r\n 	<li>Слот для MicroSD(TF) card Встроенный аккумулятор, обеспечивающий до 8 часов беспрерывного звучания</li>\r\n</ul>\r\n&nbsp;', 'Bluetooth Колонка Medal', '<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="width: 40%;">Формат акустики</td>\r\n<td style="width: 60%;">1.0</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;">Интерфейсы</td>\r\n<td style="width: 69%;">microSD-ридером\r\nBluetooth\r\n3.5 мм (Mini-Jack)\r\nmicroUSB</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;">Bluetooth</td>\r\n<td style="width: 69%;">3.5 мм (Mini-Jack)</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;">microUSB</td>\r\n<td style="width: 69%;"></td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;"></td>\r\n<td style="width: 69%;"></td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;"></td>\r\n<td style="width: 69%;"></td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;"></td>\r\n<td style="width: 69%;"></td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;"></td>\r\n<td style="width: 69%;"></td>\r\n</tr>\r\n<tr>\r\n<td style="width: 27%;"></td>\r\n<td style="wid