(5957, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate Flash</b> — беспроводной прочный динамик с светодиодным эквалайзером.\r\n\r\n<b>Почувствуй живой звук:</b> Flash обеспечивает удивительно громкое и впечатляюще чистое звучание аудио благодаря использованию самых современных технологий в области раскрытия звука.\r\n\r\n<b>Беспроводная связь:</b> проигрывайте любимые треки с помощью любого совместимого устройства Bluetooth.\r\n\r\n<b>5 пользовательский светодиодных тем:</b> идеально подходит для вечеринок и энтузиастов в музыке. С 5 разноцветными светодиодными темами, безусловно, вы будете соответствовать вашей любимой музыке.\r\n\r\n<b>NFC подключение:</b> наслаждайтесь новейшими технологиями одним легким нажатием одной кнопки спаривания смарт-устройств через NFC.\r\n\r\n<b>Длительная работа от батареи:</b> с его встроенным аккумулятором, вы можете наслаждаться музыкой непрерывно.<span id="copyinfo">\r\n</span>\r\n\r\n</div>', 'Bluetooth Колонка Flash', 'Формат акустики 1.0\r\nИнтерфейсы microSD-ридером\r\nBluetooth\r\nNFC\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Комбинированное исполнение (пластик, металл)\r\nСистема кодирования звука Dolby\r\nВыходная мощность 4 Вт\r\nКоличество одновременных Bluetooth-соединений Более одного\r\nЗащита Покрытие устойчивое к изнашиванию\r\nДополнительно Bluetooth v4.0\r\nПрофили Bluetooth: HFP, HSP, A2DP\r\nРадиус действия: до 10 м\r\nВстроенный микрофон\r\nСопротивление: 4 Ом\r\nВстроенный аккумулятор\r\nЕмкость аккумулятора: 2200 мА*ч\r\nВремя зарядки аккумулятора: 3.5 часа\r\nВремя проигрывания музыки: 5-7 часов\r\nКомплект Bluetooth динамик\r\nКарабин\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 90 х 90 х 46 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-flash', '', '', '2016-12-10 16:57:14', '2016-12-1