(5959, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nМы считаем, что вы ни в коем случае не должны искать компромисс между качеством звука и портативностью. Представляем вашему вниманию беспроводной ультрапортативный динамик. Даже с его ультракомпактными размерами динамик обеспечивает высококачественный звук. Он может быть просто пристегнут к вашему рюкзаку или на джинсы! Вы можете воспроизводить на нем любые звуки с любого мобильного девайса, оснащенного технологией Bluetooth и даже слушать любимые треки с помощью встроенного устройства для чтения MicroSD(TF) карт. Wee также может быть использован для ответа на звонок. Все это помещается внутри износостойкого алюминиевого корпуса. Wee — идеальное аудиорешение для воспроизведения музыки как в помещении, так и вне его!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Высококачественный легкий алюминиевый корпус</li>\r\n 	<li>Тонкий динамик</li>\r\n 	<li>Стойкое к царапинам покрытие</li>\r\n 	<li>Удобный и портативный</li>\r\n 	<li>Возможность использования для ответа на звонки</li>\r\n 	<li>Удобная навигация для проигрывания музыки и ответов на звонки</li>\r\n 	<li>Воспроизводит музыку с любого оснащенного Bluetooth прибора.</li>\r\n</ul>\r\n</div>', 'Bluetooth Колонка Wee', 'Формат акустики 1.0\r\nИнтерфейсы microSD-ридером\r\nBluetooth\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса металл\r\nСистема кодирования звука Dolby\r\nВыходная мощность 3 Вт\r\nКоличество одновременных Bluetooth-соединений Более одного\r\nДиапазон частот 50 - 18 000 Гц\r\nДополнительно Bluetooth v4.0\r\nПрофили Bluetooth: HFP, HSP, A2DP\r\nРадиус действия: до 10 м\r\nВстроенный микрофон\r\nСопротивление: 4 Ом\r\nВстроенный аккумулятор\r\nЕмкость аккумулятора: 800 мА*ч\r\nВремя зарядки аккумулятора: 4.5 часа\r\nВремя проигрывания музыки: 6 часов\r\nКомплект Bluetooth динамик\r\nКарабин\r\nКабель Micro USB дл