(5963, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', 'Настройтесь на отличную музыку с новым динамиком от Promate. В отличие от фронтальных колонок, которые посылают звук только в одном направлении, Spire имеет всенаправленный звук, который заполняет звуком помещение равномерно. Также прибор оснащен специальным индикатором, который позволяет вам "видеть" и "чувствовать" ритм. К вашим услугам высокочувствительное сенсорное управление, которое позволит с легкостью управлять прослушиванием: встряхните динамик, чтобы перейти к следующей песне. Spire также имеет на борту вспомогательный порт, а также считыватель Micro-SD кард. Spire имеет возможность одновременного подключения: через Bluetooth и технологию NFC. Возможность двух видов коннекта позволяет подключить два устройства одновременно. Превратите ваш динамик в динамик телефона с помощью встроенного микрофона и универсальной кнопки для ответа на звонок. Музыка и общение — лучшее решение от Spire! <span id="copyinfo">\r\n</span>', 'Bluetooth Колонка Spire', 'Формат акустики 1.0\r\nИнтерфейсы microSD-ридером\r\nBluetooth\r\nNFC\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Комбинированное исполнение (пластик, металл)\r\nСистема кодирования звука Dolby\r\nВыходная мощность 3 Вт\r\nКоличество одновременных Bluetooth-соединений Более одного\r\nДиапазон частот 60 - 20 000 Гц\r\nДополнительно Bluetooth v3.0+EDR\r\nПрофили Bluetooth: HFP, HSP, A2DP\r\nРадиус действия: до 10 м\r\nВстроенный микрофон\r\nСопротивление: 4 Ом\r\nВстроенный аккумулятор\r\nЕмкость аккумулятора: 800 мА*ч\r\nВремя зарядки аккумулятора: 5 часов\r\nВремя проигрывания музыки: 5-6 часов\r\nКомплект Bluetooth динамик\r\nКарабин\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 90 х 72 х 72 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-spire', '', '', '2016-12-10 16:57:14', '2016-12-10 14:57:14', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-spire/', 0, 'product', '', 0),
