(5967, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nBikeRock — суперспортивный Bluetooth динамик с креплением на велосипед, для длительных вело прогулок под ритмы вашей любимой музыки. Простота в навигации клавиш управления предусмотрена специально для минимального отвлечения от дороги во время езды. Вы всегда можете оставаться на связи со своими друзьями и близкими с помощью встроенной функции Hands-Free. Ёмкая батарея позволит не расставаться с музыкой на протяжении всей поездки. Легкий и компактный дизайн позволяет установить BikeRock на любую раму. BikeRock — эмоция которая всегда с вами!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Тонкий и очень компактный</li>\r\n 	<li>Крепление на велосипед</li>\r\n 	<li>Интуитивно простые клавиши управления</li>\r\n 	<li>Встроенный аккумулятор</li>\r\n 	<li>Встроенная функция Hands-Free</li>\r\n 	<li>Удобная и легкая навигация по списку плэйлиста.</li>\r\n</ul>\r\n</div>', 'Bluetooth Колонка Bikerock', 'Формат акустики 1.0\r\nИнтерфейсы microSD-ридером\r\nBluetooth\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Пластик\r\nСистема кодирования звука Dolby\r\nВыходная мощность 3 Вт\r\nКоличество одновременных Bluetooth-соединений Одно подключение\r\nДиапазон частот 100 - 20 000 Гц\r\nДополнительно Bluetooth v2.1+EDR\r\nПрофили Bluetooth: HFP, HSP, A2DP, AVRCP\r\nРадиус действия: до 10 м\r\nВстроенный микрофон\r\nСопротивление: 4 Ом\r\nВстроенный аккумулятор\r\nЕмкость аккумулятора: 500 мА*ч\r\nВремя зарядки аккумулятора: 3-5 часов\r\nВремя проигрывания музыки: 8 часов (При постоянной громкости звука 75%)\r\nКомплект Bluetooth динамик\r\nКрепление на велосипед\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 83 x 77 x 37 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-bikerock', '', '', '2016-12-10 16:57:14', '2016-12-10 14:5