(5969, 1, '2016-12-10 16:57:14', '2016-12-10 14:57:14', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Orbit</b> является универсальным портативным стереодинамиком. Его уникальный дизайн в виде шара и разноцветная коллекция предлагает чуть больше, чем просто модный девайс ― это, прежде всего, выдающийся звук. Динамик оснащен универсальным аудио разъемом и параллельно с технологией Bluetooth, который может воспроизводить любимые мелодии с любого современного источника звука. Благодаря своего встроенному перезаряжаемому аккумулятору, вы можете взять <b>Orbit</b> буквально в любое место, да и в багаже он не будет лишним.\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>Универсальный портативный Bluetooth динамик</li>\r\n 	<li>Возможность одновременного подключения двух динамиков</li>\r\n 	<li>Совместим со всеми видами мобильных телефонов, музыкальных плееров, ноутбуков, смартфонов, планшетных компьютеров</li>\r\n 	<li>Встроенный усилитель</li>\r\n 	<li>Удобный контроль громкости звука</li>\r\n 	<li>Встроенная заряжаемая батарея</li>\r\n 	<li>3.5 мм вход</li>\r\n 	<li>Память последнего сопряженного девайса</li>\r\n 	<li>Micro-USB порт для зарядки<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Bluetooth Колонка Orbit', 'Формат акустики 2.0\r\nИнтерфейсы AUX\r\nBluetooth\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Пластик\r\nСистема кодирования звука Dolby\r\nВыходная мощность 4 Вт\r\nКоличество одновременных Bluetooth-соединений Более одного\r\nДиапазон частот 200 - 18000 Гц\r\nДополнительно Встроенный аккумулятор\r\nВозможность получения объемного 3D звучания при подсоединении 2х колонок\r\nВерсия Bluetooth: 4.0\r\nВремя зарядки аккумулятора: 4 часа\r\nВремя проигрывания музыки: 5 часов\r\nЕмкость аккумулятора: 900 мАч\r\nРадиус действия: 10 м\r\nКомплект Bluetooth динамик\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 90 х 90 х 90 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-orbit', '', '', '2016-12-10 16:57:14', '2016-12-10 14:57:14', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-orbit/', 0, 'product', '', 0),
