(5975, 1, '2016-12-10 16:57:18', '2016-12-10 14:57:18', '<b>Promate bikerMate</b> станет непременным спутником для городской вело прогулки, отдыха с ночевкой на природе для вас и ваших родных, а так же займет свое достойное место в офисной жизни. Компактный дизайн: <b>bikerMate</b> не загромоздит ваш стол и займет совсем мало места в сумке при поездке, при этом Вы в полной мере насладитесь всеми функциями, которые он в себя включает.\r\n\r\n<b>Маленький но громкий</b>\r\nВстроенный беспроводной динамик мощностью 3 Вт обеспечит достаточно громкое и главное очень качественное воспроизведение музыки любом месте, где бы вы не находились.\r\n\r\n<b>Встроенная функция Handsfree</b>\r\nПозволяет принимать звонки, выводя звук на беспроводной динамик одним нажатием кнопки. Благодаря встроенному ультра-чувствительному микрофону ваш оппонент на другом конце телефона услышит каждое слово и каждый звук, которые вы произнесете.\r\n\r\n<b>Всепогодный дизайн</b>\r\nbikerMate сертифицирован на водонепроницаемость на уровень IPX4, т.е. вы можете не беспокоится если он намокнет под дождем во время прогулки по улице или поездки на велосипеде.\r\n\r\n<b>Крепление для велосипеда</b>\r\nДля удобства использования на вело прогулке с <b>bikerMate</b> в комплекте предусмотрено крепление, с помощью которого колонка надежно крепится к рулю вашего велосипеда, либо к любой другой круглой арматуре или трубе.\r\n\r\n<b>Зарядка в дорогу</b>\r\nБлагодаря встроенному аккумулятору емкость 8000 мАч, вы без труда сможете подзарядить любой электронный гаджет. Соединительный кабель micro-USB входит в комплект. С <b>bikerMate</b> заряд ваших электронных девайсов не иссякнет ни когда.\r\n\r\n<b>Сдвоенный LED фонарь</b>\r\nДва супер яркие светодиода, осветят дорогу в темноте когда вы едите на велосипеде или могут использоваться как простой портативный фонарь с встроенным аккумулятором. Так же в <b>bikerMate</b> встроена функция аварийного маячка, который сможет привлечь внимание и подать сигнал SOS в случае не предвиденной ситуации.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Bluetooth Колонка Bikermate', 'Особенности с Влагозащитой\r\n<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Формат акустики</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">2.0</td>\r\n</tr>\r\n<tr style="height: 96px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 96px;">Интерфейсы</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">AUX\r\nBluetooth\r\nmicroUSB</td>\r\n</tr>\r\n<tr style="height: 48px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 48px;">Питание</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">от Аккумулятора\r\nот Сети</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Тип</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Портативные</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Материал корпуса</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Пластик</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Особенности</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">с Влагозащитой</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Система кодирования звука</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Dolby</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Выходная мощность</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">3 Вт</td>\r\n</tr>\r\n<tr style="height: 67px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 67px;">Количество одновременных Bluetooth-соединений</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Более одного</td>\r\n</tr>\r\n<tr style="height: 67px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 67px;">Диапазон частот</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">80-20000 Гц</td>\r\n</tr>\r\n<tr style="height: 67px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 67px;">Защита</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Уровень водонепроницаемости: IPX4</td>\r\n</tr>\r\n<tr style="height: 240px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 240px;">Дополнительно</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Чувствительность: 75 дБ\r\nСопротивление: 4 Ом\r\nВерсия Bluetooth: 4.0\r\nЕмкость аккумулятора: 8000 мАч\r\nДистанция сопряжения с девайсами: 10 м\r\nВремя работы: до 11 ч\r\nВремя зарядки: около 12 ч</td>\r\n</tr>\r\n<tr style="height: 38px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 38px;">Комплект</td>\r\n<td style="height: 43px; width: 788px; padding-bottom: 20px; vertical-align: top;">Bluetooth динамик\r\nАудиокабель с разъемом 3.5 мм\r\nКрепление на велосипед\r\nРуководство пользователя</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Размеры</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">96 х 35 х 40 мм</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Гарантия</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">12 месяцев</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-bikermate', '', '', '2016-12-10 16:57:18', '2016-12-10 14:57:18', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-bikermate/', 0, 'product', '', 0),
