(5978, 1, '2016-12-10 16:57:18', '2016-12-10 14:57:18', '<b>Promate Pyram</b> является универсальным портативным динамиком для всех мобильных и планшетных устройств.\r\nЛегкий и портативный <b>Pyram</b> гарантирует удивительный звук. Улучшенный встроенный усилитель обеспечивает глубокий бас.\r\nБогатая цветовая палитра и отличное качество продукта гарантирует максимальное удовольствие от использования прибора.\r\n<span id="copyinfo">\r\n</span><b>Возможности:</b>\r\n<ul>\r\n 	<li>Универсальный портативный Bluetooth динамик</li>\r\n 	<li>Порт для чтения Micro SD</li>\r\n 	<li>Ультра чувствительный высококачественный микрофон</li>\r\n 	<li>Совместим с большим количеством телефонов, музыкальных плееров, ноутбуков и планшетных компьютеров</li>\r\n 	<li>3.5 мм стерео вход</li>\r\n 	<li>Голосовые подсказки</li>\r\n 	<li>Компактный, ультра легкий</li>\r\n 	<li>Micro-USB порт для зарядки</li>\r\n</ul>', 'Bluetooth Колонка Pyram', '<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Формат акустики</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">1.0</td>\r\n</tr>\r\n<tr style="height: 96px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 96px;">Интерфейсы</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">AUX\r\nSD-ридером\r\nBluetooth\r\nmicroUSB</td>\r\n</tr>\r\n<tr style="height: 48px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 48px;">Питание</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">от Аккумулятора\r\nот Сети</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Тип</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Портативные</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Материал корпуса</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Пластик / ткань</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Система кодирования звука</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Dolby</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Выходная мощность</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">2 Вт</td>\r\n</tr>\r\n<tr style="height: 67px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 67px;">Количество одновременных Bluetooth-соединений</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Одно подключение</td>\r\n</tr>\r\n<tr style="height: 240px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 240px;">Дополнительно</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Голосовые подсказки\r\nMicro-USB порт для зарядки\r\nВерсия Bluetooth: 3.0\r\nВходящее напряжение: 5 В / 1A\r\nСопротивление: 3 Ω\r\nВремя зарядки: 2 часа\r\nВремя проигрывания музыки: 2 часа\r\nЕмкость аккумулятора: 800 мАч\r\nРадиус действия: 10 м\r\nЕмкость Micro SD Card: до 32 ГБ</td>\r\n</tr>\r\n<tr style="height: 38px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 38px;">Комплект</td>\r\n<td style="height: 43px; width: 788px; padding-bottom: 20px; vertical-align: top;">Bluetooth динамик\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Размеры</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">70 х 90 х 75 мм</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Гарантия</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">12 месяцев</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-pyram', '', '', '2016-12-10 16:57:18', '2016-12-10 14:57:18', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-pyram/', 0, 'product', '', 0),
