(5981, 1, '2016-12-10 16:57:18', '2016-12-10 14:57:18', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Groove</b> ― беспроводная акустическая система с тремя динамиками Surround Sound, AUX портом и слотом для microSD карт.\r\n\r\n<b>Мощный звук</b>\r\nДинамики, мощностью в 20 Вт перенесут ваши впечатления от прослушивания музыки на новый уровень.\r\n\r\n<b>DSP Surround Sound</b>\r\nТройные динамики Surround Sound обеспечат правильное распределение каналов. С <b>Groove</b> музыка звучит именно так, как и задумывалась автором.\r\n\r\n<b>Функция Hands-Free</b>\r\nПринимайте входящие вызовы прямо через Groove с помощью функции Hands-Free. Встроенный микрофон и система шумоподавления обеспечат чистейший звук для вас и вашего собеседника.\r\n\r\n<b>Различные варианты подключения:</b>\r\nНаслаждайтесь любимой музыкой используя беспроводное подключение Bluetooth или 3.5 мм аудио-выход.\r\n\r\n<b>Простое управление</b>\r\nУправляйте музыкой и плейлистами с помощью сенсорной панели управления.\r\n\r\n<b>Емкостный аккумулятор</b>\r\n<b>Groove</b> имеет встроенный 8800 мАч аккумулятор, который позволит Вам наслаждаться музыкой до 10 часов без подзарядки.\r\n\r\n<b>Функция резервного питания</b>\r\n<b>Groove</b> может использоваться как резервный аккумулятор для зарядки ваших гаджетов.\r\n\r\n</div>', 'Bluetooth Колонка Groove', 'Формат акустики 3.0\r\nИнтерфейсы AUX\r\nSD-ридером\r\nBluetooth\r\n3.5 мм (Mini-Jack)\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Пластик / металл / кожа\r\nСистема кодирования звука Dolby\r\nВыходная мощность 20 Вт\r\nКоличество одновременных Bluetooth-соединений Более одного\r\nДополнительно Функция громкой связи\r\nВерсия Bluetooth: 4.0\r\nBluletooth чипсет: Action ATS2805B\r\nЧастота Bluetooth: 2.4 ГГц\r\nBluetooth профили: A2DP, HFP, HSP, EDR\r\nЕмкость аккумулятора: 8800 мАч\r\nВходное напряжение: 5 В, 1 A\r\nДистанция сопряжения с девайсами: 10 м\r\nВремя работы: 10 часов\r\nВремя зарядки: 8 часов\r\nКомплект Bluetooth динамик\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 250 х 140 х 34 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-groove', '', '', '2016-12-10 16:57:18', '2016-12-10 14:57:18', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-groove/', 0, 'product', '', 0),
