(5987, 1, '2016-12-10 16:57:18', '2016-12-10 14:57:18', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>aquaBox</b> ― универсальный влагостойкий Bluetooth 3.0 динамик, идеально подходящий для приключений.\r\n\r\n<strong>Возможности: </strong>\r\n<ul>\r\n 	<li>Уровень водостойкости IPX5 обеспечивает надежную защиту от воды: брызги на лодке, у бассейна или в ванной ему абсолютно не страшны</li>\r\n 	<li>Простые в использовании элементы управления на боковой стороне устройства позволяют управлять музыкой и отвечать на вызовы нажатием кнопок</li>\r\n 	<li>Устройство можно синхронизировать с любым устройством, обладающим технологией Bluetooth, как, например iPad, iPhone, Android и т.д. на расстоянии до 10 метров</li>\r\n 	<li>Удобная панель управления вызовами и музыкой</li>\r\n 	<li>Позволяет использовать как гарнитуру к смартфону</li>\r\n 	<li>Встроенная мощная батарея 800 мАч позволяющая прослушивать музыку до 4 часов без перерыва<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Bluetooth Колонка Aguabox', '<table style="width: 100%;">\r\n<tbody>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 43px;">Формат акустики</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">1.0</td>\r\n</tr>\r\n<tr style="height: 96px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 96px;">Интерфейсы</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">AUX\r\nBluetooth\r\nmicroUSB</td>\r\n</tr>\r\n<tr style="height: 48px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 48px;">Питание</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">от Аккумулятора\r\nот Сети</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 43px;">Тип</td>\r\n<td s