 <span id="copyinfo">\r\n</span></td>\r\n</tr>\r\n<tr style="height: 240px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 240px;">Дополнительно</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">Функция громкой связи\r\nСопротивление: 47 Ом\r\nЧувствительность микрофона: -42 ± 3 дБ\r\nСоотношение сигнал/шум: 55-65 дБ\r\nВерсия Bluetooth: 3.0\r\nЕмкость аккумулятора: 800 мАч\r\nВходное напряжение: 5 В, 1 A\r\nДистанция сопряжения с девайсами: 10 м\r\nВремя работы: 4-5 часов\r\nВремя зарядки: 3-4 часа</td>\r\n</tr>\r\n<tr style="height: 38px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 38px;">Комплект</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">Bluetooth динамик\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 43px;">Рамеры</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">46 х 85 х 85 м</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 38.5007%; vertical-align: top; height: 43px;">Гарантия</td>\r\n<td style="height: 43px; width: 59.4993%; text-align: left; vertical-align: top;">12 месяцев</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-aguabox', '', '', '2016-12-10 16:57:18', '2016-12-10 14:57:18', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-aguabox/', 0, 'product', '', 0),
