(5989, 1, '2016-12-10 16:57:18', '2016-12-10 14:57:18', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nСозданный для экстрималов, <b>Mulotov</b> отвечает всем требованиям к портативным динамикам, которые хочется и можно взять с собой в дорогу или на природу! Облагает неплохими противоударными качествами и может использоваться практически в любых условиях. Возьмите его с собой в поход, кэмпинг, на рыбалку, на сафари в конце концов ― более удачного решения Вы не найдете. Дизайн предусматривает надежное крепление (на ремень, на рюкзак, да собственно, куда угодно, даже на палатку). Может быть использован для громкой связи (функция Hands-Free). Качество звука порадует даже ценителей. Несмотря на относительно небольшую мощность динамик может работать на достаточно громко, выдавая чистый звук в широком частотном диапазоне!\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>Противоударный динамик</li>\r\n 	<li>Компактный и портативный, легко взять с собой, куда бы вы не шли</li>\r\n 	<li>Удобное крепление на ремень, рюкзак и т.д.</li>\r\n 	<li>Опция Hands-Free со встроенным микрофоном</li>\r\n 	<li>3.5 мм аудио джек для коннекта с внешними устройствами<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Bluetooth Колонка Mulotov', 'Формат акустики 1.0\r\nИнтерфейсы AUX\r\nBluetooth\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Пластик / силикон\r\nСистема кодирования звука Dolby\r\nВыходная мощность 1.5 Вт\r\nКоличество одновременных Bluetooth-соединений Одно подключение\r\nДиапазон частот 85-20000 Гц\r\nДополнительно Чувствительность микрофона: -42 ± 2 дБ\r\nСоотношение сигнал/шум: 65 дБ\r\nСопротивление: 4 Ом\r\nВерсия Bluetooth: 2.1 + A2DP\r\nЕмкость аккумулятора: 500 мАч\r\nВходное напряжение: 5 В\r\nДистанция сопряжения с девайсами: 10 м\r\nВремя работы: 3 часа (при 75% громкости)\r\nВремя зарядки: 1.5 часа\r\nКомплект Bluetooth динамик\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 74 х 68 х 77 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-mulotov', '', '', '2016-12-10 16:57:18', '2016-12-10 14:57:18', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-mulotov/', 0, 'product', '', 0),
