(5991, 1, '2016-12-10 16:57:18', '2016-12-10 14:57:18', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate Radiant</b> ― многофункциональная беспроводная акустическая система с NFC-подключением.\r\n\r\n<b>Непревзойденное качество звука</b>\r\nМногофункциональный 15-ваттный динамик выводит уровень прослушивания музыки на следующий уровень.\r\n\r\n<b>Пассивные радиаторы</b>\r\nПассивные радиаторы поля низких частот позволят вам почувствовать ритм, что пробивается сквозь.\r\n\r\n<b>Функция вызова</b>\r\nПринимайте вызовы благодаря встроенной функции громкой связи. Встроенный микрофон использует передовые технологии шумоподавления для беспроводной громкой связи.\r\n\r\n<b>Несколько вариантов подключения</b>\r\nПроигрывайте ваши любимые треки с помощью различных вариантов подключения, доступных в <b>Radiant</b>. Слушайте его через беспроводное соединение или через 3.5-мм аудиоразъем.\r\n\r\n<b>Простая навигация</b>\r\nУдобная навигация по списку воспроизведения благодаря сенсорной панели управления.\r\n\r\n<b>Долгое время автономной работы</b>\r\nПроигрывайте ваши любимые треки без остановки до 5 часов благодаря литий-ионной батареи емкостью 4400 мАч.\r\n\r\n<b>Водостойкий</b>\r\n<b>Radiant</b> имеет уровень брызгозащиты IPX5. Является водонепроницаемым и, следовательно, вам не нужно беспокоиться о случайных брызгах и разливах. Вы даже можете поместить его под струю воды, но не стоит погружать его под воду.\r\n\r\n<b>NFC возможности подключения</b>\r\nНаслаждайтесь музыкой с функцией NFC Auto Pairing.\r\n\r\n<b>Универсальная совместимость</b>\r\n<b>Radiant</b> совместим со всеми Bluetooth устройствами.<span id="copyinfo">\r\n</span>\r\n\r\n</div>', 'Bluetooth Колонка Radiant', 'Формат акустики 2.0\r\nИнтерфейсы AUX\r\nBluetooth\r\nNFC\r\nmicroUSB\r\nПитание от Аккумулятора\r\nот Сети\r\nТип Портативные\r\nМатериал корпуса Пластик / металл\r\nОсобенности с Влагозащитой\r\nСистема кодирования звука Dolby\r\nВыходная мощность 15 Вт\r\nКоличество одновременных Bluetooth-соединений Более одного\r\nДиапазон частот 80-15000 Гц\r\nЗащита Уровень брызгозащиты IPX5\r\nДополнительно Версия Bluetooth: 2.1\r\nЧастота Bluetooth: 2.4 ГГц\r\nПрофили Bluetooth: A2DP, HFP, HSP, EDR\r\nПотребляемая мощность: 5 В , 1 A\r\nРабочее расстояние: 10 м\r\nВремя воспроизведения: до 5 часов\r\nКомплект Bluetooth динамик\r\nКабель Micro USB для зарядки\r\nАудиокабель с разъемом 3.5 мм\r\nРуководство пользователя\r\nРазмеры 320 х 60 х 160 мм', 'publish', 'open', 'closed', '', 'bluetooth-kolonka-radiant', '', '', '2016-12-10 16:57:18', '2016-12-10 14:57:18', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-kolonka-radiant/', 0, 'product', '', 0),
