(5993, 1, '2016-12-10 16:57:23', '2016-12-10 14:57:23', 'Беспроводная акустическая система <strong>Promate Prime</strong><b> </b>с Pro-Connect технологией.\r\n\r\n<b>Мощный динамик:</b>Многофункциональный 20-ваттный динамик переносит опыт прослушивания музыки на следующий уровень.\r\n\r\n<b>Расширенный Bass:</b>Двойные внешние пассивные радиаторы демонстрируют, насколько мощная ваша колонка.\r\n\r\n<b>Несколько вариантов подключения: </b>Проигрывайте ваши любимые треки с помощью различных вариантов подключения, доступных с Prime. Слушайте через беспроводное соединение Bluetooth, NFC или через 3.5-мм аудио-разъем.\r\n\r\n<b>Функции вызова: </b>Принимайте голосовые звонки благодаря встроенной функции громкой связи. Высококачественный микрофон с технологией шумоподавления поможет вам в этом.\r\n\r\n<b>Easy Music Navigation: </b>Удобная навигация по списку воспроизведения с при помощи панели управления.\r\n\r\n<b>Долгое время автономной работы: </b>Проигрывайте ваши любимые треки до 8 часов с литий-ионной батареей 6600 мАч.\r\n\r\n<b>Универсальная совместимость: </b>Prime совместима со всеми устройствами с технологией Bluetooth и NFC.\r\n\r\n<b>Pro-connect технология: </b>Позволяет подключать до 8 устройств с данной технологией чтобы создавать свое неповторимое объёмное звучание.<span id="copyinfo">\r\n</span>', 'Bluetooth Колонка Prime', '<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Формат акустики</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">3.0</td>\r\n</tr>\r\n<tr style="height: 96px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 96px;">Интерфейсы</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">AUX\r\nNFC\r\nUSB</td>\r\n</tr>\r\n<tr style="height: 48px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 48px;">Питание</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">от Аккумулятора\r\nот Сети</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Тип</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Портативные</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Материал корпуса</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Прорезиненный пластик</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Система кодирования звука</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;"> Dolby</td>\r\n</tr>\r\n<tr style="height: 43px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 43px;">Выходная мощность</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;"> 20 Вт</td>\r\n</tr>\r\n<tr style="height: 67px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 67px;">Количество одновременных Bluetooth-соединений</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Более одного</td>\r\n</tr>\r\n<tr style="height: 240px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 240px;">Дополнительно</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Встроенный аккумулятор\r\nВозможность получения объемного звучания при подсоединении от 2 до 8 колонок\r\nВерсия Bluetooth: v3/0\r\nВыходная мощность: 20 Вт\r\nВремя зарядки аккумулятора: 8 часов\r\nВремя проигрывания музыки: 8-9 часов\r\nЕмкость аккумулятора: 6600 мАч\r\nРадиус действия: 10 м</td>\r\n</tr>\r\n<tr style="height: 38px;">\r\n<td style="padding-bottom: 20px; width: 530px; vertical-align: top; height: 38px;">Комплект</td>\r\n<td style="height: 43px; vertical-align: top; width: 788px;">Bluetooth динамик\r\nСетевой кабель 2-pin\r\nА