(5996, 1, '2016-12-10 16:57:23', '2016-12-10 14:57:23', 'Больше не переживайте, что у вас разрядится мобильный телефон пока вы в пути: <b>aidBar-5</b> от <strong><i>Promate</i></strong> представляет собой компактный аккумулятор емкостью <b>5200 мАч</b>, который зарядит любой мобильный телефон или смартфон в любое время, когда это будет необходимо. Функция автозапуска гарантирует, что прибор включится и выключится сам при соединении с вашим устройством. Уникальность, компактность и многофункциональность являются основными преимуществами данной модели.\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Компактные размеры в гладком и функциональном корпусе, который легко носить с собой</li>\r\n 	<li>Универсальный USB-порт для зарядки устройств (1 А)</li>\r\n 	<li>Совместима со всеми USB-смартфонами и мобильными телефонами</li>\r\n 	<li>Функция автозапуска выключит прибор, если он не используется</li>\r\n 	<li>Встроенный блокиратор коротких замыканий и глубокой разрядки</li>\r\n 	<li>Зарядка посредством microUSB-порта</li>\r\n</ul>', 'УМБ Aidbar-5', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">5200</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; verti