(5999, 1, '2016-12-10 16:57:23', '2016-12-10 14:57:23', 'Больше не переживайте, что у вас разрядится мобильный телефон пока вы в пути: просто вставьте USB-кабель в компактную батарею <b>reliefMate-5 </b>от<strong> <i>Promate</i></strong> емкостью <b>5200 мАч</b>, и она зарядит ваше устройство без излишней суеты.\r\n\r\nБудучи чрезвычайно эргономичной и легкой, модель легко носить с собой, а благодаря своему умному светодиоду, вы сможете отслеживать состояние заряда.\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Компактные размеры и вес</li>\r\n 	<li>Функция автоматического отключения питания если устройство не используется</li>\r\n 	<li>USB-порт, позволяющий осуществлять зарядку вашего устройства</li>\r\n 	<li>Совместимость со всеми USB-смартфонами</li>\r\n 	<li>Функция автозапуска гарантирует, что прибор включится и выключится сам при соединении с вашим девайсом</li>\r\n 	<li>Защита от скачков напряжения, перезарядки и короткого замыкания</li>\r\n 	<li>Зарядка посредством microUSB-порта</li>\r\n</ul>', 'УМБ Reliefmate-5', 'Емкость 5200\r\nПодходит для зарядки Мобильных телефонов\r\nТип Универсальная батарея\r\nЗаряжается от USB\r\nТип зарядки Стандартная\r\nТехнология Литий-ионная\r\nВыход USB1 1 А\r\nРазмеры 87 x 45 x 22 мм\r\nВес 119 г', 'publish', 'open', 'closed', '', 'umb-reliefmate-6-2', '', '', '2016-12-10 16:57:23', '2016-12-10 14:57:23', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-reliefmate-6-2/', 0, 'product', '', 0),
