20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-ионная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB1 1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">95 x 26 x 23 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">94 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-aidbar-2', '', '', '2016-12-10 16:57:23', '2016-12-10 14:57:23', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-aidbar-2/', 0, 'product', '', 0),
