(6009, 1, '2016-12-10 16:57:23', '2016-12-10 14:57:23', 'Вы действительно можете больше не беспокоиться, что ваш планшет или смартфон останутся разряженными в самый неподходящий момент. С мощной универсальной батареей <b>proVolta-18</b> от Promate емкостью <b>18 000 мАч</b>, вы сможете зарядить ваши портативные устройства без лишней суеты.\r\n\r\nУникальная, компактная и многофункциональная, батарея дополнительно оснащена ярким LED-фонариком, который может подсветить вам в темноте, а также имеет индикацию заряда. Два порта позволяют одновременно заряжать 2 прибора, а функция автовыключения отключит аккумулятор, как только приборы будут заряжены на 100%.\r\n\r\n<b>Основные особенности:</b>\r\n<ul>\r\n 	<li>Продвинутая литиево-полимерная батарея с выдающейся производительностью</li>\r\n 	<li>Два порта для одновременной зарядки двух устройств</li>\r\n 	<li>Функция автоматического отключения выключит аккумулятор, если тот не используется</li>\r\n 	<li>Ультра яркий LED-фонарик</li>\r\n 	<li>Совместим со всеми смартфонами и планшетами</li>\r\n 	<li>Встроенная защита от короткого замыкания и перезарядки</li>\r\n 	<li>Умный LED-индикатор зарядки/разрядки прибора</li>\r\n</ul>', 'УМБ proVolta-18', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">18000</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-ионная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB2 2.1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">159 x 62 x 25 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">363 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-provolta-18', '', '', '2016-12-10 16:57:23', '2016-12-10 14:57:23', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-provolta-18/', 0, 'product', '', 0),
