(6012, 1, '2016-12-10 16:57:27', '2016-12-10 14:57:27', 'Универсальная мобильная батарея <b>Promate reliefMate-13</b> – это прекрасное решение для современных людей, особенно в условиях сегодняшнего быстрого образа жизни. Она имеет емкость 13 200 мА*ч, что позволит без проблем зарядить ваше мобильное устройство несколько раз.\r\n\r\nБлагодаря гладкому и удобному дизайну <b>reliefMate-13</b> легко носить с собой.\r\n\r\nНаличие двух USB портов позволяет осуществлять зарядку двух устройств одновременно.\r\n\r\nВстроенный LED фонарик добавляет еще большей функциональности <b>reliefMate-13</b>.\r\n\r\nСветодиодные индикаторы позволят Вам контролировать заряд батареи <b>Promate reliefMate-13</b>.\r\n\r\nВы можете не волноваться о коротких замыканиях и о полной разрядке вашей УМБ благодаря встроенной специальной защите.\r\n\r\n<b>Promate reliefMate-13</b> решение всех Ваших проблем, связанных с потребностью подзарядить гаджеты.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'УМБ reliefMate-13', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">13200</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20