(6016, 1, '2013-12-14 16:57:27', '2013-12-14 14:57:27', '<b>Promate Armor</b> — портативный заряжаемый аккумулятор емкостью 9000 мА*ч, который окажет помощь в подзарядке Ваших мобильных устройств в любых условиях.\r\n\r\nВы можете не волноваться о коротких замыканиях и о полной разрядке вашей УМБ благодаря встроенной специальной защите.\r\n\r\nВстроенный LED фонарик добавляет еще большей функциональности <b>Promate Armor.</b>\r\n\r\nСветодиодные индикаторы позволят Вам контролировать заряд батареи.\r\n\r\nУстройство имеет два порта USB, которые позволяют заряжать два прибора одновременно.\r\n\r\nУМБ <b>Promate Armor</b> обладает прочным корпусом из анодированного алюминия с толстой резиновой окантовкой, что делает его устойчивым к воздействиям пыли, грязи и воды.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'УМБ Armor', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">9000</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">С фонариком</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-ионная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB2 2.1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 5 В / 1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">120 x 70 x 25 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">268.5 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-armor', '', '', '2013-12-14 16:57:27', '2013-12-14 14:57:27', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-armor/', 0, 'product', '', 0),
