(6020, 1, '2016-12-10 16:57:27', '2016-12-10 14:57:27', 'Портативный аккумулятор <b>Promate Robust </b>емкостью 5200 мА*ч для подзарядки девайсов сконструирован таким образом, чтобы обеспечить Ваши гаджеты дополнительной энергией где бы Вы не были. Подходит для всех девайсов, заряжаемых с помощью USB. Два порта позволяют Вам одновременно заряжать два устройства, а функция автоматического выключения исключит расходование энергии впустую — если не будет присоединен ни один гаджет, то аккумулятор выключится автоматически.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>2 порта USB для одновременной зарядки двух устройств</li>\r\n 	<li>Функция автоматического выключения при отключении устройств</li>\r\n 	<li>Защита от перепадов напряжения, перезарядки и короткого замыкания</li>\r\n 	<li>Цифровой дисплей для информации об оставшемся заряде батареи</li>\r\n 	<li>Корпус изготовлен из ABS пластика и алюминия</li>\r\n</ul>', 'УМБ Robust', '<div class="detail-chars-l-i">Емкость5200</div>\r\n<div class="detail-chars-l-i">Подходит для зарядкиПланшетов\r\nМобильных телефонов</div>\r\n<div class="detail-chars-l-i">ТипУниверсальная батарея</div>\r\n<div class="detail-chars-l-i">Тип зарядкиСтандартная</div>\r\n<div class="detail-chars-l-i">Заряжается отUSB</div>\r\n<div class="detail-chars-l-i">ЦветЧерный</div>\r\n<div class="detail-chars-l-i">ТехнологияЛитий-ионная</div>\r\n<div class="detail-chars-l-i">Выход USB11 А</div>\r\n<div class="detail-chars-l-i">Выход USB22.1 А</div>\r\n<div class="detail-chars-l-i">\r\n\r\nВход DC5 В / 1 А<span id="copyinfo"></span>\r\n\r\n&nbsp;\r\n\r\n</div>', 'publish', 'open', 'closed', '', 'umb-robust', '', '', '2016-12-10 16:57:27', '2016-12-10 14:57:27', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-robust/', 0, 'product', '', 0),
