(6022, 1, '2016-12-10 16:57:27', '2016-12-10 14:57:27', 'УМБ с солнечной батареей <b>Promate solarMate-5</b> поможет Вам зарядить свой гаджет в любых условиях. Устройство имеет встроенный аккумулятор повышенной емкости.\r\nМонокристаллическая силиконовая солнечная панель обеспечивает зарядку аккумулятора, гарантируя полную независимость от источников электроэнергии. В дороге, на природе, в путешествии — <b>solarMate-5</b> никогда не останется без заряда. Встроенный LED индикатор всегда проинформирует об уровне зарядки.\r\nСолнце — это лучший возобновляемый источник энергии, используйте его с пользой для себя вместе с <b>solarMate-5</b>.\r\n\r\n<b>Особенности</b>\r\n<ul>\r\n 	<li>Защита от перепадов напряжения, короткого замыкания, перезарядки, переразряда, перегрева</li>\r\n 	<li>Монокристаллическая силиконовая солнечная панель</li>\r\n 	<li>Зарядка от солнечной панели при освещении лампой накаливания</li>\r\n 	<li>Теплорассеивающий корпус из ABS пластика</li>\r\n 	<li>Встроенный LED индикатор заряда батареи</li>\r\n 	<li>Встроенный LED фонарик</li>\r\n</ul>', 'УМБ Solarmate-5', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">5000</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная солнечная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Солнечной энергии </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 5 В / 1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">С фонариком</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-полимерная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB1 1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">130 x 65 x 15 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">225 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-solarmate-5', '', '', '2016-12-10 16:57:27', '2016-12-10 14:57:27', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-solarmate-5/', 0, 'product', '', 0),
