(6032, 1, '2013-12-13 16:57:31', '2013-12-13 14:57:31', '<b>Promate BoltQC </b>– это двухразъёмная УМБ с мощностью 9000 мАч и функцией быстрой зарядки.\r\n\r\nQualcomm Quick Charge 3.0 является самой быстрой и эффективной технологией зарядки на сегодня. Заряжайте свои устройства совместимые с функцией быстрой зарядки в 4 раза быстрее чем обычно!\r\n\r\nBoltQC может одновременно заряжать одно устройство с функцией быстрой зарядки (например, Galaxy S7, Nexus 6) и одно обычное устройство (например, iPhone, IPad), обеспечивая максимальную скорость зарядки в обоих случаях.\r\n\r\nУМБ BoltQC является абсолютно безопасной и надежной, поскольку оснащена функцией против короткого замыкания и функцией отключения зарядки при 100%.\r\n\r\nКомпактный и легкий: BoltQC легко носить с собой.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'УМБ BoltQC', '<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Емкость                                           9000</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Подходит для зарядки               Планшетов\r\nМобильных телефонов</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Тип                                                   Универсальная батарея</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Тип зарядки                                  Технология быстрой зарядки 3.0</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Заряжается от                               USB</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Технология                                    Литий-полимерная</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Выход USB1                                    3 А</div>\r\n<div id="pp-characteristics-tab-i" class="pp-characteristics-tab-i">Выход USB2                                   2.4 А</div>\r\n<div id="pp-characteristics-tab-i" class="pp-charact