(6040, 1, '2016-12-10 16:57:31', '2016-12-10 14:57:31', '<strong>Promate Polymax-10</strong> это сверхтонкая 10000 мА*ч Литий-полимерная батарея питания для смартфонов и планшетов.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Большая емкость: PolyMax-10 — 10000 мА*ч батарея, которая может заряжать все устройства на ходу.</li>\r\n 	<li>Быстрая зарядка: «Advanced Smart» технология, автоматически идентифицирует устройство, подключенное к УМБ и регулирует выход мощности напряжения тока для достижения эффективности оригинального зарядного устройства.</li>\r\n 	<li>Сверхтонкий: Polymax-10 является на 30% тоньше, чем большинство УМБ такой же мощности.</li>\r\n 	<li>Стильный дизайн: Деликатно созданный дизайн, комфортно лежит в руках.</li>\r\n 	<li>Ультра-Лайт: Вес всего-лишь 250 грамм.</li>\r\n 	<li>Polymax-10 имеет два порта USB, что позволяет заряжать 2 устройства одновременно по принципу «Power On-The-Go».</li>\r\n 	<li>Универсальная совместимость: Polymax-10 позволяет заряжать оба смартфона, а также планшеты и другие USB заряжаемые устройства.</li>\r\n 	<li>Стабильный заряд: Литий-полимерный аккумулятор обеспечивает стабильный и безопасный выходной заряд.</li>\r\n 	<li>Улучшенная конструкция цепи: Очень сложные и безопасные интеллектуальные микросхемы, которые обеспечивают защиту от короткого замыкания и защиту от перегрузки по току.</li>\r\n</ul>', 'УМБ Polymax-10', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">10000</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-полимерная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB2 2.1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">145 х 75 х 10 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">250 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-polymax-10', '', '', '2016-12-10 16:57:31', '2016-12-10 14:57:31', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-polymax-10/', 0, 'product', '', 0),
