(6044, 1, '2016-12-10 16:57:31', '2016-12-10 14:57:31', 'Прочная литий-полимерная УМБ с ультра-быстрым USB зарядным портом и сертифицированным по стандарту MFI (Made For iPhone) встроенным «Lightning Connector».\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Мощная батарея: Polymax-LT6 оснащена мощным 6000 мА*ч литий-полимерным зарядом.</li>\r\n 	<li>Встроенный Lightning Connector: Polymax-LT6 оснащен встроенным Lightning Connector, так что вы можете заряжать устройство без каких-либо хлопот.</li>\r\n 	<li>Порт Ultra-Fast USB: заряжайте устройства через порт сверхбыстрой зарядки.</li>\r\n 	<li>Легкий и портативный: Polymax-LT6 легкий и его удобно носить с собой.</li>\r\n 	<li>Автоматическое регулирование напряжения: Polymax-LT6 автоматически регулирует напряжение.</li>\r\n 	<li>Совместимость: Polymax-LT6 совместим со всеми устройствами, поддерживающими Lightning Connector &amp; USB Power.</li>\r\n 	<li>Безопасность и Надежность: Polymax-LT6 оснащен предохранителем от короткого замыкания.</li>\r\n</ul>', 'УМБ Polymax-lt6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">6000</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-полимерная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB1 2.1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">11.6 x 6.6 x 1.78 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">160 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-polymax-lt6', '', '', '2016-12-10 16:57:31', '2016-12-10 14:57:31', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-polymax-lt6/', 0, 'product', '', 0),
