(6046, 1, '2016-12-10 16:57:31', '2016-12-10 14:57:31', 'Литий-полимерная УМБ на 6000 мА*ч с сертифицированным по стандарту MFI (Made For iPhone) встроенным кабелем Apple Lightning и USB-портом на 2.4 А.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Большая емкость: volTag-LT6 — 6000 мА*ч батарея, которая может заряжать все устройства на ходу.</li>\r\n 	<li>Встроенный Lightning Connector: Polymax-LT6 оснащен встроенным Lightning Connector, так что вы можете заряжать устройство без каких-либо хлопот.</li>\r\n 	<li>Быстрая зарядка: Умная продвинутая технология быстрой зарядки автоматически идентифицирует подсоединенное устройство и обеспечивает качество и эффективность оригинальной зарядки.</li>\r\n 	<li>Ультра-тонкий: volTag-LT6 на 30% тоньше большинства представленных на рынке портативных аккумуляторов емкостью 6000 мА*ч.</li>\r\n 	<li>Стильный дизайн: Деликатно созданный дизайн и приятные тактильные ощущения.</li>\r\n 	<li>Ультра-легкий.</li>\r\n 	<li>Стабильная зарядка: Литий-полимерный аккумулятор обеспечивает стабильную и безопасную зарядку мобильных устройств.</li>\r\n 	<li>Улучшенная схемотехника: Умное программное обеспечение защищает смартфон от перезарядки, скачков напряжения и короткого замыкания.</li>\r\n</ul>', 'УМБ Voltag-lt6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">6000</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-полимерная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB1 2.4 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">123 x 60 x 10 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">280 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-voltag-lt6', '', '', '2016-12-10 16:57:31', '2016-12-10 14:57:31', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-voltag-lt6/', 0, 'product', '', 0),
