(6050, 1, '2016-12-10 16:57:31', '2016-12-10 14:57:31', '<b>Patrol</b> инновационное и мощное устройство, которое сочетает в себе три различных продукта: аккумулятор, пусковое устройство для автомобиля и светодиодный фонарь. Все интегрировано в одном сверх компактном мобильном устройстве с прекрасным дизайном. Patrol может стать прекрасным компаньоном во время долгих поездок, длительных полетов либо длинных деловых встреч, он не допустит разрядки ваших телефонов, планшетных компьютеров, ноутбуков и любых других гаджетов.\r\n\r\nФункция пускового устройства крайне актуально в нашей стране и порой наличие такого не заменимого девайса в машине — просто жизненная необходимость для автолюбителя (полностью заряженный Patrol гарантирует до 20 запусков стартера). Ультра-яркий светодиодный фонарь поможет вам сориентироваться в темноте. В случае непредвиденных ситуаций сигнальная вспышка SOS привлечет внимание и будет работать до 120 часов. Patrol на все случаи жизни!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Большая емкость 13500 мА*ч</li>\r\n 	<li>Ультра ёмкий и компактный</li>\r\n 	<li>Мощный источник питания в дорогу</li>\r\n 	<li>Безопасный и надежный</li>\r\n 	<li>Поддержка аварийного пуска, заменяет автомобильный аккумулятор при запуске</li>\r\n 	<li>При полной зарядке до 20 пусков стартера</li>\r\n 	<li>Встроенный LED фонарь и аварийный маячок</li>\r\n 	<li>LED лампа</li>\r\n 	<li>LED индикатор</li>\r\n 	<li>Совместим со всеми девайсами</li>\r\n 	<li>Встроенная защита от всех видов перенапряжения, перезарядки девайсов, перегрузок и коротких замыканий</li>\r\n</ul>\r\n<b>Дополнительные характеристики:</b>\r\n<ul>\r\n 	<li>Выход для ноутбука: 19 В / 3 A</li>\r\n 	<li>Выход для авто: 12 В</li>\r\n</ul>\r\n&nbsp;\r\n\r\n&nbsp;', 'УМБ Patrol', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Емкость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">13500</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная батарея</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Заряжается от </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Стандартная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">С фонариком</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Технология </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Литий-полимерная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB1 2.1 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">162 x 86 x 36 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">490 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'umb-patrol', '', '', '2016-12-10 16:57:31', '