(6053, 1, '2013-12-12 16:57:35', '2013-12-12 14:57:35', '<b>Автодержатель для телефона Promate MagView </b>- универсальный магнитный держатель для смартфонов и GPS навигаторов.\r\n\r\nДанный держатель гибкий и полностью настраиваемый под ваши потребности, чтобы обеспечить любые углы обзора. Поворотную возможность в 360⁰ позволяет наклонять MagView под оптимальный угол обзора для вас, будь то книжная или альбомная ориентация.\r\n\r\nМожете не беспокоится о безопасности вашего устройства, достаточно просто вставить, входящий в комплект, металлический диск на заднюю панель телефона, и поместить диск над центром магнитного держателя.\r\n\r\nВы можете прикрепить его как к лобовому стеклу, так и к любой другой ровной поверхности\r\n\r\nMagView может быть размещен на лобовом стекле или приборной панели и не упадет даже при жестких условиях езды.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Автодержатель Magview', 'Тип Автодержатели\r\nМесто установки Панель\r\nСтекло\r\nТип крепления Клейкая основа\r\nСовместимость Универсальный\r\nДополнительные характеристики Вес: 167 г\r\nЦвет Черный', 'publish', 'open', 'closed', '', 'avtoderzhateli-magview', '', '', '2013-12-12 16:57:35', '2013-12-12 14:57:35', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhateli-magview/', 0, 'product', '', 0),
