(6057, 1, '2013-12-13 16:57:35', '2013-12-13 14:57:35', '<b>Promate EZGrip</b> — компактный и легкий автомобильный держатель для любых устройств шириной до 8 см.\r\n\r\nПросто закрепите его на любом рулевом колесе, застегните замок, чтобы держатель «сидел» на месте, и вы все сделали. Никаких инструментов или клея не требуется! Ремень держателя можно обернуть вокруг чего угодно, будь то велосипедный руль или сумка. <b>EZGrip</b> может быть закреплен на любом руле без страха падения даже при жестких условиях вождения. Подходит ко всем устройствам шириной 5.5 — 8 см, а также к таким как Apple iPhone-х / IPod х, Samsung Galaxy / Note. Поддерживает все популярные устройства, GPS, камеры.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Крепкий зажим держит ваш телефон в безопасности все время</li>\r\n 	<li>Предотвращает скольжение, а также появление царапин на устройстве</li>\r\n 	<li>Простота установки</li>\r\n 	<li>Эластичная конструкция</li>\r\n 	<li>Супер совместимость</li>\r\n 	<li>Резиновые подкладки</li>\r\n</ul>', 'Автодержатель EZgrip', 'Тип Автодержатели\r\nМесто установки Руль\r\nТип крепления Зажим\r\nСовместимость Для устройств шириной от 5.5 до 8 см\r\nРазмеры 50 х 30 х 90 мм', 'publish', 'open', 'closed', '', 'avtoderzhateli-ezgrip', '', '', '2013-12-13 16:57:35', '2013-12-13 14:57:35', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhateli-ezgrip/', 0, 'product', '', 0),
