(6060, 1, '2016-12-10 16:57:35', '2016-12-10 14:57:35', '<b>Promate Ride-Pro</b> — универсальное и надежное крепление для смартфона на ваш велосипед.\r\n\r\nРаздвижные фиксаторы надежно фиксируют ваш смартфон, а шарнир даст возможность изменять положение относительно оси телефона на 360 градусов и настроить оптимальный угол обзора экрана. Универсальный пластиковый хомут всего за 2 минуты позволит установить <b>Ride-Pro</b> на руль любого велосипеда. <b>Ride-Pro</b> — для тех, кто ценит активный образ жизни!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Легко устанавливается без инструментов</li>\r\n 	<li>Отличный дизайн и возможность изменять положение относительно оси телефона на 360 градусов</li>\r\n 	<li>Удароустойчивые фиксаторы надежно удерживают ваш смартфон</li>\r\n 	<li>Держатель надежно фиксирует ваш телефон всего одной кнопкой</li>\r\n 	<li>Мощное и надежное велосипедное крепление</li>\r\n</ul>', 'Велосипедное крепление Ride-Pro', 'Тип Велосипедные крепления\r\nМесто установки Руль велосипеда\r\nТип крепления Зажим\r\nСовместимость Для устройств шириной от 4.2 до 8 см\r\nДополнительные характеристики Поворот головки на 360 градусов\r\nРазмеры 115 х 85 х 110 мм', 'publish', 'open', 'closed', '', 'velosipednye-krepleniya-ride-pro', '', '', '2016-12-10 16:57:35', '2016-12-10 14:57:35', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/velosipednye-krepleniya-ride-pro/', 0, 'product', '', 0),
(6061, 1, '2017-07-06 11:29:12', '2017-07-06 09:29:12', '', 'Велосипедное крепление Ride-Pro 1', '', 'inherit', 'open', 'closed', '', 'velosipednoe-kreplenie-ride-pro-1', '', '', '2017-07-06 11:29:12', '2017-07-06 09:29:12', '', 6060, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/Ride-Pro-6-1.jpg', 0, 'attachment', 'image/jpeg', 0),
(6062, 1, '2013-12-16 16:57:35', '2013-12-16 14:57:35', 'Универсальный держатель для смартфона на вентиляционное отверстие <b>VentGrip</b> от компании <i>Promate</i>.\r\n<ul>\r\n 	<li>Просмотр на 360°: Этот держатель поставляется с 360° поворотной головкой, которая может быть наклонена, чтобы соответствовать вашим оптимальным углам обзора, будь то "пейзаж" или "портрет"</li>\r\n 	<li>Простота в использовании: Безопасность вашего устройства не требует никаких усилий в связи с технологией быстрой установки. Просто прикрепите входящий в комплект поставки клеящийся металлический диск на заднюю панель смартфона, и поместите диск над центром магнитного держателя</li>\r\n 	<li>Универсальность: В компании Promate специально для VentGrip запатентовали зубцы предназначенные для надежного сцепления с любым вентиляционным отверстием любого автомобиля</li>\r\n 	<li>Простая конструкция: Нет защелок, кронштейнов, зажимов! Только магнитная сила, которая может обеспечить безопасность эксплуатации</li>\r\n 	<li>Безопасность: VentGrip размещается надежно без страха упасть даже при жестких условиях вождения</li>\r\n 	<li>Универсальная совместимость: VentGrip поддерживает смартфоны всех размеров — в том числе iPhone 6 Plus / 6 / 5s / 5 / 5C, Samsung Galaxy S7 / S6 и практически любой другой смартфон на рынке</li>\r\n</ul>', 'Автодержатель VentGrip', 'Тип Автодержатели\r\nМесто установки На дефлектор\r\nТип крепления Зажим\r\nСовместимость Для мобильных телефонов\r\nДополнительные характеристики Поворотная головка на 360°\r\nМагнитный держатель устройства\r\nВес, г: 110', 'publish', 'open', 'closed', '', 'avtoderzhateli-ventgrip', '', '', '2013-12-16 16:57:35', '2013-12-16 14:57:35', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhateli-ventgrip/', 0, 'product', '', 0),
