(6066, 1, '2016-12-10 16:57:35', '2016-12-10 14:57:35', 'Главная задача коврика — защита ваших электронных устройств от случайных падений и тряски во время движения автомобиля. <b>GriPad</b> имеет уникальное сцепление с приборной доской или центральной консолью и крепко держит все, что расположено на нем. Сотовый телефон, очки, GPS, камеры, ключи и любые другие предметы, помещенные на griPad не имеют ни одного шанса упасть вниз.\r\n\r\nКоврик не оставляет следов, является многоразовым и в случае загрязнения может быть помыт. Как только коврик начнет загрязняться, помойте и высушите его и он снова станет как новый. Компактный, легкий и простой в использовании — не имеет себе равных по качеству.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Для использования в автомобиле</li>\r\n 	<li>Изготовлен из мягкого геля с хорошей устойчивостью как к высоким, так и низким температурам</li>\r\n 	<li>Защищает все ваши ценности от падения при любых обстоятельствах</li>\r\n 	<li>Удерживает предметы на месте при движении, на поворотах, при прохождении лежачих полицейских, внезапных остановках и прочего</li>\r\n 	<li>Просто помойте и используйте заново</li>\r\n</ul>', 'Анти-сколзящий коврик griPad', 'ип Коврики\r\nМесто установки Панель\r\nТип крепления Клейкая основа\r\nСовместимость Телефоны\r\nGPS-навигаторы\r\nМелкие вещи (ключи, очки, ручки)', 'publish', 'open', 'closed', '', 'anti-skolzyashhij-kovrik-gripad', '', '', '2016-12-10 16:57:35', '2016-12-10 14:57:35', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/anti-skolzyashhij-kovrik-gripad/', 0, 'product', '', 0),
