(6070, 1, '2016-12-10 16:57:35', '2016-12-10 14:57:35', '<b>Promate proFirm.MU</b> — компактный и легкий автомобильный держатель для любых устройств шириной до 9.5 см.\r\n\r\nВыдвижные ручки, а также продуманное устройство фиксации обеспечивают надежное крепление к лобовому стеклу. ProFirm.MU имеет дополнительные накладки на держателях, которые надежно удерживают устройство. Благодаря вращающемуся шарниру, пользователь может настраивать удобный угол обзора.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Удобное и надежное автомобильное крепление</li>\r\n 	<li>Дополнительные накладки на ручки во избежание царапин на смартфоне</li>\r\n 	<li>Содержит материалы устойчивые как к высоким, так и низким температурам</li>\r\n 	<li>Установка и снятие крепления с помощью одной кнопки</li>\r\n</ul>', 'Автодержатель proFirm.MU', 'ип Автодержатели\r\nМесто установки Стекло\r\nТип крепления Вакуумная присоска\r\nСовместимость Для устройств шириной от 3.5 до 9.5 см', 'publish', 'open', 'closed', '', 'avtoderzhateli-profirm-mu', '', '', '2016-12-10 16:57:35', '2016-12-10 14:57:35', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhateli-profirm-mu/', 0, 'product', '', 0),
