(6072, 1, '2013-12-15 16:57:39', '2013-12-15 14:57:39', '<b>Promate proHolder3</b> – автомобильный держатель, который фиксируется универсальным крепежом к подголовнику сиденья автомобиля.\r\n\r\nПассажиры на задних сидениях могут с легкостью отрегулировать под себя удобный угол обзора благодаря шарниру. Прорезиненные раздвижные фиксаторы позволяют надежно закрепить планшетный компьютер с диагональю экрана от 7 до 10 дюймов.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Универсальное крепление для планшетного компьютера на подголовник</li>\r\n 	<li>Полностью настраиваемое</li>\r\n 	<li>Боковые фиксаторы для надежной фиксации планшетного компьютера</li>\r\n 	<li>Легкая установка без повреждений автомобиля</li>\r\n 	<li>Шарнир на 360 градусов, позволяющий максимально комфортно настроить обзор</li>\r\n</ul>', 'Автодержатель proHolder3', 'Тип Автодержатели\r\nМесто установки Подголовник\r\nТип крепления Зажим\r\nСовместимость Для устройств с диагональю 7-10"', 'publish', 'open', 'closed', '', 'avtoderzhateli-proholder3', '', '', '2013-12-15 16:57:39', '2013-12-15 14:57:39', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhateli-proholder3/', 0, 'product', '', 0),
(6073, 1, '2017-07-06 11:29:13', '2017-07-06 09:29:13', '', 'Автодержатель proHolder3 1', '', 'inherit', 'open', 'closed', '', 'avtoderzhatel-proholder3-1', '', '', '2017-07-06 11:29:13', '2017-07-06 09:29:13', '', 6072, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/proHolder3-2.jpg', 0, 'attachment', 'image/jpeg', 0),
(6074, 1, '2013-12-11 16:57:39', '2013-12-11 14:57:39', '<b>Promate proHolder4</b> — это универсальное крепление для фиксации планшетного компьютера между впереди стоящими сиденьями автомобиля.\r\n\r\nТелескопическая штанга может быть закреплена к подголовникам любой марки автомобиля. Прорезиненные крепежи надежно фиксируют и не царапают поверхность салона автомобиля. Ваш планшетный компьютер будет надежно закреплен и может безопасно использоваться как во время езды, так и во время стоянки. Конструкция proHolder4 обеспечивает полный доступ ко всем техническим портам и кнопкам планшетного компьютера.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Универсальное крепление для планшетного компьютера</li>\r\n 	<li>Крепежи регулируемые и прорезинены для безопасного крепления в салоне автомобиля</li>\r\n 	<li>Прорезиненные и гибкие фиксаторы для надежного крепления</li>\r\n 	<li>Легкая установка, не повреждая салон автомобиля</li>\r\n 	<li>Возможность регулировки крепления планшета для оптимального угла просмотра экрана</li>\r\n 	<li>Крепление к подголовникам впереди стоящих сидений</li>\r\n 	<li>Прочный и надежный</li>\r\n</ul>', 'Автодержатель proHolder4', 'Тип Автодержатели\r\nМесто установки Подголовник\r\nТип крепления Зажим\r\nСовместимость Для устройств с диагональю до 10"', 'publish', 'open', 'closed', '', 'avtoderzhateli-proholder4', '', '', '2013-12-11 16:57:39', '2013-12-11 14:57:39', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhateli-proholder4/', 0, 'product', '', 0),
