(6077, 1, '2016-12-10 16:57:39', '2016-12-10 14:57:39', '<strong>Универсальный автомобильный fm трансмиттер с Usb портом</strong>\r\n<ul>\r\n 	<li>Слушайте свою музыку где бы вы ни были с помощью proCast</li>\r\n 	<li>Просто вставьте устройство в ваш прикуриватель и проигрывайте аудио с телефона без проводов</li>\r\n 	<li>proCast проигрывает Аудио с любого мобильного устройства через 3.5 мм разъём в автомобильной звуковой системе</li>\r\n 	<li>proCast оснащён функцией авто-сканирования и сам подбирает наилучшую частоту</li>\r\n 	<li>Музыка в паре с функциональностью</li>\r\n 	<li>Поставляется с качественным lcd дисплеем для лучшей функциональности</li>\r\n 	<li>Запоминает последние частоты</li>\r\n 	<li>Совместим со всеми устройствами с 3.5 мм разъёмом</li>\r\n 	<li>Так же вы можете зарядить ваше usb устройство с помощью порта зарядки</li>\r\n</ul>', 'FM-трансмиттер proCast', 'Частота: 88.1-107.9MHz Искажение: ?0.5% Рабочий ток: 20 ± 3 мА Входное напряжение: DC 12V-24V Выход: 5V, 1A', 'publish', 'open', 'closed', '', 'fm-transmitter-procast', '', '', '2016-12-10 16:57:39', '2016-12-10 14:57:39', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/fm-transmitter-procast/', 0, 'product', '', 0),
