(6080, 1, '2016-12-10 16:57:39', '2016-12-10 14:57:39', '<b>FM10+</b> ― компактный многофункциональный автомобильный FM передатчик, позволяющий воспроизводить через стереосистему автомобиля аудиофайлы с Вашего мобильного устройства (телефон, смартфон, МР3 плеер, планшетный компьютер и т.д.). Одновременно с воспроизведением музыки <b>FM10+</b> может заряжать сопряженное устройство через USB порт, так что больше нет необходимости беспокоиться о разряжаемом аккумулятора. 16 разрядный дисплей с подсветкой отражает частоту, на которой передается сигнал на магнитолу, а также название текущего трека.\r\n\r\nГибкий держатель <b>FM10+</b> фиксируется в прикуривателе и может быть установлен пользователем под любым углом. Также для комфорта пользователя в <b>Promate FM10+</b> предусмотрен эквалайзер с 5-ю предустановками (классическая музыка, нормал, Джаз, Поп и Кантри). А еще, предыдущая частота и номер трека автоматически сохраняются и отображаются, когда устройство будет перезапущено. <b>Promate FM10+</b> объединяет в себе огромное количество функций и технических решений, которые добавляют вам комфорт, когда вы находитесь в вашем автомобиле.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Считывает и проигрывает музыку форматов MP3/WMA с SD/MMC карт и USB накопителя</li>\r\n 	<li>USB порт для зарядки может заряжать любые USB совместимые устройства</li>\r\n 	<li>16-битный LCD экран показывает информацию о текущей частоте</li>\r\n 	<li>Линейный вход, позволяющий проигрывать музыку с внешних аудиоустройств, таких как CD или медиаплееров</li>\r\n 	<li>Подвижный кронштейн позволяет настроить кронштейн наиболее комфортным для пользователя образом</li>\r\n 	<li>Предыдущая частота, номер композиции и громкость автоматически сохраняются и отображаются, когда устройство будет перезапущено</li>\r\n 	<li>Опции эквалайзера: Рок, Классика, Нормал, Поп, Джаз, Кантри</li>\r\n 	<li>Варианты воспроизведения: Проигрывать все, одну, папку и обычное</li>\r\n</ul>', 'FM-трансмиттер FM10+', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Экран </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">LCD</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейсы </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Линейный вход </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Поддержка</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Поддержка карт памяти SD/MMC</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 87.5 ~ 108 МГц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форматы воспроизведения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> MP3/WMA</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Режимы воспроизведения </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Проигрывать все, одну, папку и обычное</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Питание</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 12 - 24 В</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Поддержка USB, SD/MMC карт</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">ABS-пластик</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Рабочая температура</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> -15 C ~ 50 C</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">350 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'fm-transmitter-fm10', '', '', '2016-12-10 16:57:39', '2016-12-10 14:57:39', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/fm-transmitter-fm10/', 0, 'product', '', 0),
