(6082, 1, '2016-12-10 16:57:39', '2016-12-10 14:57:39', '<b>FM14</b> — универсальный многофункциональный автомобильный держатель для смартфона со встроенными функциями FM трансмиттера, Hands-Free и зарядного устройства для USB совместимых устройств. Держатель регулируется в пределах от 5.8 до 8.5 см по ширине, а шарнир и гибкий кронштейн позволяет настроить пользователю любое удобное положение установленного смартфона. Встроенный кабель с разъемом 3,5 мм подключается к AUX порту любого смартфона и в комплексе со встроенным микрофоном превращает <b>FM14</b> в беспроводную гарнитуру Hands-Free. Встроенный USB порт позволяет заряжать все USB совместимые устройства.\r\n\r\nФункция FM передатчика позволяет выводить на автомобильную стереосистему музыкальный контент с USB носителя, либо со смартфона, подключенного через AUX порт, а 16 зарядный ЖК дисплей проинформирует вас о частоте передачи и воспроизводимом музыкальном файле.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Настраиваемый в горизонтальность плоскости автомобильный держатель со встроенной функцией FM трансмиттера</li>\r\n 	<li>Встроенный микрофон для обеспечения связи Hands-Free</li>\r\n 	<li>Гибкий кронштейн для легкой настройки</li>\r\n 	<li>Боковые фиксаторы с антискользящим покрытием</li>\r\n 	<li>LED экран</li>\r\n 	<li>360 градусов ротация</li>\r\n 	<li>USB зарядка для всех совместимых устройств</li>\r\n 	<li>Сделан из ABS и поликарбонатного пластика</li>\r\n 	<li>Интерфейс для аудиовхода: 3.5 мм стерео джек</li>\r\n 	<li>Совместимость: Работает со всеми мобильными телефонами, смартфонами, медиаплеерами и прочих внешний устройств, имеющих выход 3.5 мм аудио джек</li>\r\n</ul>', 'FM-трансмиттер FM14', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Экран </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">LCD</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Интерфейсы </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Линейный вход </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Поддержка</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Поддержка карт памяти SD/MMC</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диапазон частот</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 88.1 ~ 107.9 МГц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форматы воспроизведения</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> MP3/WMA</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Питание</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 12-24 В</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">360 градусов ротация </br> Встроенный микрофон для обеспечения связи Hands-Free</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">ABS-пластик</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Частотный диапазон</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">35 Гц - 20 кГц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Чувствительность микрофона</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">46-2 дБ</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры смартфона в ширину</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> от 5.8-8.5 см</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Рабочая температура</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> -15C~50C</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">310 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'fm-transmitter-fm14', '', '', '2016-12-10 16:57:39', '2016-12-10 14:57:39', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/fm-transmitter-fm14/', 0, 'product', '', 0),
