(6084, 1, '2016-12-10 16:57:39', '2016-12-10 14:57:39', '<b>Sheltex-i6</b> — это оптимальная защита для вашего iPhone 6/6s с расширенными функциями встроенного аккумулятора. Разработан специально, чтобы защитить смартфон от агрессии внешнего мира, поможет избежать сколов царапин, потертостей и еще многих других неприятностей. Чехол идеально подогнан под корпус iPhone 6/6s, что позволяет обеспечить оптимальную безопасность. Одновременно защищая, Sheltex-i6 питает смартфон за счет встроенной батареи ёмкостью 2500 мА*ч, увеличивая время беспрерывной работы более чем в 2 раза. При использовании Sheltex-i6 ваш iPhone 6/6s будет находится под постоянной защитой.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>эргономичный и прочный корпус;</li>\r\n 	<li>ударостойкий;</li>\r\n 	<li>надежное запирания чехла от случайного снятия;</li>\r\n 	<li>легкая установка;</li>\r\n 	<li>механическое усиление звука;</li>\r\n 	<li>LED индикатор питания;</li>\r\n 	<li>кнопка включения;</li>\r\n 	<li>использование на ходу;</li>\r\n 	<li>неограниченный доступ к портам и кнопкам;</li>\r\n 	<li>входной порт: Micro-USB;</li>\r\n 	<li>выходной коннектор: Lightning Connector.</li>\r\n</ul>', 'Чехол-аккумулятор Sheltex-i6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Чехол-аккумулятор</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> iPhone 6/6s</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Синтетические материалы</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте </br> Противоударный</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Да</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Ёмкость аккумулятора: 2500 мА*ч</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Входное напряжение: </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 5V, 1A(Max)</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходное напряжение</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 5V, 1A</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Входной порт</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Micro-USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходной коннектор</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Выходной коннектор: Lightning Connector</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Время зарядки</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">4 часа</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-akkumulyator-sheltex-i6', '', '', '2016-12-10 16:57:39', '2016-12-10 14:57:39', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-akkumulyator-sheltex-i6/', 0, 'product', '', 0),
