(6087, 1, '2016-12-10 16:57:39', '2016-12-10 14:57:39', 'Закаленное ультра-тонкое стекло с аппликатором, защищающее экран Вашего смартфона от края до края.\r\n\r\n<b>utterShield-iP6:</b>\r\nУльтра-жесткое закаленное стекло высокой плотности.\r\n\r\n<b>Защита Премиум: </b>\r\nПремиум протектор для долговременной защиты экрана.\r\n\r\n<b>Несколько видов защиты: </b>\r\nСлой защиты от пыли, отпечатков пальцев, царапин и пятен.\r\n\r\n<b>Установи протектор сам: </b>\r\nС легкостью установите протектор на Ваш смартфон, благодаря аппликатору и инструкции по применению.\r\n\r\n<b>Устойчивый к царапинам протектор: </b>\r\nДаже острые предметы, такие как ножи и ключи не могут поцарапать его.\r\n\r\n<b>Материалы премиум качества: </b>\r\nСтекло изготовлено из высококачественных материалов с применением PET технологии, сохраняет цветопередачу и защищает ваши глаза.<span id="copyinfo">\r\n</span>', 'Защитное стекло utterShield-iP6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">iPhone 6/6s</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защитное стекло</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Противоударные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размер </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">4.7 "</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Назначение </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Для мобильных 