(6097, 1, '2016-12-10 16:57:44', '2016-12-10 14:57:44', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nУльтра-тонкая пленка, защищающая экран Вашего смартфона от края до края.\r\n\r\n<b>rimshield-iP6P:</b>\r\nУльтра-тонкая пленка высокой плотности.\r\n\r\n<b>Защита Премиум: </b>\r\nПремиум протектор для долговременной защиты экрана.\r\n\r\n<b>Несколько видов защиты: </b>\r\nСлой защиты от пыли, отпечатков пальцев, царапин и пятен.\r\n\r\n<b>Установи протектор сам: </b>\r\nС легкостью установите протектор на Ваш смартфон, благодаря инструкции по применению.\r\n\r\n<b>Материалы премиум качества: </b>\r\nПленка изготовлена из высококачественных материалов с применением PET технологии, сохраняет цветопередачу и защищает ваши глаза.<span id="copyinfo">\r\n</span>\r\n\r\n</div>', 'Защитная пленка rimShield-iP6P', '<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Совместимость</td>\r\n<td style="vertical-align: top; width: 50%;">Apple iPhone 6 Plus/6s Plus</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Тип</td>\r\n<td style="vertical-align: top; width: 50%;">Пленки</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Вид</td>\r\n<td style="vertical-align: top; width: 50%;">Глянцевые</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Размер</td>\r\n<td style="vertical-align: top; width: 50%;">5.5 "</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'publish', 'open', 'closed', '', 'zashhitnoe-steklo-rimshield-ip6p', '', '', '2016-12-10 16:57:44', '2016-12-10 14:57:44', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zashhitnoe-steklo-rimshield-ip6p/', 0, 'product', '', 0),
