(6100, 1, '2016-12-10 16:57:44', '2016-12-10 14:57:44', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nЗащитное стекло <b>Promate primeShield.Air</b> — это ультра прочный протектор экрана из закаленного стекла для Вашего iPadAir/iPad Air 2. Он изготовлен с использованием инновационного материала, который более чем в 5 раз прочнее обычного стекла и может противостоять сильным царапинам, в том числе от металлических острых предметов.\r\n\r\nЗакругленные края помогают произвести более точную подгонку к экрану iPad Air. Клейкая сторона протектора обеспечивает защиту экрана от осколков в случае разбития primeShield.Air. Протектор в сочетании с олеофобным покрытием, которое обеспечивает защиту от отпечатков и пятен без потери чувствительности сенсорного дисплея, толщиной всего 0.44 мм.\r\n\r\nСам экран изготовлен и оптической градуированной ПЭТ пленки, что обеспечивает потрясающую цветопередачу, за счет того что градуированная ПЭТ пленка имеет более высокий коэффициент пропускания света, чем обычная. В свою очередь это обеспечивает защиту от усталости для глаз при долговременной непрерывной работе с iPad Air. Promate primeShield.Air является очевидным выбором, когда дело доходит до оптимальной защиты экрана.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Ультра-жесткий протектор экрана из закаленного стекла высокой плотности.</li>\r\n 	<li>Поверхность имеет твердость 8-9H, в пять раз сильнее, чем у обычного стекла. Даже острые предметы, такие как нож и шило, не смогут поцарапать его.</li>\r\n 	<li>Специальный состав клея обеспечивает легкую установку без образования пузырьков.</li>\r\n 	<li>Специальная силиконовая пленка не дает разлетаться стеклянным осколкам в случае разбития экрана.</li>\r\n 	<li>Толщина в 0.44 мм гарантирует отсутствие изменений в чувствительности сенсорного экрана.</li>\r\n 	<li>Олеофобное покрытие предохраняет экран от пятен и отпечатков пальцев.</li>\r\n 	<li>Оптические свойства ПЭТ пленки дополнительно повышают цветопередачу и защищают Ваши глаза.<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Защитное стекло primeShield.Air', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple iPad Air, Apple iPad Air 2</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защитное стекло</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Противоударные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Назначение </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Для планшетов</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'zashhitnoe-steklo-primeshield-air', '', '', '2016-12-10 16:57:44', '2016-12-10 14:57:44', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zashhitnoe-steklo-primeshield-air/', 0, 'product', '', 0),
