(6102, 1, '2016-12-10 16:57:44', '2016-12-10 14:57:44', 'proShield.Air2-C - это супер прозрачный протектор экрана, он дает Вашему iPad Air/ iPad Air2 долговременную защиту экрана от пыли, пятен и царапин. При безупречной защите экрана одновременно сохраняется высокая чувствительность сенсорного экрана и анти-бликовые функции. В комплекте поставляется очищающая салфетка и карта установки. proShield.Air2-C легко прикрепить и легко снять с экрана смартфона, не оставляя следов клея и не нарушая чувствительность сенсорного экрана. Протектор для долговременной защиты экрана Вашего iPad Air/iPad Air 2 Защищает экран смартфона от пыли, отпечатков пальцев, грязи и царапин. Не влияет на отзывчивость сенсорного экрана. Легко наклеивается и удаление без каких-либо повреждений для экрана. В комплекте очищающая салфетка и карты для установки. Изготовлен из ПЭТ материала.', 'Защитная пленка proShield.Air2-c', '', 'publish', 'open', 'closed', '', 'zashhitnoe-steklo-primeshield-air2-c', '', '', '2016-12-10 16:57:44', '2016-12-10 14:57:44', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zashhitnoe-steklo-primeshield-air2-c/', 0, 'product', '', 0),
