(6104, 1, '2016-12-10 16:57:44', '2016-12-10 14:57:44', 'Rind-10 - это инновационный чехол из кожи премиум качества, придающий Вашему планшетному компьютеру дополнительный шик с повседневной защитой от различны мелких неприятностей типа сколов, потертостей и царапин. Rind-10 оснащен уникальной многоразовой гелевой прокладкой, которая надежно крепит Ваш ПК к чехлу. В откидывающейся крышке предусмотрены различные вырезы для хранения карт, наличных денег , визиток и т.д. Rind 10 легко превращается в комфортную подставку для горизонтального просмотра. Легкий, элегантный и стильный!\r\n<ul>\r\n 	<li>Универсальный защитный чехол для планшетных компьютеров с диагональю 9“ и 10” дюймов</li>\r\n 	<li>Инновационная многоразовая гелевая прокладка для надежной фиксации планшетника к чехлу</li>\r\n 	<li>Дополнительные вырезы для пластиковых карт, наличных денег и т.д.</li>\r\n 	<li>Удобная подставка для просмотра контента</li>\r\n 	<li>Легкий, элегантный и стильный</li>\r\n</ul>', 'Чехол Rind-10', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диагональ поддерживаемых планшетов</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 10" </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Обложки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">С подставкой</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кожа</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Фиксация планшета</td><td style="padding-bottom: 20px