(6130, 1, '2016-12-10 16:57:49', '2016-12-10 14:57:49', '<b>Rouge-Air 2</b> обеспечивает Вашему iPad Air 2 великолепную защиту. Благодаря продуманному дизайну, этот чехол можно сложить в удобную подставку, например, для просмотра клипов или фильмов на Вашем планшете. Разработанный специально для iPad Air 2, он обеспечивает прекрасный доступ к разъему для наушников, порту зарядки телефона, камере и динамику. Стильная защита от Promate!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Супер легкий</li>\r\n 	<li>Представлен в модных цветовых решениях</li>\r\n 	<li>Интерьер из микрофибры</li>\r\n 	<li>Изготовлен из кожи премиум качества</li>\r\n 	<li>Защита от снятия</li>\r\n 	<li>Возможность использовать как подставку для расположения экрана в горизонтальном положении</li>\r\n 	<li>Специально разработан для Apple iPad Air2</li>\r\n</ul>', 'Чехол Rouge-Air2', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диагональ поддерживаемых планшетов</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 9.7"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Обложки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Имиджевые </br> С подставкой</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кожа + пластик</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Фиксация планшета</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защелкивание</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Застежка </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-rouge-air2', '', '', '2016-12-10 16:57:49', '2016-12-10 14:57:49', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-rouge-air2/', 0, 'product', '', 0),
