(6133, 1, '2016-12-10 16:57:54', '2016-12-10 14:57:54', '<strong>Wallex-Air 2</strong> - премиум кожаный чехол с держателем для кредитных карт.\r\n\r\nПодходит под любой стиль и обеспечивает оптимальную всестороннюю защиту для вашего IPad. Носите Ipad комфортно и безопасно в то же время не беспокойтесь о его сохранности. Всесторонняя защита Вашего Ipad!\r\n\r\n<strong>Особенности :</strong>\r\n<ul>\r\n 	<li>Премиум кожаный чехол.</li>\r\n 	<li>Смарт-блокировка благодаря умному флипу.</li>\r\n 	<li>Удобный эластичный ремешок для дополнительного комфорта и мобильности.</li>\r\n 	<li>Доступный в разных цветовых оформлениях.</li>\r\n</ul>', 'Чехол Wallex-Air 2', '<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Диагональ поддерживаемых планшетов</td>\r\n<td style="vertical-align: top; width: 50%;">9.7"</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Вид</td>\r\n<td style="vertical-align: top; width: 50%;">Обложки</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Особенности</td>\r\n<td style="vertical-align: top; width: 50%;">Имиджевые С подставкой</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Материал</td>\r\n<td style="vertical-align: top; width: 50%;">Кожа + пластик</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Фиксация планшета</td>\r\n<td style="vertical-align: top; width: 50%;">Защелкивание</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 50%; vertical-align: top;">Застежка</td>\r\n<td style="vertical-align: top; width: 50%;">Нет</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'publish', 'open', 'closed', '', 'chexol-wallex-air-2', '', '', '2016-12-10 16:57:54', '2016-12-10 14:57:54', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-wallex-air-2/', 0, 'product', '', 0),
