(6136, 1, '2016-12-10 16:57:54', '2016-12-10 14:57:54', '<b>Promate Agenda</b> — это элегантный и стильный защитный чехол из великолепной натуральной мягкой кожи для защиты iPad Air. У чехла великолепно продумана система хранения. Разнообразные вырезы и карманы во внутренней части флип-крышки вместят в себя разнообразные аксессуары повседневной жизни, такие как визитки, пластиковые карты, права, документы, деньги и многое другое.\r\n\r\nКрышка чехла предусмотрительно трансформируется в опору, превращая его в подставку для горизонтального просмотра содержимого на экране. <b>Promate Agenda</b> — изысканная защита вашего планшета!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Премиальный многофункциональный кожаный чехол для iPad Air</li>\r\n 	<li>Специально расположенные вырезы для легкого доступа ко всем портам и кнопкам управления iPad Air</li>\r\n 	<li>Отделение для хранения визиток, налички или билетов</li>\r\n 	<li>Держатель стилуса надежно удерживает ручку или стилус</li>\r\n 	<li>Возможность использования чехла в качестве подставки для горизонтального просмотра</li>\r\n 	<li>Чехол из кожи высочайшего качества, внутри отделка — микрофибра</li>\r\n</ul>', 'Чехол Agenda', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диагональ поддерживаемых планшетов</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 9.7"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Обложки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Имиджевые </br> С подставкой</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кожа</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Фиксация планшета</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Рамка</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Застежка </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Ремешок</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-agenda', '', '', '2016-12-10 16:57:54', '2016-12-10 14:57:54', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-agenda/', 0, 'product', '', 0),
