(6140, 1, '2016-12-10 16:57:54', '2016-12-10 14:57:54', '<b>Promate Axis-Air</b> — это комбинация яркого дизайна и исключительной функциональности. Встроенный поворотный механизм делает элементарным переход из горизонтального в вертикальное положения Вашего планшета и наоборот, в то время, как с помощью чехла еще и регулируется уровень наклона.\r\n\r\nСпециальный магнитный замок поддерживает функцию "авто-слип" (при открытии/закрытии крышки Ваш планшетный компьютер включается или отключается автоматически соответственно). Яркий внешний вид в сочетании с мягкой обивкой внутренней части чехла делают Axis-Air незаменимым и модным атрибутом Вашего имиджа. Защитный чехол <b>Promate Axis-Air</b> — жить ярко!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Яркий дизайн со встроенным поворотным механизмом для iPad Air</li>\r\n 	<li>Магнитный замок</li>\r\n 	<li>Функция "авто-слип"</li>\r\n 	<li>Возможность установить с помощью чехла удобный уровень наклона экрана</li>\r\n 	<li>Специально разработан для iPad Air, что делает легким и удобным доступ ко всем портам, кнопкам управления и камерам</li>\r\n 	<li>Кожа премиум класса и мягкое внутреннее покрытие чехла</li>\r\n</ul>', 'Чехол Axis-Air', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диагональ поддерживаемых планшетов</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 9.7"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Обложки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Имиджевые </br> С подставкой</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кожа</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Фиксация планшета</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защелкивание</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Застежка </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Магнит</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-axis-air', '', '', '2016-12-10 16:57:54', '2016-12-10 14:57:54', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-axis-air/', 0, 'product', '', 0),
