(6144, 1, '2016-12-10 16:57:54', '2016-12-10 14:57:54', '<b>Promate Spino-Air</b> — уникальный защитный чехол с тканевым покрытием поверх пробковой основы на поликарбонатном корпусе создан для надежной защиты Вашего iPad Air от случайных ударов, падений, потертостей и царапин.\r\n\r\nПоворотный механизм, реализованный в Spino-Air, позволяет вращать экран на 360 градусов (чехол при этом не двигается). Система крепления планшета к чехлу обеспечивает полный доступ к портам и клавишам управления iPad Air. <b>Promate Spino-Air</b> — надежная защита на каждый день.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Защитный чехол с тканевым покрытием и уникальным поворотным механизмом</li>\r\n 	<li>Внутренний механизм для вертикального и горизонтального просмотра экрана</li>\r\n 	<li>Полный доступ к функциям iPad</li>\r\n 	<li>Доступен в разных цветовых решениях согласно собственным предпочтениям</li>\r\n</ul>\r\n&nbsp;\r\n\r\n&nbsp;', 'Чехол Spino-Air', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Диагональ поддерживаемых планшетов</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 9.7"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вид </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Обложки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">С подставкой</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Пластик + текстиль</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Фиксация планшета</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защелкивание</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Застежка </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Резинка</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-spino-air', '', '', '2016-12-10 16:57:54', '2016-12-10 14:57:54', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-spino-air/', 0, 'product', '', 0),
