(6148, 1, '2016-12-10 16:57:54', '2016-12-10 14:57:54', 'Обложка Promate<b> Origami-Mini4</b> — защитная многофункиональная обложка-чехол в Оригами-стиле для <b>Apple iPad mini 4</b>.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Специально для вашего IPad Mini 4: Ваш IPad Mini 4 надежно фиксируется в чехле для максимальной защиты</li>\r\n 	<li>Роскошная отделка: изящный и стильный, этот чехол имеет роскошную отделку, которая не оставит равнодушным никого</li>\r\n 	<li>Защитный чехол: мягкая внутреняя подкладка обеспечивает вашему IPad Mini 4 защиту от царапин, случайных ударов и влаги</li>\r\n 	<li>Оригами-стиль: специальный мнокофункиональный флип позволяет наслаждаться вашим любимым контентом под любым углом</li>\r\n 	<li>Sleep &amp; Wake Up Функция: чехол сам блокирует устройство при закрытии и разблокирует при открытии</li>\r\n 	<li>Магнитный замок: магниты обеспечивают надежное закрытие, даже если устройство в рюкзаке или в сумке</li>\r\n 	<li>Полный доступ: удобные вырезы дают вам доступ ко всем портам и кнопкам. Вы можете зарядить ваш планшет или сделать фото без извлечения устройства<span id="copyinfo"></span></li>\r\n</ul>\r\n&nbsp;', 'Origami-mini4', '<div class="detail-chars-l-i">Диагональ поддерживаемых планшетов    7.9"</div>\r\n<div class="detail-chars-l-i">Вид                                        Обложки</div>\r\n<div class="detail-chars-l-i">Особенности                      Имиджевые\r\nС подставкой</div>\r\n<div class="detail-chars-l-i">Материал                         Синтетические материалы</div>\r\n<div class="detail-chars-l-i">Фиксация планшета      Защелкивание</div>\r\n<div class="detail-chars-l-i">Застежка      Магнит</div>\r\n<div class="detail-chars-l-i">Ширина      135 мм</div>\r\n<div class="detail-chars-l-i">Высота       203 мм</div>\r\n<div class="detail-chars-l-i">\r\n\r\nГлубина    5 мм<span id="copyinfo"></span>\r\n\r\n&nbsp;\r\n\r\n</div>', 'publish', 'open', 'closed', '', 'origami-mini4', '', '', '2016-12-10 16:57:54', '2016-12-10