(6151, 1, '2016-12-10 16:57:54', '2016-12-10 14:57:54', '<b>Обложка Promate Felix-Mini4</b> — мультифункциональный чехол-обложка для Apple iPad mini 4.\r\nМножество вариантов крепления: Felix-Mini4 является уникальным в применении чехлом. Верхний флип крепится на липучке и полностью отсоединяется.\r\nВы можете использовать чехол в портретной и ландшафтной ориентации, закреплять его в любом положении, использовать как крепление на подголовник в авто, а также крепить на любые поверхности.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Специально для вашего IPad Mini 4: Ваш IPad Mini 4 надежно фиксируется в чехле для максимальной защиты</li>\r\n 	<li><i>Роскошная отделка:</i> Изящный, стильный, этот чехол имеет роскошную отделку, которая не оставит равнодушным никого</li>\r\n 	<li><i>Защитный чехол</i>: мягкая внутренняя подкладка обеспечивает вашему IPad Mini 4 защиту от царапин, случайных ударов, капель и разлитой воды</li>\r\n 	<li><i>Мульти-угловой просмотр</i>: несколько углов обзора позволяют максимально удобно пользоваться устройством</li>\r\n 	<li><i>Наклейка-крепление</i>: Felix-Mini4 включает в себя 2 3M наклейки, которые позволяют закрепить чехол на любой поверхности</li>\r\n 	<li><i>Sleep &amp; Wake Up Функция</i>: Чехол сам блокирует устройство при закрытии и разблокирует при открытии</li>\r\n 	<li><i>Магнитный замок</i>: магниты обеспечивают надежное закрытие, даже если устройство в рюкзаке или в сумке</li>\r\n 	<li><i>Полный доступ</i>: Удобные вырезы дают вам доступ ко всем портам и кнопкам. Вы можете зарядить ваш планшет или сделать фото без извлечения устройства<span id="copyinfo"></span></li>\r\n</ul>\r\n&nbsp;', 'Felix-mini4', '<div class="detail-chars-l-i">Диагональ поддерживаемых планшетов   7.9"</div>\r\n<div class="detail-chars-l-i">Вид                                                                      Обложки</div>\r\n<div class="detail-chars-l-i">Особенности                                                    Имиджевые\r\nС подставкой</div>\r\n<div class="detail-chars-l-i">Материал                                          Синтетические материалы</div>\r\n<div class="detail-chars-l-i">Фиксация планшета                                 Защелкивание</div>\r\n<div class="detail-chars-l-i">Застежка                                                               Магнит</div>\r\n<div class="detail-chars-l-i">Ширина                                                         135 мм</div>\r\n<div class="detail-chars-l-i">Высота                                                            203 мм</div>\r\n<div class="detail-chars-l-i">\r\n\r\nГлубина                                                         5 мм<span id="copyinfo"></span>\r\n\r\n&nbsp;\r\n\r\n</div>', 'publish', 'open', 'closed', '', 'felix-mini4', '', '', '2016-12-10 16:57:54', '2016-12-10 14:57:54', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/felix-mini4/', 0, 'product', '', 0),
