(6159, 1, '2016-12-10 16:57:58', '2016-12-10 14:57:58', 'Почти у каждого есть целая россыпь визитных карточек, пластиковых карт, скидочных карт в магазины и т.д.. Компания объединила всех их с не менее важным спутником современного человека - со смартфоном. Cardo - это кармашек на специальной, запатентованной 3М клейкой основе, который крепится на заднюю крышку Вашего смартфона. Легкое решение, объединяющее все необходимые в повседневной жизни аксессуары в 1 месте. не нужно брать с собой отдельно кошелек, визитницу  и все распихивать по карманам. Promate Cardo упорядочит все!  Легкий и удобный карман на заднюю панель телефона Удобное крепление запатентованной технологией 3М', 'Cardo', '', 'publish', 'open', 'closed', '', 'cardo', '', '', '2016-12-10 16:57:58', '2016-12-10 14:57:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/cardo/', 0, 'product', '', 0),
(6164, 1, '2016-12-10 16:57:58', '2016-12-10 14:57:58', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<strong>Promate MacHub-12 — высокоскоростной портативный коммутатор USB 3.1 </strong>\r\n\r\nИспытайте технологию следующего поколения с macHub-12 от Promate 5 в 1 USB 3.1 Type-C USB Хаб - гладкий и компактный, оснащен USB 3.1 Type-C Зарядным портом, двумя USB 3.0 портами, слотами для SD/micro SD карт.\r\nПросто подключите macHub-12 к вашим устройствам, поддерживающим USB Type-C и наслаждайтесь технологией будущего!\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Встроенный порт для подзарядки:</strong> Вам больше не придется терять единственный порт для подзарядки на Вашем MacBook 12, т.к. Type-C USB Hub позволяет заряжать Ваш ПК даже когда Вы используете остальные порты  хаба\r\n•<strong> Подключай и используй:</strong> Просто подключите MacHub-12 к Вашему MacBook 12 через USB 3.1 Type-C Port  и все, прочное высокоскоростное соединение установлено, им можно пользоваться\r\n<strong>• Высокая скорость передачи данных:</strong> MacHub-12 поддерживает скорость передачи данных до 5ГБ/с через USB 3.0\r\n<strong>• Максимальная пропускная способность:</strong> Высокая пропускная способность предусмотренная в MacHub-12, позволяет использовать дивайсы с объемом памяти до 2TB, что не сможет не оценить не один пользователь\r\n\r\n</div>', 'USB-Хаб Machub-12', '&nbsp;\r\n\r\n<strong>•Совместимость: </strong>MacBook 12, Chromebook Pixel 2 и другие лэптопы с портом USB Type-C\r\n<strong>•Порты: </strong>1 x USB 3.1 Type-C, 2 x USB 3.0 Ports, 1 x SD/MMC, 1 x MicroSD Card Reader\r\n<strong>•Скорость передачи данных:</strong> до 5ГБ/с через USB 3.0', 'publish', 'open', 'closed', '', 'vysokoskorostnoj-usb-xab-5-v-1-s-portami-usb-3-1-type-c-usb-machub-12', '', '', '2016-12-10 16:57:58', '2016-12-10 14:57:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/vysokoskorostnoj-usb-xab-5-v-1-s-portami-usb-3-1-type-c-usb-machub-12/', 0, 'product', '', 0),
