(6167, 1, '2016-12-10 16:57:58', '2016-12-10 14:57:58', 'Promate Kitkater – кард-ридер который позволяет расширить память ваших Android устройств версии 4.0 и выше. Он поддерживает Micro-SD карты емкостью от 8 GB до 64 ГБ. Сохраняйте свои любимые фильмы, музыку и другие данные на вашей Micro-SD карте, вставьте ее в Kitkater и просматривайте на Android смартфоне, наслаждаясь неограниченным доступом к мультимедиа. Особенности: Ультратонкий Android Micro-SD кардридер Поддерживает Micro-SD карты с памятью от 8 до 64 ГБ Поддерживает просмотр видео и прослушивание музыки Поддерживает Android устройства 4.0 и выше', 'OTG Кард-ридер Kitkater', 'Категория Кард-ридеры\r\nСовместимость Android устройства 4.0 и выше\r\nДополнительные характеристики Поддержка Micro-SD карт с памятью от 8 до 64 ГБ', 'publish', 'open', 'closed', '', 'kard-rider-otg-dlya-android-ustrojstv-kitkater', '', '', '2016-12-10 16:57:58', '2016-12-10 14:57:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kard-rider-otg-dlya-android-ustrojstv-kitkater/', 0, 'product', '', 0),
