(6171, 1, '2016-12-10 16:57:58', '2016-12-10 14:57:58', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate Hype-EU</b> — это зарядное устройство, которое обеспечит зарядку всех USB совместимых девайсов в вашем доме.\r\n\r\nДва 2000 мА порта USB позволяют заряжать два устройства одновременно. Глянцевое и матовое исполнение корпуса зарядки добавляют элемент роскоши к его функциональности. Встроенная защита от перезарядки приборов и короткого замыкания обеспечит сохранность дорогих девайсов.\r\n\r\n<b>Hype-EU</b> — идеальное решение для дома.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>2000 мА EU стандартное зарядное устройство для дома с двумя USB портами</li>\r\n 	<li>Универсальная зарядка для всех приборов, заряжаемых с помощью USB таких как: смартфоны, небольшого размера планшетные компьютеры и другие цифровые устройства</li>\r\n 	<li>Легкий и портативный дизайн</li>\r\n 	<li>Встроенная защита от короткого замыкания</li>\r\n</ul>\r\n</div>', 'Сетевое зарядное устройство Hype-EU', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Сетевые</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">2</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Электронных книг  </br> Планшетов  </br> Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходной ток </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 2 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Гарантия </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">12 месяцев</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'setevoe-zaryadnoe-ustrojstvo-hype-eu', '', '', '2016-12-10 16:57:58', '2016-12-10 14:57:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/setevoe-zaryadnoe-ustrojstvo-hype-eu/', 0, 'product', '', 0),
