(6175, 1, '2016-12-10 16:58:02', '2016-12-10 14:58:02', '<b>Promate CarHub-4</b> — ультра-быстрое зарядное устройство выходной мощностью 7.2 A с двумя портами для прикуривателя и концентратором с двумя портами для пассажиров на заднем сиденье.\r\n\r\n<b>Заряд при оптимальной скорости</b>\r\nОбеспечивает оптимальную мощность для каждого порта, обеспечивающего выход для ультра-быстрой зарядки для смартфонов (1 А) и планшетов (2.4 А).\r\n\r\n<b>4х USB порта</b>\r\nЗарядка 4 устройств одновременно с <b>CarHub-4.</b>\r\n\r\n<b>Дополнительный USB-концентратор зарядки</b>\r\nКабель длинной 1.8 м позволяет пассажирам на заднем сиденье легко получить доступ к двойному порту зарядки концентратора.\r\n<b></b>\r\n<b>Крепление Carhub-4</b>\r\nС съемной клипсой для водителя / пассажира, вы будете иметь безопасный и легко доступный способ прикрепить на заднее сиденье зарядное устройство с двумя портами. Универсальное автомобильное зарядное устройство для Android и IOS устройств.\r\n\r\n<b>Несколько вариантов монтажа</b>\r\nКонцентратор может быть установлен с помощью съемной клипсы либо с помощью 2 стикеров со скотчем 3М, которые идут в комплекте.\r\n\r\n<b>Универсальные подключения</b>\r\n<b>CarHub-4 </b>совместим со всеми устройствами с USB-питанием.\r\n\r\n<b>Безопасный</b>\r\n<b>CarHub-4</b> имеет смарт-схему, которая обеспечивает защиту от перегрева, перегрузки по току и короткого замыкания.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Автомобильное зарядное устройство CarHub-4', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Автомобильные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">4</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Электронных книг  </br> Планшетов  </br> Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Есть</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходной ток </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 7.2 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1.8 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительный </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB-концентратор</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Гарантия </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">12 месяцев</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'avtomobilnoe-zaryadnoe-ustrojstvo-carhub-4', '', '', '2016-12-10 16:58:02', '2016-12-10 14:58:02', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtomobilnoe-zaryadnoe-ustrojstvo-carhub-4/', 0, 'product', '', 0),
