(6178, 1, '2016-12-10 16:58:02', '2016-12-10 14:58:02', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate chargMate LT-EU</b> — это высокоскоростное сетевое зарядное устройство, которое подходит для зарядки смартфонов, планшетных компьютеров, оснащенных разъемом Lightning.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Компактный дизайн</li>\r\n 	<li>Защита от короткого замыкания, перегрузок по току</li>\r\n 	<li>Работает со всеми Lightning устройствами</li>\r\n 	<li>Длина кабеля: 1 м<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Сетевое зарядное устройство chargMate LT-EU', 'Тип Сетевые\r\nСовместимость Apple Lightning\r\nПодходит для зарядки Планшетов\r\nМобильных телефонов\r\nДополнительные характеристики Выходной ток - 2.1 А', 'publish', 'open', 'closed', '', 'setevoe-zaryadnoe-ustrojstvo-chargmate-lt-eu-2-1', '', '', '2016-12-10 16:58:02', '2016-12-10 14:58:02', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/setevoe-zaryadnoe-ustrojstvo-chargmate-lt-eu-2-1/', 0, 'product', '', 0),
