(6180, 1, '2016-12-10 16:58:02', '2016-12-10 14:58:02', '<b>Promate chargMate-EU1</b> — портативный 3 в 1 набор, который существенно облегчает жизнь, комбинируя автомобильную зарядку и зарядку для дома для всех USB совместимых устройств.\r\n\r\nДля зарядки достаточно воткнуть вилку в розетку и подсоединить с помощью идущего в комплекте USB кабеля ваше устройство или же воткнуть зарядку в разъем прикуривателя. Удобное решение на все случаи жизни!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Компактный дизайн</li>\r\n 	<li>Защита от короткого замыкания</li>\r\n 	<li>Выходной ток: 1 А</li>\r\n 	<li>Сделано из кабеля ПВХ и АBS пластика</li>\r\n 	<li>Длина кабеля: 1.2 м</li>\r\n</ul>', 'Универсальное зарядное устройство chargMate-EU1', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Автомобильные </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная / micro USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Электронных книг  </br> Планшетов  </br> Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Есть</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходной ток </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 А</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'universalnoe-zaryadnoe-ustrojstvo-chargmate-eu1', '', '', '2016-12-10 16:58:02', '2016-12-10 14:58:02', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/universalnoe-zaryadnoe-ustrojstvo-chargmate-eu1/', 0, 'product', '', 0),
