(6182, 1, '2016-12-10 16:58:02', '2016-12-10 14:58:02', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate travelMate-Duo</b> — универсальный Auto-Switch адаптер с двумя разъёмами для одновременной зарядки двух устройств, работает более чем в 150 странах. Это идеальный вариант для тех, кто часто путешествует, так как мульти-адаптер может быть использован в любой точке мира благодаря возможности смены разъёма.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Удобен для подзарядки любого вашего устройства</li>\r\n 	<li>2 разъёма дают возможность заряжать 2 устройства одновременно</li>\r\n 	<li>Защита от короткого замыкания</li>\r\n 	<li>Низкое тепловыделение</li>\r\n 	<li>Вилки: UK, EU, US &amp; AU<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Универсальное зарядное устройство travelMate-Duo', 'Тип Сетевые\r\nСовместимость Универсальная\r\nПодходит для зарядки Планшетов\r\nМобильных телефонов\r\nКабель в комплекте Нет\r\nДополнительные характеристики Выходной ток - 2.1 А', 'publish', 'open', 'closed', '', 'universalnoe-zaryadnoe-ustrojstvo-promate-travelmate-duo', '', '', '2016-12-10 16:58:02', '2016-12-10 14:58:02', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/universalnoe-zaryadnoe-ustrojstvo-promate-travelmate-duo/', 0, 'product', '', 0),
