(6185, 1, '2016-12-10 16:58:02', '2016-12-10 14:58:02', '<b>Promate auraDock</b> — ультрапортативная беспроводная зарядка для вашего смартфона с функцией Qi Wireless. Пока устройство лежит и одновременно заряжается на <b>auraDock</b> вы имеете возможность безгранично долго просматривать на экране интересующий вас контент.\r\n\r\nQi Wireless технология позволит вам навсегда избавиться от необходимости использовать провода и вручную коннектить разъемы. Интеллектуальная LED индикация подскажет вам, когда смартфон зарядиться.\r\n\r\nС <b>auraDock</b> комфорт в использовании смартфона стал на ступень выше!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Функциональный дизайн</li>\r\n 	<li>Возможность заряжать устройство в портретном или ландшафтном положении</li>\r\n 	<li>Интеллектуальный LED индикатор</li>\r\n 	<li>Энергосберегающие технологии<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Беспроводное зарядное устройство auraDock', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Беспроводные </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Устройства поддерживающие Qi Wireless Charging</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходной ток </td><td style="padding-bottom: 20px; width: 2%; 