(6189, 1, '2016-12-10 16:58:02', '2016-12-10 14:58:02', 'Премиум 24K позолоченный HDMI-кабель <b>linkMate-H1</b>.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>HDMI-кабель, который подключается от телеприставки, проигрывателя Blu-ray, ноутбука и других устройств к вашему HDTV для полноценного воспроизведения высококачественного видео и аудио с помощью компактного кабеля.</li>\r\n 	<li>Кабель сделан из позолоченной меди с ПВХ покрытием flexShield.</li>\r\n 	<li>Позволяет воспроизводить HD видео с разрешением до 1080p и мульти-канал воспроизведения аудио дорожек.</li>\r\n 	<li>Обладает высокой частотностью обновления для более плавного изображения и поддерживает новые аудиоформаты для обеспечения лучшего качества аудио и видео.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<b>Уникальное качество аудио и видео:</b>\r\n<ul>\r\n 	<li>Подключается к телеприставке, проигрывателю Blu-ray, ноутбуку и другим устройствам.</li>\r\n 	<li>Высокоскоростная HDMI версия 1.4, единый пропускной канал связи от 165 МГц (4.95 Гбит/сек) to 340 МГц (10.2 Гбит/сек).</li>\r\n 	<li>Позволяет воспроизводить HD видео с разрешением до 1080p и мульти-канал воспроизведения аудио дорожек.</li>\r\n 	<li>Транслирует и аудио и видео через единый кабель.</li>\r\n 	<li>Обладает высокой частотностью обновления(до 120 Гц) для более плавного изображения.</li>\r\n 	<li>Глубина цветов: от 24 бит до 30 бит, 36 бит, 48 бит (RGB или YCbCr).</li>\r\n 	<li>Более широкий цветовой спектр, поддерживает новое поколение цветопространства xvYCC.</li>\r\n 	<li>Поддерживает новые аудиоформаты: Dolby TrueHD и DTS-HD Master Audio для домашнего кинотеатра.</li>\r\n 	<li>24K позолоченные коннекторы для оптимальной передачи сигнала.<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель linkMate-H1', 'Тип HDMI\r\nДлина 1.5 м\r\nВид Кабели\r\nГарантия 12 месяцев', 'publish', 'open', 'closed', '', 'kabel-linkmate-h1-hdmi-hdmi-1-5-m', '', '', '2016-12-10 16:58:02', '2016-12-10 14:58:02', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-h1-hdmi-hdmi-1-5-m/', 0, 'product', '', 0),
