(6197, 1, '2016-12-10 16:58:06', '2016-12-10 14:58:06', '<b>Promate linkMate-H4</b> — высокоскоростной HDMI кабель (тип A) — DVI.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Кабель HDMI – DVI подключает ваш компьютер или любое другое устройство с DVI коннектом, к вашему домашнему кинотеатру или любому другому устройству которое поддерживает HDMI подключения.</li>\r\n 	<li>Позволяет воспроизводить HD видео с разрешением до 1080p.</li>\r\n 	<li>24K позолоченные коннекторы для оптимальной передачи сигнала.</li>\r\n 	<li>Глубина цветов: от 24 бит до 30 бит, 36 бит, 48 бит (RGB или YCbCr).</li>\r\n 	<li>Уникальное качество аудио и видео.</li>\r\n 	<li>Подключает устройство с DVI коннектом к дисплеям с поддержкой HDMI.</li>\r\n 	<li>Легкое подключение к DVD плеерам и игровым консолям.</li>\r\n 	<li>Высокоскоростная HDMI версия 1.4, единый пропускной канал связи от 165 МГц (4.95 Гбит/сек) до 340 МГц (10.2 Гбит/сек).</li>\r\n 	<li>Кабель сделан из позолоченной меди с ПВХ покрытием flexShield.<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель linkMate-H4', 'Тип HDMI - DVI\r\nДлина 1.5 м\r\nВид Кабели\r\nГарантия 12 месяцев', 'publish', 'open', 'closed', '', 'kabel-linkmate-h4-hdmi-dvi-1-5-m', '', '', '2016-12-10 16:58:06', '2016-12-10 14:58:06', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-h4-hdmi-dvi-1-5-m/', 0, 'product', '', 0),
