(6201, 1, '2016-12-10 16:58:06', '2016-12-10 14:58:06', '<b>Promate linkMate.U5</b> — универсальный USB адаптер 5-в-1.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Мультифункциональный USB приспособление для всех ваших гаджетов.</li>\r\n 	<li>Сочетает в себе четыре разных вида USB коннектов, которые вы можете легко менять.</li>\r\n 	<li>Используйте адаптер для любых повседневных нужд, таки как: подключение к вашему смартфону, принтеру, камере и другим устройствам, для подзарядки, обмена данными.</li>\r\n 	<li>Изготовленный из устойчивого материала flexShield кабель безопасный и для удобства его длина составляет целых три метра.</li>\r\n 	<li>C linkMate.U5 вы можете забыть обо всех других кабелях для всех ваших устройств.</li>\r\n 	<li>3-х метровый кабель flexShield USB (мама — папа).</li>\r\n 	<li>4 разъёма для всех видов USB входов: Micro-USB, Mini-USB, 4-контактный Mini-USB (для xBox, Gameboy, разных контроллеров, видеокамер, принтеров), USB-B.</li>\r\n 	<li>Этот адаптер идеален для тех кто путешествует и использует разнообразные устройства USB.</li>\r\n 	<li>Обратная совместимость.</li>\r\n 	<li>Высокоскоростной USB 2.0 480 Мбит/сек.</li>\r\n 	<li>Обмен данными и подзарядка.<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Набор переходников с кабелем linkMate-U5', 'Тип USB\r\nДлина 3 м\r\nВид Переходники\r\nГарантия 12 месяцев', 'publish', 'open', 'closed', '', 'nabor-perexodnikov-s-kabelem-linkmate-u5-usb-adapter-5-v-1-3-m', '', '', '2016-12-10 16:58:06', '2016-12-10 14:58:06', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/nabor-perexodnikov-s-kabelem-linkmate-u5-usb-adapter-5-v-1-3-m/', 0, 'product', '', 0),
