(6203, 1, '2016-12-10 16:58:06', '2016-12-10 14:58:06', '<b>Promate thunderMate-H</b> — высокоскоростной Mini DisplayPort – HDMI кабель-адаптер.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Подключайте устройства к HDMI-совместимым дополнительным мониторам для удобного просмотра файлов на более крупном дисплее.</li>\r\n 	<li>Вы можете увеличить, расширить или даже отзеркалить ваш текущий экран, без необходимости внешнего источника питания.</li>\r\n 	<li>Идеально подходит для презентаций, просмотра видео и изображений.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<b>Уникальное качество аудио и видео:</b>\r\n<ul>\r\n 	<li>Поддерживает HDMI 4K x 2K @ 30 Гц и 1080p @ 120 Гц.</li>\r\n 	<li>Поддержка HDCP1.2 версии.</li>\r\n 	<li>Поддерживает 3D.</li>\r\n 	<li>Поддерживает Hot Plugging.</li>\r\n 	<li>Поддерживает порт Mini Display вход 1.2A и HDMI 1.4b выход.</li>\r\n 	<li>Простой в использовании, не требует программного обеспечения, не требуется внешний адаптер питания.</li>\r\n 	<li>Стабильный и надёжный сигнал.<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Переходник thunderMate-H', 'Тип mini DisplayPort - HDMI\r\nВид Переходники\r\nГарантия 12 месяцев', 'publish', 'open', 'closed', '', 'perexodnik-thundermate-h-mini-displayport-hdmi', '', '', '2016-12-10 16:58:06', '2016-12-10 14:58:06', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/perexodnik-thundermate-h-mini-displayport-hdmi/', 0, 'product', '', 0),
