(6206, 1, '2016-12-10 16:58:06', '2016-12-10 14:58:06', '<b>Promate uniLink-CB</b> — возможность использовать достижение последних технологий сопряжения гаджетов уже сегодня, с помощью сверхскоростных перспективных портов USB 3.1 Type-C.\r\n\r\nС <b>uniLink-CB</b>, передача данных с вашего устройства с портом USB-B на устройство с портом USB-C будет молниеносной, со скоростью до 5 Гбит/сек. Помимо передачи данных, uniLink-CB позволяет заряжать устройства с портом USB-C с мощностью до 60 ватт.\r\n\r\nПокрытие <b>uniLink-CB</b> выполнено из патентованного материала flexShield ПВХ. Погрузитесь в новой технологии с uniLink-CB.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Премиум кабель с разъемами USB 3.1 Type-C / USB-B.</li>\r\n 	<li>USB порт Type-C поддерживающий двухстороннюю передачу данных.</li>\r\n 	<li>Ультра-тонкий дизайн.</li>\r\n 	<li>USB 3.1 Type-C универсален и подходит для всех гаджетов.</li>\r\n 	<li>Скорость передачи данных до 5 Гбит/сек.</li>\r\n 	<li>Обратная совместимость.</li>\r\n 	<li>Медный кабель.</li>\r\n 	<li>Никелированное-покрытие коннекторов.</li>\r\n 	<li>Покрытие кабеля выполнено из патентованного материала flexShield ПВХ.</li>\r\n 	<li>Длина 1 метр.</li>\r\n 	<li>Совместим с Windows, MAC и Android.<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель uniLink-CB', 'Тип USB type C - USB\r\nДлина 1 м\r\nВид Кабели\r\nГарантия 12 месяцев', 'publish', 'open', 'closed', '', 'kabel-unilink-ca-usb-3-1-type-c-usb-b-1-m', '', '', '2016-12-10 16:58:06', '2016-12-10 14:58:06', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-unilink-ca-usb-3-1-type-c-usb-b-1-m/', 0, 'product', '', 0),
