(6208, 1, '2016-12-10 16:58:06', '2016-12-10 14:58:06', 'С <b>uniLink-CMU</b>, передача данных с вашего устройства с портом microUSB-B на устройство с портом USB-C 2.0 со скоростью до 480 Мбит/сек.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Премиум кабель с разъемами USB 2.0 Type-C / microUSB-B.</li>\r\n 	<li>USB порт Type-C поддерживающий двухстороннюю передачу данных.</li>\r\n 	<li>Ультра-тонкий дизайн.</li>\r\n 	<li>USB 2.0 Type-C универсален и подходит для всех гаджетов.</li>\r\n 	<li>Скорость передачи данных до 480 Мбит/сек.</li>\r\n 	<li>Медный кабель.</li>\r\n 	<li>Никелированное-покрытие коннекторов.</li>\r\n 	<li>Покрытие кабеля выполнено из патентованного материала flexShield ПВХ.</li>\r\n 	<li>Совместим с Windows, MAC и Android.<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель uniLink-CMU', 'Тип USB type C - microUSB\r\nДлина 1 м\r\nВид Кабели\r\nГарантия 12 месяцев', 'publish', 'open', 'closed', '', 'kabel-unilink-cmu-usb-2-0-type-c-microusb-b-1-m', '', '', '2016-12-10 16:58:06', '2016-12-10 14:58:06', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-unilink-cmu-usb-2-0-type-c-microusb-b-1-m/', 0, 'product', '', 0),
