(6217, 1, '2016-12-10 16:58:11', '2016-12-10 14:58:11', '<b>linkMate.LT3</b> — является сертифицированным по стандартам MFI премиальным соединительным кабелем длиной 3 м, который предназначен для зарядки и синхронизации устройств последнего поколения от компании Apple. Кабель изготовлен из flexShield ПВХ с медным напылением.\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>Кабель для зарядки и синхронизации Lightning / USB</li>\r\n 	<li>Подсоединяется к USB 2.0 порту</li>\r\n 	<li>Функции стабильной зарядки и бесперебойной синхронизации</li>\r\n 	<li>Длина кабеля — 3 м</li>\r\n 	<li>Сделан из ABS пластика и flexShield ПВХ с медным напылением<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель linkMate-LT3 Lightning-USB 3 м', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кабели синхронизации</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 1</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Apple Lightning</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 2</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">3</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Гарантия </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">12 месяцев</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'kabel-linkmate-lt3-lightning-usb-3-m', '', '', '2016-12-10 16:58:11', '2016-12-10 14:58:11', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-lt3-lightning-usb-3-m/', 0, 'product', '', 0),
