(6219, 1, '2016-12-10 16:58:11', '2016-12-10 14:58:11', 'linkMate.Duo — это компактное решение с двумя разъемами в одном наконечнике. При использовании linkMateDuo Вы можете выбрать, какой разъем Вам нужен Lighning или Micro-USB. Кабель длиной 1 метр заряжает Ваше устройство от любого USB порта и поддерживает функцию синхронизации с такими мобильными устройствами, как iPhone, iPad, iPod и любым другим устройством, поддерживающим Micro-USB.\r\n\r\n<b>Возможности:</b>\r\n<b></b>\r\n<ul>\r\n 	<li>Кабель с наконечником, состоящим из двух разъемов: Lightning и Micro USB</li>\r\n 	<li>Может заряжать от любого стандартного USB порта</li>\r\n 	<li>Поддерживает зарядку и синхронизацию функций для устройств с коннектором Lightning</li>\r\n 	<li>Поддерживает зарядку и синхронизацию любых Micro-USB поддерживаемых устройств</li>\r\n 	<li>Тройная оплетка кабеля для стабильности и надежности</li>\r\n 	<li>Сделано из ABS пластика и flexShield ПВХ</li>\r\n 	<li>Длина — 1 м<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель linkMate-Duo USB-Lightning/microUSB 1 м', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кабели синхронизации</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 1</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Apple Lightning + microUSB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 2</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Гарантия </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">12 месяцев</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'kabel-linkmate-duo-usb-lightningmicrousb-1-m', '', '', '2016-12-10 16:58:11', '2016-12-10 14:58:11', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-duo-usb-lightningmicrousb-1-m/', 0, 'product', '', 0),
