(6221, 1, '2016-12-10 16:58:11', '2016-12-10 14:58:11', 'Yank-LT — это удобный, компактный, портативный кабель для синхронизации и зарядки устройств iOs (Lightning). Его отличительная особенность — наличие "рулетки", которая делает возможной регулировку нужной длины кабеля и плоский провод. Идеальное решение на все случаи жизни!\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>Кабель для синхронизации и зарядки устройств iOs с разъемом Lightning</li>\r\n 	<li>Удобный портативный дизайн с "рулеткой" для оптимизации используемой длины кабеля</li>\r\n 	<li>Защита от перезарядки и короткого замыкания</li>\r\n 	<li>80 см в длину</li>\r\n 	<li>Функция стабильной зарядки и бесперебойной синхронизации<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель Yank-LT Lightning-USB 0.9 м', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кабели синхронизации</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 1</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Apple Lightning</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 2</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">0.9</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Гарантия </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">12 месяцев</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'kabel-yank-lt-lightning-usb-0-9-m', '', '', '2016-12-10 16:58:11', '2016-12-10 14:58:11', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-yank-lt-lightning-usb-0-9-m/', 0, 'product', '', 0),
