(6225, 1, '2016-12-10 16:58:11', '2016-12-10 14:58:11', '<b>Promate Prıza EU</b> — это легкое, портативное и компактное зарядное устройство для любых USB-совместимых гаджетов в Вашем доме. Этот сетевой адаптер обеспечит быструю и эффективную зарядку для Вашего смартфона, планшетного компьютера, МР3 плеера и многого другого. Встроенный чип защитит Ваш девайс от перезарядки и короткого замыкания.\r\n\r\n<b>Возможности</b>:\r\n<ul>\r\n 	<li>Универсальное зарядное устройство для приборов, заряжаемых с помощью USB (1 A) таких как: смартфоны, небольшие планшеты и другие цифровые гаджеты</li>\r\n 	<li>Легкий и портативный дизайн</li>\r\n 	<li>Защита от короткого замыкания<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Сетевое зарядное устройство Priza-EU', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Сетевые</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Электронных книг  </br> Планшетов  </br> Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выходной ток </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 А</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'setevoe-zaryadnoe-ustrojstvo-priza-eu', '', '', '2016-12-10 16:58:11', '2016-12-10 14:58:11', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/setevoe-zaryadnoe-ustrojstvo-priza-eu/', 0, 'product', '', 0),
