(6228, 1, '2016-12-10 16:58:11', '2016-12-10 14:58:11', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate Terminal</b> — это станция для быстрой зарядки от 6 портов USB и розеткой с встроенным стабилизатором. <b>Terminal</b> заменит до 6 отдельных точек зарядки и розетку питания. Все заряжаемые устройства аккуратно разместятся на удобной интегрированной подставке, входящую в комплект. Встроенная розетка обеспечивает стабильное питание — под её элегантным дизайном скрыта современная схема защиты от перегрева, перенапряжения, перегрузок по току и короткого замыкания. <b>Promate</b> <b>Terminal</b> — универсальное решение для всех ваших потребностей в электроэнергии.\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>Подключите к любой розетке и заряжайте до 6 устройств одновременно</li>\r\n 	<li>Розетка на 220 В со встроенным стабилизатором</li>\r\n 	<li>Простота в использовании</li>\r\n 	<li>Специальная удобная полочка-держатель для заряжаемых устройств</li>\r\n 	<li>Современные микросхемы с встроенным стабилизатором обеспечивают оптимальную защиту от перегрева, от перегрузки по току и короткого замыкания</li>\r\n 	<li>Совместима со всеми USB-устройствами</li>\r\n 	<li>Корпус изготовлен из ABS-пластика, встроенного в алюминиевую теплорассеивающую панель<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Универсальное зарядное устройство Promate Terminal', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Сетевые</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">6</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Электронных книг  </br> Планшетов  </br> Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Возможность зарядки 6 устройств одновременно </br> Розетка на 220 В со встроенным стабилизатором </br> Специальная полочка-держатель для заряжаемых устройств</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">145 мм х 143.8 мм х 33 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">979 гр</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Питание</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">100 - 240 В</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'universalnoe-zaryadnoe-ustrojstvo-promate-terminal', '', '', '2016-12-10 16:58:11', '2016-12-10 14:58:11', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/universalnoe-zaryadnoe-ustrojstvo-promate-terminal/', 0, 'product', '', 0),
