(6231, 1, '2016-12-10 16:58:11', '2016-12-10 14:58:11', '<strong>UniHub-C высокоскоростной 4-в-1 USB 3.1 Type-C Hub с функцией зарядки</strong>\r\n\r\nИспытайте технологию следующего поколения с uniHub-C. 4-в-1 USB 3.1 Type-C USB Хаб - гладкий и компактный, а также оснащен USB 3.1 Type-C Зарядным портом, двумя USB 3.0 портами и 4K HDMI-портом. Просто подключите uniHub-C к вашим устройствам, поддерживающим USB Type-C и наслаждайтесь технологией будущего!\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>•Высокая производительность :</strong> позволяет заряжать MacBook и в то же время быть подключенным к USB 3.0 и HDMI девайсам\r\n<strong>•Уникальное воспроизведение 4к :</strong> USB-C-HDMI адаптер позволяет с легкостью подключить ваш компьютер/ноутбук через USB 3.0 к телевизору/устройству поддерживающее 4к\r\n<strong>•Реверсивный USB-C Разъем:</strong> вы можете подключить USB 3.0 любой стороной SuperSpeed\r\n<strong>•USB 3.0:</strong> Это устройство передает данные через USB с невероятной скоростью, до 5 Гбит. Этого достаточно,чтобы передать фильм высокого качества в секунды USB-C\r\n<strong>•Совместимость:</strong> Предназначен для работы с последним поколением компьютеров и смарт-устройств, поддерживающих USB Type-C порты\r\n<strong>•Легкая и тонкая конструкция:</strong> Благодаря качественному алюминию, внешнему виду и компактному дизайну, uniHub-C является идеальным аксессуаром для вашего нового MacBook и других поддерживаемых устройств типа USB-С', 'USB Type-C Хаб uniHub-C', '<ul>\r\n 	<li style="text-align: left;">Интерфейс: USB 3.0</li>\r\n 	<li style="text-align: left;">Напряжение USB: 5V, 900mA</li>\r\n 	<li style="text-align: left;">Скорость передачи данных: 5Gbps</li>\r\n 	<li style="text-align: left;">Поддержка ОС: Windows 10/8/7 / Vista / XP, Mac OS X 10.2 (и выше)</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'aksessuary-dlya-noutbukov-unihub-c', '', '', '2016-12-10 16:58:11', '2016-12-10 14:58:11', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/aksessuary-dlya-noutbukov-unihub-c/', 0, 'product', '', 0),
