(6233, 1, '2016-12-10 16:58:15', '2016-12-10 14:58:15', 'Ультра-быстрый портативный USB 3.0 хаб с 4 портами зарядки и синхронизации Дополнительные порты: включите в один из портов USB компьютера хаб и получите четыре порта\r\n<ul>\r\n 	<li>Портативный: весом около унции и супер маленький, этот хаб можно носить с собой куда угодно</li>\r\n 	<li>Сверхпрочный: Усиленный встроенный кабель, прочные внешние и термостойкие разъемы делают этот хаб невероятно прочным</li>\r\n 	<li>Идеальная совместимость: EZhub идеально подходит для периферийных устройств, таких как жестких дисков с USB 3.0, цифровых видеокамер и веб-камер высокого разрешения</li>\r\n 	<li>Plug And Play: Подключение и настройка не требует программного обеспечения и устройство готово к работе прямо из коробки</li>\r\n 	<li>Обратная совместимость: Он также обратно совместим с USB 2.0 устройствами.</li>\r\n</ul>', 'Аксессуар для ноутбука Ezhub', 'Интерфейс: USB 3.0\r\nнапряжение USB: 5V, 900mA\r\nВходной сигнал: 5V / 1A\r\nСкорость передачи данных: 5Gbps\r\nПоддержка ОС: 10/8/7 / Vista / XP, Mac OS X 10.2 (и выше)', 'publish', 'closed', 'closed', '', 'aksessuary-dlya-noutbukov-ezhub', '', '', '2016-12-10 16:58:15', '2016-12-10 14:58:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/aksessuary-dlya-noutbukov-ezhub/', 0, 'product', '', 0),
