(6235, 1, '2016-12-10 16:58:15', '2016-12-10 14:58:15', '<b>Booster-C</b> — это универсальное автомобильное зарядное устройство с двумя портами USB и с разъемом на конце провода типа Type-C USB.\r\n\r\nКомпактный и простой в использовании Booster-C многофункционален. Во-первых, он обеспечивает зарядку путем подключения разъемов USB. Во-вторых, два встроенных USB порта позволяют одновременно запитать еще два дополнительных устройства от прикуривателя вашего автомобиля. С Booster-C можно не беспокоиться о разряженных батареях ваших гаджетов, а просто наслаждаться дорогой.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>2-в-1 кабель с разъемами USB и Type-С</li>\r\n 	<li>Заряди сразу два устройства</li>\r\n 	<li>Оптимизированный процесс зарядки</li>\r\n 	<li>Низкая теплоотдача</li>\r\n</ul>', 'Автомобильное зарядное устройство Booster-C', 'Входное напряжение: 12-24 В постоянного тока\r\nВыход: 5V, 7.2A\r\nМакс Выходной ток: Макс 7.2A\r\nПорты USB: 4.2A\r\nТype-C Кабель: 3A\r\nВходной интерфейс: прикуриватель\r\nДлина кабеля: 1,5 м\r\nВыходной интерфейс: 2 USB портов, Type-C кабель', 'publish', 'open', 'closed', '', 'zaryadnye-ustrojstva-booster-c-champagne', '', '', '2016-12-10 16:58:15', '2016-12-10 14:58:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zaryadnye-ustrojstva-booster-c-champagne/', 0, 'product', '', 0),
