(6237, 1, '2017-07-06 11:29:35', '2017-07-06 09:29:35', '', 'Автомобильное зарядное устройство Booster-C 2', '', 'inherit', 'open', 'closed', '', 'avtomobilnoe-zaryadnoe-ustrojstvo-booster-c-2', '', '', '2017-07-06 11:29:35', '2017-07-06 09:29:35', '', 6235, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/3-Booster-C-Champagne1.jpg', 0, 'attachment', 'image/jpeg', 0),
(6238, 1, '2016-12-10 16:58:15', '2016-12-10 14:58:15', '<strong>60W/10.8A USB-зарядная станция с функцией Qualcomm Quick Charge 3.0</strong>\r\n<ul>\r\n 	<li>Qualcomm Quick Charge 3.0: Технология, которая позволяет заряжать устройства в 4 раза быстрее и поддерживает все стандарты USB</li>\r\n 	<li>В 4 раза быстрее: заряжайте до 4 раз быстрее, чем стандартные зарядные устройства, этот хаб способен заряжать совместимые устройства до 80% всего за 35 минут.</li>\r\n 	<li>USB Type-C: заряжайте устройства на процессорах Qualcomm, которые поддерживают USB Type-c</li>\r\n 	<li>Ультра мощный: Шесть портов обеспечивают выходную мощность 60 Вт, что позволяет одновременно заряжать до 4-х устройств.</li>\r\n 	<li>Универсальная зарядка: Не только совместим с новейшим USB Type-C, но и совместим с большинством смартфонов и планшетов благодаря адаптивной технологии зарядки</li>\r\n 	<li>Одновременная зарядка: TurboHub может одновременно заряжать до 6 устройств с одинаковой скоростью</li>\r\n 	<li>3 в 1 Защита: USB-хаб оснащен "умной схемой" с защитой от короткого замыкания и чрезмерной зарядки</li>\r\n</ul>', 'Зарядное устройство Turbohub', 'Входное напряжение: 12-24 В постоянного тока\r\nСтандартный USB порты: 5V, 1.2A\r\nType-C порт зарядки: 5V, 3A\r\nQC 3.0: 3.6-6.5V / 3A, 6.5-9V / 2A, 9-12V / 1.5A\r\nQC2.0: 5V / 2.4A, 9V / 2A, 12V / 1.5A\r\nМаксимальная выходная мощность: 42W\r\nВыходной интерфейс: USB-порт\r\nType-C порт\r\nQC 3.0 порт', 'publish', 'open', 'closed', '', 'zaryadnye-ustrojstva-turbohub-black', '', '', '2016-12-10 16:58:15', '2016-12-10 14:58:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zaryadnye-ustrojstva-turbohub-black/', 0, 'product', '', 0),
