(6241, 1, '2016-12-10 16:58:15', '2016-12-10 14:58:15', '<strong>2100mA Адаптер с двумя Юсб портами и встроенный LED-осветителем</strong>\r\n\r\n<strong>Особенности</strong> :\r\n<ul>\r\n 	<li>Супер компактный: Glint очень лёгкий и компактный</li>\r\n 	<li>Два usb порта: заряжайте два USB устройства с помощью двух встроенных USB портов</li>\r\n 	<li>Универсальная совместимость: Glint совместим со всеми USB устройствами</li>\r\n 	<li>Защита 3 в 1 : Glint оснащён "умной схемой" которая обеспечивает защиту от замыкания, чрезмерной зарядки и перегрева</li>\r\n</ul>', 'Сетевое зарядное устройство Glint-EU', 'Входное напряжение: 100-240 1A, 50 / 60Гц\r\nВыход: DC 5V, 2.1A (макс)\r\nLED яркость: 22 люменов\r\nСделано из пластмассы ABS', 'publish', 'open', 'closed', '', 'zaryadnye-ustrojstva-glint-eu', '', '', '2016-12-10 16:58:15', '2016-12-10 14:58:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zaryadnye-ustrojstva-glint-eu/', 0, 'product', '', 0),
