(6244, 1, '2016-12-10 16:58:15', '2016-12-10 14:58:15', '<strong>Promate linkMate-MUL</strong> - сверхпрочный армированный кабель microUSB/Lightning .\r\n<ul>\r\n 	<li>2-In-1: linkMate-MUL сочетает в себе функцию Lightning и микро USB кабеля в одном иновационном устройстве. Одна сторона подходит для Apple (iPod, iPad, iPhone) устройств, а другая для всех Micro-USB устройств</li>\r\n 	<li>Двойной адаптивный разъем: Оснащенный как Lightning так и Micro-USB коннектором linkMate-MUL является лучшим решением для пользователей как Apple так и Micro-USB устройств. Заряжайте и синхронизируйте ваши устройства вне зависимости от порта, просто поверните кабель нужной вам стороной и пользуйтесь.</li>\r\n 	<li>Самая быстрая синхронизация и зарядка: Поддержка быстрой синхронизации и быстрой зарядки для всех поддерживаемых устройств</li>\r\n 	<li>Идеальная длина: 1.2 м в длину, он идеально подходит для использования в доме, офисе или автомобиле</li>\r\n 	<li>Невероятно прочный: Высокая прочность и еластичность (4000+ сгибов) — позволяет ему оставаться функциональным в несколько раз дольше, чем стандартным кабелям из ПВХ</li>\r\n 	<li>Универсальная совместимость с чехлами: максимально удобный размер позволяет пользоваться кабелем не снимая чехол с устройства<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Кабель cинхронизации linkMate-MUL', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разьем 1 </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple Lightning/Micro-USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разьем 2</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1,2 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">OTG</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple Lightning/Micro-USB</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'kabel-cinxronizacii-linkmate-mul', '', '', '2016-12-10 16:58:15', '2016-12-10 14:58:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-cinxronizacii-linkmate-mul/', 0, 'product', '', 0),
