(6249, 1, '2016-12-10 16:58:15', '2016-12-10 14:58:15', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\nВысокоскоростной сверх-прочный армированный Micro-USB кабель <strong>Promate linkmate-U2M</strong>.\r\n<ul>\r\n 	<li>Высококачественный кабель: заряжайте и синхронизируйте ваши устройства с помощью этого кабеля</li>\r\n 	<li>Строгий дизайн: благодаря матовому дизайну и металическим материалам, этот кабель будет гармонично сочетаться с вашим смартфоном</li>\r\n 	<li>Кабель из крепких материалов: Не беспокойтесь о том, что кабель порвётся так как linkMate-U2M изготовлен из высокопрочного нейлона</li>\r\n 	<li>Быстрая зарядка: linkMate-U2M передает ток с необычайной скоростью, что позволяет быстро и безопасно зарядить устройство</li>\r\n 	<li>Стабильность: данный кабель обеспечивает стабильную синхронизацию данных и бесперебойную зарядку</li>\r\n 	<li>Безопасность: linkMate-U2M оснащён "умным чипом", который защищает кабель от перегрева и предотвращает короткое замыкание</li>\r\n 	<li>Совместимость: данный кабель поддерживает все устройства с Micro-USB разъёмом<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Кабель cинхронизации linkmate-U2M', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разьем 1</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Micro-USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разьем 2</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> USB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Длина кабеля</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1,2 м</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">OTG</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Micro-USB</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'kabel-cinxronizacii-linkmate-u2m', '', '', '2016-12-10 16:58:15', '2016-12-10 14:58:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-cinxronizacii-linkmate-u2m/', 0, 'product', '', 0),
