(6252, 1, '2016-12-10 16:58:19', '2016-12-10 14:58:19', 'HDMI-VGA переходник:\r\n<ul>\r\n 	<li>Подключите и пользуйтесь: Начинайте пользоваться прямо из коробки, без дополнительных установок ПО</li>\r\n 	<li>Универсальная совместимость: Совместим со всеми последними устройствами</li>\r\n 	<li>Улучшенный дизайн: Ультро-компактное устройство</li>\r\n 	<li>Безграничная подключение: Позволяет просматривать фотографии, видео и презентации с компьютера или мини-компьютера на телевизоре высокой четкости</li>\r\n 	<li>Поддержка видео HD: поддерживает видео с разрешением до 1920 х 1080, не требует внешнего источника питания</li>\r\n 	<li>Видео выход: до 1920 х 1080/60 Гц</li>\r\n 	<li>Пропускная способность: 1.65 Гбит</li>\r\n 	<li>Мощность: 300 мА</li>\r\n 	<li>Напряжение: 3.3 В</li>\r\n 	<li>1 выход HDMI</li>\r\n 	<li>1 VGA вход</li>\r\n 	<li>Рабочая температура: 15 °C до +55 °С<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Переходник ProLink-H2V', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Видео выход: </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">до 1920 х 1080/60 Гц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;"> Пропускная способность</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1,65 Гбит</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;"> Мощность</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">300 мА</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;"> Напряжение</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 3.3V</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Порты</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> 1 выход HDMI; </br> 1 VGA вход;</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Рабочая температура</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">  15C до +55С</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'perexodnik-prolink-h2v', '', '', '2016-12-10 16:58:19', '2016-12-10 14:58:19', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/perexodnik-prolink-h2v/', 0, 'product', '', 0),
