(6258, 1, '2016-12-10 16:58:19', '2016-12-10 14:58:19', 'linkMate.L2 - высокопроизводительный Ethernet-кабель обеспечивающий высокую скорость передачи данных при подключении сети Интернет к Вашему компьютеру дома или в офисе. Кабель изготовлен из flexShield™ ПВХ с медным напылением. linkMate.L2 обеспечивает повышенную пропускную способность с частотой до 600Mhz и поддерживает высокую скорость передачи данных при одновременном открытии сразу нескольких приложений (до 10Gbps). Используйте Promate link Mate.L2 для подключения к модему, маршрутизатору, ПК, ноутбуку или просто к любому устройству, которое требует проводного подключения к локальной сети. Длина кабеля 1,5 метра. Высокоскоростной Ethernet кабель Предназначены для отличной скорости и надежного соединения Повышенная пропускная способность 600 Mhz для передачи данных, голоса или видео\r\n<ul>\r\n 	<li>Скорость до 10Gbps Плоская структура - удобно закрепить на любой поверхности, даже угловатой</li>\r\n 	<li>1.5 метра длина</li>\r\n 	<li>Сделан из flexShield™ ПВХ с медным напылением</li>\r\n</ul>', 'linkMate-L2', 'Разьем 1 Ethernet (RJ45)\r\nРазьем 2 Ethernet (RJ45)\r\nДлина кабеля 1,5 м\r\nOTG нет\r\nСовместимость Ethernet (RJ45)', 'publish', 'open', 'closed', '', 'linkmate-l2-white-product-variation', '', '', '2016-12-10 16:58:19', '2016-12-10 14:58:19', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/linkmate-l2-white-product-variation/', 0, 'product', '', 0),
