(6261, 1, '2016-12-10 16:58:19', '2016-12-10 14:58:19', '<b>Promate linkMate-Trio</b> — это 3 разъема на 1 USB кабеле для синхронизации, переноса данных и подзарядки. Для людей которые не хотят хлопот покупая кучу кабелей с перспективой их распутывать. Длина кабеля с разъемами 30-pin, Lightning и microUSB на конце, составляет 1 метр.\r\n\r\nДля зарядки или синхронизации девайсов просто выберите между тремя разъемами и вставьте другой конец в USB порт. <b>linkMate-Trio</b> не путается и не создает беспорядка.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Один кабель для зарядки и синхронизации всех ваших устройств</li>\r\n 	<li>Включает USB / Apple 30-pin, Lightning и Micro-USB коннекторы</li>\r\n 	<li>Супер быстрый перенос данных</li>\r\n 	<li>Подзарядка от любого стандартного порта USB</li>\r\n 	<li>Тройная обмотка кабеля для стабильной и долговечной работы</li>\r\n 	<li>Гибкий кабель длиной 1 метр</li>\r\n 	<li>Сверх компактный и портативный</li>\r\n 	<li>Изготовлен из пластика с экранированной конструкцией кабеля</li>\r\n</ul>', 'Кабель linkMate-Trio USB-Lightning/30-pin/microUSB 1 м', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кабели синхронизации</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 1</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Apple Lightning + Apple 30-pin + microUSB</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Разъем 2</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB</td></tr><tr>