(6267, 1, '2016-12-10 16:58:19', '2016-12-10 14:58:19', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>linkMate-ST</b> — одна из последних новинок от компании <b>Promate</b> — удобная док-станция со встроенным разъемом microUSB, с помощью которой можно синхронизировать ваш смартфон с ПК через USB разъем.\r\n\r\nОдновременно при соединении с ПК ваш смартфон будет заряжаться. <b>linkMate-ST</b> упорядочивает и упрощают работу с вашими девайсами.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Подвижный</li>\r\n 	<li>Синхронизирует и заряжает одновременно</li>\r\n 	<li>Плоский и очень удобен для использования microUSB кабель</li>\r\n 	<li>Передача данных: 480 Мбит/с</li>\r\n 	<li>Материал: ПВХ<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Кабель linkMate-ST', '<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Совместимость</td>\r\n<td style="vertical-align: top; width: 56.6838%;">Asus HP HTC LG Motorola Nokia Qtek Samsung Sigma Sony Ericsson</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Тип</td>\r\n<td style="vertical-align: top; width: 56.6838%;">Кабели синхронизации</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Разъем 1</td>\r\n<td style="vertical-align: top; width: 56.6838%;">microUSB</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Разъем 2</td>\r\n<td style="vertical-align: top; width: 56.6838%;">USB</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Длина кабеля</td>\r\n<td style="vertical-align: top; width: 56.6838%;">1.2</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'publish', 'open', 'closed', '', 'kabel-linkmate-st-usb-microusb-1-2-m', '', '', '2016-12-10 16:58:19', '2016-12-10 14:58:19', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-st-usb-microusb-1-2-m/', 0, 'product', '', 0),
