(6269, 1, '2016-12-10 16:58:19', '2016-12-10 14:58:19', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate linkMate-U4</b> — это кабель премиум класса с переходником USB тип-А на microUSB-B для подключения жестких дисков и других периферийных USB устройств и сверх быстрой передачи данных.\r\n\r\nИзготовлен из flexShield ПВХ с медным напылением, а USB 3.0 обеспечивает передачу данных до 5 Гбит/с. Длина кабеля состапляет 1.5 метра.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Обеспечивает передачу данных на скорости до 5 Гбит/с</li>\r\n 	<li>Обратная совместимость с устройствами USB 2.0 и 1.1</li>\r\n 	<li>Поддержка "горячее подключение"</li>\r\n 	<li>Совместим с драйверами жестких дисков и другими USB 3.0 периферийными устройствами</li>\r\n 	<li>Сделан из flexShield PVC с напылением меди<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Кабель linkMate-U4', 'Совместимость USB-microUSB\r\nСовместимость Asus\r\nHP\r\nHTC\r\nLG\r\nMotorola\r\nNokia\r\nQtek\r\nSamsung\r\nSigma\r\nSony Ericsson\r\nТип Кабели синхронизации\r\nРазъем 1 microUSB\r\nРазъем 2 USB\r\nДлина кабеля 1.15', 'publish', 'open', 'closed', '', 'kabel-linkmate-u4-usb-microusb-1-15-m', '', '', '2016-12-10 16:58:19', '2016-12-10 14:58:19', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-u4-usb-microusb-1-15-m/', 0, 'product', '', 0),
