(6272, 1, '2016-12-10 16:58:23', '2016-12-10 14:58:23', '<b>Promate chargHub</b> — это поистине великолепное решение карманного размера, в котором предусмотрены 4 разъема для синхронизации и зарядки основных устройств представленных на сегодняшнем рынке, а именно Apple iPhone4/4S, iPhone 5/5S, все поколения iPod, все microUSB и miniUSB совместимые устройства.\r\n\r\n<b>ChargHub </b>просто незаменим в поездка и путешествиях, особенно, когда члены семьи или путешествующей команды предпочитают разные марки смартфонов и планшетов.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Компактный и портативный</li>\r\n 	<li>Убирает беспорядок от использования большого количества разных проводов</li>\r\n 	<li>Встроенный Apple Lightning и 30-pin коннекторы</li>\r\n 	<li>Встроенный miniUSB и microUSB коннекторы</li>\r\n 	<li>Просто подсоедини и заряжай</li>\r\n 	<li>Может заряжать одно устройство в один момент времени<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Мобильный комплект зарядки устройств Charghub', 'Совместимость Apple Lightning / Apple 30-pin / microUSB / miniUSB\r\nСовместимость Apple\r\nAsus\r\nHP\r\nHTC\r\nLG\r\nMotorola\r\nNokia\r\nQtek\r\nSamsung\r\nSigma\r\nSony Ericsson\r\nТип Кабели синхронизации\r\nРазъем 1 Apple Lightning + Apple 30-pin + microUSB + miniUSB\r\nРазъем 2 USB\r\nДлина кабеля 0.1', 'publish', 'open', 'closed', '', 'mobilnyj-komplekt-zaryadki-i-sinxronizacii-ustrojstv-4-v-1-charghub-usb-lightning30-pinmicrousbminiusb-0-1-m', '', '', '2016-12-10 16:58:23', '2016-12-10 14:58:23', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/mobilnyj-komplekt-zaryadki-i-sinxronizacii-ustrojstv-4-v-1-charghub-usb-lightning30-pinmicrousbminiusb-0-1-m/', 0, 'product', '', 0),
