(6275, 1, '2016-12-10 16:58:23', '2016-12-10 14:58:23', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate linkMate-U2L</b> — кабель премиум качества для зарядки и синхронизации приборов с разъемами USB и microUSB на концах.\r\n\r\nИзготовлен из flexShield ПВХ с медным напылением, и обеспечивает передачу данных до 480 Мбит/сек с безошибочной работой и поддержкой функции "горячее подключение".\r\n\r\nРаботает со всеми устройствами USB 2.0, а также имеет полную обратную совместимость со всеми USB 1.0 и 1.1 устройств. Длина кабеля 3 метра.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Кабель высокоскоростной USB тип-A / microUSB 2.0</li>\r\n 	<li>Обеспечивает передачу данных со скоростью до 480 Мбит/сек</li>\r\n 	<li>Обратная совместимость с USB 1.0 и 1.1 устройствами</li>\r\n 	<li>Поддерживает функцию зарядки (для совместимых смартфонов)</li>\r\n 	<li>Поддерживает функцию "горячее подключение"</li>\r\n 	<li>Совместим со смартфонами, планшетами и другими USB 2.0 периферийными устройствами</li>\r\n 	<li>Compatible with smartphones, tablets and other USB 2.0 peripheals</li>\r\n 	<li>Сделан из flexShield ПВХ с напылением меди<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Кабель linkMate-U2L', '<table style="width: 99.8503%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Совместимость</td>\r\n<td style="vertical-align: top; width: 56.6838%;">Asus HP HTC LG Motorola Nokia Qtek Samsung Sigma Sony Ericsson</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Тип</td>\r\n<td style="vertical-align: top; width: 56.6838%;">Кабели синхронизации</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Разъем 1</td>\r\n<td style="vertical-align: top; width: 56.6838%;">microUSB</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Разъем 2</td>\r\n<td style="vertical-align: top; width: 56.6838%;">USB</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 41.5167%; vertical-align: top;">Длина кабеля</td>\r\n<td style="vertical-align: top; width: 56.6838%;">3</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'publish', 'open', 'closed', '', 'kabel-linkmate-u2l-3-m', '', '', '2016-12-10 16:58:23', '2016-12-10 14:58:23', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-u2l-3-m/', 0, 'product', '', 0),
