(6279, 1, '2016-12-10 16:58:23', '2016-12-10 14:58:23', '<b>Promate proChargeLT</b> — это сертифицированное по стандартам MFI компании Apple автомобильное зарядное устройство для вашего iPad, iPhone, iPod с разъемом типа Lightning.\r\n\r\nВысококачественные материалы применяемые при производстве обеспечивают превосходный результат в эксплуатации зарядного устройства и гарантируют длительный период его использования в автомобиле.\r\n\r\nМожно быть уверенным, что <b>Promate proChargeLT</b> не подведет вас в пути и зарядит ваш iOS девайс.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Многофункциональное зарядное устройство с коннектором Lightning</li>\r\n 	<li>Длина кабеля 1 м</li>\r\n 	<li>Защита от короткого замыкания и перезарядки</li>\r\n 	<li>Совместимость: 12~24 В постоянного тока</li>\r\n</ul>', 'Автомобильное зарядное устройство proChargeLT', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Автомобильные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Apple Lightning</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Планшетов  Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Есть</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Вход: 12~24 В постоянного 