(6283, 1, '2016-12-10 16:58:23', '2016-12-10 14:58:23', '<b>Tryx-1</b> представляет собой комплект из зарядного устройства с 1 А USB портом и кабелем длиной 0.7 метра с разъемом USB и 3-в-1: 30-pin, Lightning и microUSB на противоположных концах. Таким образом, пользователь может заряжать от 1 зарядки и 1 кабеля свой iPad, iPhone, iPod (Apple iOS7) и любой другой гаджет с входным портом microUSB.\r\n\r\nКабель выполнен в форме плоской ленты, что исключает его спутывание и делает использование<b> Tryx-1</b> комфортным и простым. Универсальность и продуманность зарядного устройства <b>Promate Tryx-1</b> не даст и шанса остаться вашим электронным гаджетам без подзарядки.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Премиальная зарядка 3-в-1</li>\r\n 	<li>Lightning, 30-pin, microUSB коннекторы "все-в-одном"</li>\r\n 	<li>Плоский кабель для предотвращения спутывания</li>\r\n 	<li>0.7 м кабель</li>\r\n 	<li>Стабильная зарядка и функция синхронизации устройств</li>\r\n</ul>', 'Автомобильное зарядное устройство Tryx-1', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Автомобильные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">1</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Планшетов  Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: to