(6289, 1, '2016-12-10 16:58:28', '2016-12-10 14:58:28', 'Возможность заряжать не 1, не 2, а сразу 3 USB девайса дает зарядное устройство <b>Cactus</b> от компании <b>Promate</b> в виде 3-х USB.\r\n\r\nБлагодаря инновациям и эксклюзивному дизайну в виде кактуса (USB порт расположен в каждом из отростков), вы можете заряжать эффективно и быстро сразу несколько гаджетов в автомобиле. Покупая <b>Cactus</b> пользователь приобретает 3 зарядных устройства по цене одного и, как бонус — стильный дизайн гаджета в виде кактуса.\r\n\r\n<b>Возможности:</b>\r\n<ul>\r\n 	<li>3 USB порта для одновременной зарядки 3-х устройств</li>\r\n 	<li>Используйте USB кабели для зарядки своих устройств</li>\r\n 	<li>Умная защита от перезарядки и короткого замыкания</li>\r\n 	<li>LED подсветка в темноте делает удобным подключение к разъемам</li>\r\n 	<li>Широко разведенные порты для предотвращения спутывания кабелей</li>\r\n 	<li>Корпус изготовлен из ABS пластика&nbsp;</li>\r\n</ul>', 'Автомобильное зарядное устройство Cactus', 'Тип Автомобильные\r\nСовместимость Универсальная\r\nКоличество USB-портов 3\r\nПодходит для зарядки Электронных книг\r\nПланшетов\r\nМобильных телефонов\r\nКабель в комплекте Нет\r\nДополнительные характеристики Выходной ток: 5 В, 2.2 A', 'publish', 'open', 'closed', '', 'avtomobilnoe-zaryadnoe-ustrojstvo-cactu', '', '', '2016-12-10 16:58:28', '2016-12-10 14:58:28', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtomobilnoe-zaryadnoe-ustrojstvo-cactu/', 0, 'product', '', 0),
