(6291, 1, '2016-12-10 16:58:28', '2016-12-10 14:58:28', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate Powerbase</b> — сверхмощная универсальная зарядная станция с 6 USB портами и смарт-регулятором напряжения. Теперь вы можете заряжать 6 устройств одновременно.\r\n\r\nПод элегантным дизайном скрыта ультрасовременная схема защиты от перегрева, перенапряжения, перегрузок по току и короткого замыкания.\r\n\r\n<b>Powerbase</b> — универсальное решение для всех ваших потребностей в электроэнергии.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Возможность зарядки 6-ти устройств одновременно</li>\r\n 	<li>Смарт-схема обеспечивает защиту от перегрева, избыточного заряда и короткого замыкания</li>\r\n 	<li>Совместимость со всеми USB-устройствами</li>\r\n 	<li>Материал изготовления: ABS-пластик<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'Зарядная док-станция Powerbase', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Сетевые</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Универсальная</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Количество USB-портов </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">6</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит для зарядки </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Электронных книг  </br> Планшетов  </br> Мобильных телефонов</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Кабель в комплекте </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нет</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Возможность зарядки 6 устройств одновременно</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Питание</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">100 - 240 В / 1 А, 50/60 Гц</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Выход</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">DC 5 В / 8 А</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Размеры</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">111 х 78 х 65 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Вес</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">202 г</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'zaryadnaya-dok-stanciya-powerbase', '', '', '2016-12-10 16:58:28', '2016-12-10 14:58:28', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zaryadnaya-dok-stanciya-powerbase/', 0, 'product', '', 0),
