(6294, 1, '2016-12-10 16:58:28', '2016-12-10 14:58:28', '<div id="short_text" class="b-rich-text text-description-content">\r\n\r\n<b>Promate masterHub</b> — это высокопроизводительный USB-хаб, включающий в себя 10 USB портов. Из них 4 порта версии USB 3.0 со скоростью передачи данных до 5 Гбит/с и 6 портов версии 2.0 со скоростью передачи данных до 480 Мбит/с. <strong>m</strong><b>asterHub</b> — это устройство, которое снимет своим наличием все вопросы по необходимым для работы на ПК USB портам.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>USB 3.0 и USB 2.0 совместимые интерфейсы</li>\r\n 	<li>Индивидуальные переключатели влючения/выключения и LED индикаторы на каждый порт</li>\r\n 	<li>Внешнее питание для дополнительного входа мощности</li>\r\n 	<li>С режимами автономного питания или питания от шины</li>\r\n 	<li>Сделан из ABS пластика</li>\r\n 	<li>USB напряжение: 5 В, 900 мА</li>\r\n 	<li>Усилители: 3 A</li>\r\n 	<li>Потребление мощности: 5 В, 3 A</li>\r\n 	<li>Скорость передачи данных: 480 Мбит/с – 5 Гбит/с<span id="copyinfo">\r\n</span></li>\r\n</ul>\r\n</div>', 'USB-хаб masterHub', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Категория </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">USB-хабы</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">ПК и ноутбуки с портом USB 2.0 или USB 3.0</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Порты</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">4 x USB 3.0 </br> 6 x USB 2.0</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Скорость передачи данных: </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">до 5 Гб/с через USB 3.0</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'usb-xab-masterhub', '', '', '2016-12-10 16:58:28', '2016-12-10 14:58:28', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/usb-xab-masterhub/', 0, 'product', '', 0),
