(6296, 1, '2016-12-10 16:58:28', '2016-12-10 14:58:28', '<b>Promate Lami-2</b> — многофункциональный стилус, совмещенный с шариковой ручкой, совместимый со всеми устройствами, имеющими сенсорный экран. Использовать <b>Lami-2</b> удобно и комфортно, как для редактирования документов, до игр на планшете или смартфоне. Чувствительный наконечник дает фантастическую точность и контроль играете Вы или работаете!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>2-в-1 ультрачувствительная ручка-стилус</li>\r\n 	<li>Может быть использована и как ручка, и как стилус</li>\r\n 	<li>Мягкий наконечник обеспечивает непревзойденную точность и комфорт использования и не царапает экран</li>\r\n 	<li>Идеальна для рисования, черчения, редактирования документов</li>\r\n 	<li>Удобная клипса</li>\r\n 	<li>Доступна в разных цветах</li>\r\n 	<li>Совместима со всеми типами сенсорных экранов (со всеми приборами)</li>\r\n</ul>', 'Стилус Lami-2', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Совместимость </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Подходит ко всем емкостным сенсорным экранам смартфонов и планшетов.</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Дополнительные характеристики </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Шариковая ручка.</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'stilus-lami-2', '', '', '2016-12-10 16:58:28', '2016-12-10 14:58:28', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/stilus-lami-2/', 0, 'product', '', 0),
