(6300, 1, '2016-12-10 16:58:28', '2016-12-10 14:58:28', 'Сверхпрочная сумка <b>Promate Rebel-MB</b> для ноутбуков размером до 13.3 дюймов.\r\n\r\nГлавный отсек плотно проложен специальным наполнителем, а специальная сетка служит дополнительной поддержкой для дополнительного комфорта.\r\nСумка имеет передний карман на молнии для Ваших небольших ежедневных вещей.\r\nРегулируемый ремень и ручка для легкой носки сделают Вашу сумку еще более удобной.\r\n\r\nСумка <b>Promate Rebel-MB</b> изготовлена из водонепроницаемого нейлонового материала.\r\n\r\nНосите Ваши вещи в максимальной безопасности. Дизайн <b>Rebel-MB</b> удовлетворит любого современного человека.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Сумка для ноутбука Rebel-MB', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">12"-13.4"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нейлон</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'sumka-dlya-noutbuka-rebel-mb', '', '', '2016-12-10 16:58:28', '2016-12-10 14:58:28', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/sumka-dlya-noutbuka-rebel-mb/', 0, 'product', '', 0),
