(6319, 1, '2016-12-10 16:58:32', '2016-12-10 14:58:32', 'Стильный, легкий водостойкий рюкзак <b>Promate Rover</b> с несколькими карманами на молнии и регулируемыми плечевыми шлейками для ноутбуков диагональю до 15.6 дюймов.\r\n\r\n<b>Rover</b> — это классический рюкзак с большим пространством внутри, но портативный снаружи.\r\nРазмер рюкзака и его плоская структура с верхним клапаном дают возможность с легкостью поместить в него Ваш ноутбук.\r\nОдин главный отсек создан специально для ноутбука и проложен мягким прочным материалом.\r\nРюкзак имеет два боковых кармана, один передний карман с регулируемыми ремнями.\r\nЭтот рюкзак, вероятно, все, что нужно Вам для дальних поездок.\r\nСделан из водостойкого материала.\r\nРегулируемые мягкие плечевые ремни для дополнительного комфорта.\r\n\r\nРюкзак <b>Promate Rover</b> всегда будет актуален в школе, колледже, деловых поездках и встречах.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Рюкзак для ноутбука Rover', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15"-15.6"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя ширина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">420 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нейлон</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Повседневные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">300 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">25 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'ryukzak-dlya-noutbuka-rover', '', '', '2016-12-10 16:58:32', '2016-12-10 14:58:32', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/ryukzak-dlya-noutbuka-rover/', 0, 'product', '', 0),
