(6324, 1, '2016-12-10 16:58:32', '2016-12-10 14:58:32', '<b>Promate Ascend-BP </b>- удобный рюкзак для ноутбуков с диагональю экрана до 15.6 дюймов с множеством карманов и отделений. С этим рюкзаком вы всегда будете в тренде.\r\n<ul>\r\n 	<li>Специальная сетка служит дополнительной поддержкой для дополнительного комфорта</li>\r\n 	<li>Главный отсек, плотно проложен специальным наполнителем</li>\r\n 	<li>Передний карман на молнии служит для ваших небольших ежедневных вещей первой необходимости</li>\r\n 	<li>Изготовлен из водонепроницаемого материала</li>\r\n 	<li>Регулируемые наплечные ремни для дополнительного комфорта</li>\r\n 	<li>Веселый и юношеский дизайн</li>\r\n 	<li>Дизайн Ascend-BP удовлетворит любого современного человека</li>\r\n</ul>', 'Рюкзак для ноутбука Ascend-BP', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15"-15.6"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя ширина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">460 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нейлон</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Повседневные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">280 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">40 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'ryukzak-dlya-noutbuka-ascend-bp', '', '', '2016-12-10 16:58:32', '2016-12-10 14:58:32', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/ryukzak-dlya-noutbuka-ascend-bp/', 0, 'product', '', 0),
