(6326, 1, '2016-12-10 16:58:32', '2016-12-10 14:58:32', '<b>Promate Dapp-BP</b> — стильный рюкзак для ноутбука с диагональю экрана до 14.1 дюймов.\r\n<ul>\r\n 	<li>Классический и элегантный рюкзак может вместить ноутбук диагональю до 14.1 дюймов</li>\r\n 	<li>Прочный и стеганый зиппер главного отделения будет держать ваш ноутбук защищенным</li>\r\n 	<li>Специальное покрытие предотвращает от скольжения Ваш девайс</li>\r\n 	<li>Сделано из прочного полиэстера, а также обтекаемый дизайн, обеспечивает отличную защиту для вашего ноутбука</li>\r\n 	<li>Отдельный, мягкий, карман на молнии надежно удерживает планшет до 10 дюймов</li>\r\n 	<li>Ультра-тонкий дизайн</li>\r\n 	<li>Просторный карман на задней части сумки служит для хранения документов, PowerBank и т.д.</li>\r\n 	<li>Специальный карман на молнии для Ipod/Iphone, сотового телефона на передней стенке рюкзака</li>\r\n 	<li>Регулируемые плечевые ремни и мягкие ручки</li>\r\n 	<li>Ремни надежно закрепляют сумку, если Вы несете нечто действительно тяжёлое</li>\r\n</ul>', 'Рюкзак для ноутбука Dapp-BP', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">13"-14"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя ширина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">410 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Полиэстер</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Яркие</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">275 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">30 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'ryukzak-dlya-noutbuka-dapp-bp', '', '', '2016-12-10 16:58:32', '2016-12-10 14:58:32', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/ryukzak-dlya-noutbuka-dapp-bp/', 0, 'product', '', 0),
