(6328, 1, '2016-12-10 16:58:32', '2016-12-10 14:58:32', '<b>Promate Zipper-L</b> — ультра-легкий гладкий чехол для ноутбуков до 15.6" с превосходной внешней отделкой тканью и внутренней подкладкой премиум-качества.\r\n<ul>\r\n 	<li>Благодаря тонкому дизайну он легко помещается в портфеле или сумке для дополнительной защиты</li>\r\n 	<li>Внешняя ткань защищает ноутбук от потертостей и пыли, в то время как мягкая отделка внутри оберегает его от царапин</li>\r\n 	<li>Высокое качество экстерьера</li>\r\n</ul>', 'Чехол для ноутбука Zipper-L', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15"-15.6"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Полиэстер</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Повседневные</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-dlya-noutbuka-zipper-l', '', '', '2016-12-10 16:58:32', '2016-12-10 14:58:32', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-dlya-noutbuka-zipper-l/', 0, 'product', '', 0),
