(6330, 1, '2016-12-10 16:58:36', '2016-12-10 14:58:36', '<b>Promate Voyage</b> — отличный рюкзак с гладкой поверхностью и функциональным внутренним наполнением, вмещающий в себя ноутбук с диагональю до 16 дюймов. Основная секция предназначена для ноутбука и аксессуаров к нему. Во второй основной секции предусмотрена удобная система хранения. Также на внешней стороне предусмотрены карманы для хранения аксессуаров, к которым нужен быстрый доступ.\r\n\r\nБоковые карманы предусмотрены для емкостей под жидкость. Особопрочная ручка для ручной переноски имеет кожаную оплетку для удобства ношения. Лямки для ношения <b>Voyage</b> на манер рюкзака имеют регулировку, которая подгонит их длину под пользователя.\r\n\r\n<b>Promate Voyage</b> — для деловых поездок и ежедневного использования.\r\n<ul>\r\n 	<li>Подходит для всех ноутбуков с диагональю до 16 дюймов</li>\r\n 	<li>Стильный черный бизнес рюкзак из нейлона с отделкой из кожи</li>\r\n 	<li>Легкий и надежный</li>\r\n 	<li>Встроенные карманы на "молнии"</li>\r\n 	<li>Отделанная кожей усиленная ручка</li>\r\n 	<li>Настраиваемые лямки и "мягкая" спинка</li>\r\n 	<li>Сделан из 100% нейлона</li>\r\n</ul>', 'Рюкзак для ноутбука Voyage', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15"-15.6"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя ширина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">400 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нейлон</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Повседневные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">330 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">20 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'ryukzak-dlya-noutbuka-voyage', '', '', '2016-12-10 16:58:36', '2016-12-10 14:58:36', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/ryukzak-dlya-noutbuka-voyage/', 0, 'product', '', 0),
