 top; width: 48%;">Нейлон</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Дорожные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">320 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">25 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'ryukzak-dlya-noutbuka-trolleypak-1', '', '', '2016-12-10 16:58:36', '2016-12-10 14:58:36', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/ryukzak-dlya-noutbuka-trolleypak-1/', 0, 'product', '', 0),
