(6351, 1, '2013-12-14 16:58:40', '2013-12-14 14:58:40', 'Размер этого чехла имеет значение. Сумка <b>Promate xPose XL</b> с легкостью может служить для хранения и ношения профессиональной современной фотокамеры со всеми необходимыми аксессуарами. Регулируемый делитель в основном отделении плотно зафиксирует саму камеру и обеспечит безопасное пространство для дополнительных сменных объективов.\r\n\r\nНошение чехла возможно как с помощью удобной ручки, так и с помощью пристегиваемого регулируемого наплечного ремня.\r\n\r\n<b>Promate xPose.XL</b> изготовлен из нейлона и полиэстера, что делает его износостойким, легким и удобным.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Подходит для практически всех однообъективных зеркальных фотоаппаратов</li>\r\n 	<li>Регулируемый делитель для дополнительного объектива или аксессуаров</li>\r\n 	<li>Внешний, закрывающийся на "молнию" карман для карт памяти, наборов для очистки объективов или других аксессуаров</li>\r\n 	<li>Боковое отделение для хранения батарей и др.</li>\r\n 	<li>Настраиваемый отстегивающийся наплечный ремень и удобная ручка для комфортной перевозки</li>\r\n 	<li>Материал: нейлон и полиэстер</li>\r\n</ul>', 'Сумка для фототехники xPose.XL', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Категория </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Сумки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Ширина (внутренняя) </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">500 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">350 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">370 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'sumka-dlya-fototexniki-xpose-xl', '', '', '2013-12-14 16:58:40', '2013-12-14 14:58:40', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/sumka-dlya-fototexniki-xpose-xl/', 0, 'product', '', 0),
