(6353, 1, '2016-12-10 16:58:40', '2016-12-10 14:58:40', '<b>Promate Slinger</b> — sling-сумка с несколькими вариантами хранения и быстрым доступом к камере\r\n\r\nРазработана специально под размеры зеркальной фотокамеры со стандартным зум-объективом или DSLR.\r\nИзготовлена из прочного нейлона и предполагает несколько вариантов хранения.\r\n<ul>\r\n 	<li>Внутренний карман на молнии с боковой створкой хранит дополнительные карты памяти, фильтры или тканевые объективы.</li>\r\n 	<li>Компактный водонепроницаемый капюшон плотно облегает сумку, чтобы защитить ее от внезапного дождя или брызг.</li>\r\n 	<li>Передний карман на молнии вместит дополнительную камеру или аксессуары.</li>\r\n 	<li>Боковой отсек обеспечивает быстрый доступ к камере и аксессуарам во время ношения слинга.</li>\r\n 	<li>Регулируемая система длинны обеспечивает оптимальный размер для дополнительного объектива, вспышки или других аксессуарам</li>\r\n 	<li>Наплечный ремень держит надежно держит вашу камеру в безопасности на протяжении всего времени использования</li>\r\n</ul>\r\n<b>Promate Slinger</b> — выбор фотографа!<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Сумка для фототехники Slinger', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Категория </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Сумки</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Ширина (внутренняя) </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">240 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">215 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">100 мм</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'sumka-dlya-fototexniki-slinger', '', '', '2016-12-10 16:58:40', '2016-12-10 14:58:40', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/sumka-dlya-fototexniki-slinger/', 0, 'product', '', 0),
