(6357, 1, '2016-12-10 16:58:40', '2016-12-10 14:58:40', '<b>Сумка для ноутбука Promate Kini-HM</b> поставляется в привлекательном сером цвете. Изделие является идеальной сумкой для путешествий. Подходит для всех ноутбуков диагональю с 15.6".\r\n\r\nKini имеет два основных внутренних отделения с липучкой, карман закрывающийся на молнию и удобные ручки для транспортировки.\r\n\r\nСумка является идеальным аксессуаром для путешествия благодаря своей легкости и портативности.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Сумка для ноутбука Kini-HM', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">15"-15.6"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя ширина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">390 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нейлон</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Повседневные</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">300 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя высота под устройство </td><td st