(6359, 1, '2016-12-10 16:58:40', '2016-12-10 14:58:40', '<b>Promate Desire-S </b>- классическая элегантная сумка для девайсов 11.6" с тонким дизайном и съемным мини кейсом.\r\n\r\nПоставляется со съемным мини-кейсом, который идеально подходит для хранения всех мелких вещей.\r\n\r\nDesire-S подходит для людей, которые любят совмещать элегантность и вместительность.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Вмещает ноутбуки 11.6"</li>\r\n 	<li>Ультратонкий дизайн</li>\r\n 	<li>Съемный мини кейс</li>\r\n 	<li>Сетчатые Карманы внутри кейса</li>\r\n 	<li>Отделы для канцелярских принадлежностей и часто используемых предметов</li>\r\n 	<li>Удобная ручка</li>\r\n 	<li>Качественная и прочная обивка</li>\r\n 	<li>Защита от влаги</li>\r\n</ul>', 'Сумка для ноутбука Desire-S', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Способ закрытия</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Молния</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Для ноутбука с размером экрана </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">10"-12"</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя ширина под устройство </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">270 мм</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Нейлон</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Тип </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Повседневные </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Внутренняя глубина под устройство </td><td s