(6363, 1, '2016-12-10 16:58:40', '2016-12-10 14:58:40', '<b>Promate TabPak-S</b> – легкая сумка для планшетов до <b>7.8"</b>.\r\n\r\nTabPak-S легко носить с собой куда угодно. Стильный дизайн позволяет брать эту сумку с собой, куда бы вы не пошли. Она изготовлена из качественной, приятной на ощупь натуральной кожи. Ремень для переноса прочный и полностью регулируемый.<span id="copyinfo"></span>\r\n\r\n&nbsp;', 'Сумка для планшета TabPak-S', 'Способ закрытия Молния\r\nДля ноутбука с размером экрана до 7,8"\r\nВнутренняя ширина под устройство 200 мм\r\nЦвет Blue\r\nМатериал Натуральная кожа\r\nТип Мессенджеры\r\nМодельные\r\nЯркие\r\nВнутренняя глубина под устройство 25 мм\r\nВнутренняя высота под устройство 250 мм', 'publish', 'open', 'closed', '', 'sumka-dlya-plansheta-vertikalnaya-tabpak-s', '', '', '2016-12-10 16:58:40', '2016-12-10 14:58:40', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/sumka-dlya-plansheta-vertikalnaya-tabpak-s/', 0, 'product', '', 0),
