(6365, 1, '2016-12-10 16:58:40', '2016-12-10 14:58:40', '<b>Promate Teem-i6</b> заслуженно любим пользователями. Это флип-чехол из кожи премиум класса, который помимо телефона готов вместить в себя предметы первой необходимости (карты, деньги). Этот премиум-чехол оснащен отдельным отделением для карт, а также может служить подставкой для горизонтального просмотра информации с вашего мобильного телефона. Идеальные технические вырезы точно соответствуют всем кнопкам и портам телефона. Чехол обеспечивает полную защиту на долгое время, что делает его оптимальным выбором для сохранности вашего iPhone 6.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Легко превращается в подставку для горизонтального просмотра изображения</li>\r\n 	<li>Дополнительный карман для карт</li>\r\n 	<li>Флип-кейс</li>\r\n 	<li>Тонкий и идеально облегающий смартфон</li>\r\n 	<li>Оптимальная защита со всех сторон</li>\r\n 	<li>Полный доступ ко всем портам и кнопкам управления<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол Teem-i6', '<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Чехол-книжка</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">iPhone 6/6s</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Кожа</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Да</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'publish', 'open', 'closed', '', 'chexol-teem-i6', '', '', '2016-12-10 16:58:40', '2016-12-10 14:58:40', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-teem-i6/', 0, 'product', '', 0),
