(6378, 1, '2016-12-10 16:58:45', '2016-12-10 14:58:45', '<b>Promate beSlim-i6</b> — элегантный чехол, защищающий ваш iPhone 6 жесткой оснасткой из высосокачественного поликарбоната и изумительного качества кожей. На задней поверхности этого надежного защитного чехла предусмотрен специальный карман, где можно хранить кредитные карты, визитные карты или мелкие деньги, когда вы идете в магазин. Полный доступ ко всем кнопкам и портам телефона завершает образ идеального чехла для стильных людей.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Удобный чехол-накладка для вашего iPhone</li>\r\n 	<li>Внутренняя жесткая оснастка и внешнее покрытие качественной кожей</li>\r\n 	<li>Полный доступ ко всем кнопкам и портам</li>\r\n 	<li>Дополнительный скрытый кармашек для карт или мелкой наличности<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол beSlim-i6', '<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Чехол-карман</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">iPhone 6/6s</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Кожа</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">