(6383, 1, '2016-12-10 16:58:45', '2016-12-10 14:58:45', '<b>Promate Lucent-i6</b> — симпатичный стильный чехол с прозрачной флип-крышкой, которая позволяет наблюдать за экраном вашего смартфона, при этом защищая смартфон от царапин и потертостей. Его дизайн специально разработан для iPhone 6/6s, что гарантирует максимально плотное прилегание смартфона к чехлу, при это обеспечивая полный доступ ко всем портам и кнопкам управления.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Флип кейс в виде "книжки" для iPhone 6/6s</li>\r\n 	<li>Прозрачное окно для наблюдения за экраном и доступа в реальном времени ко всем характеристикам вашего смартфона</li>\r\n 	<li>Полный доступ ко всем портам и кнопкам вашего смартфона</li>\r\n 	<li>Доступен в разных цветовых решениях<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол Lucent-i6', '<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Чехол-книжка</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">iPhone 6/6s</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Синтетические материалы</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Да</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'publish', 'open', 'closed', '', 'chexol-lucent-i6', '', '', '2016-12-10 16:58:45', '2016-12-10 14:58:45', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-lucent-i6/', 0, 'product', '', 0),
