(6388, 1, '2016-12-10 16:58:45', '2016-12-10 14:58:45', '<strong>Amos-i6P</strong> является новым аксессуаром для iPhone-6, она идеально прилегает к корпусу и повторяет силуэт смартфона.Ультраэластичность Amos-i6 превосходно защищает телефон от царапин и потертостей. В данной накладке встречаются практичность и дизайн.Доступность моделей в разных цветах позволяет менять стиль Вашего iPhone каждый день!\r\n\r\n<strong>Особенности :</strong>\r\n<ul>\r\n 	<li>Полный доступ к кнопкам и портам телефона</li>\r\n 	<li>Надежность и стиль</li>\r\n 	<li>Доступен в разных цветах</li>\r\n 	<li>Сделан из пластика высочайшего качества.</li>\r\n 	<li>Ультра тонкий</li>\r\n</ul>', 'Чехол Amos-i6p', '', 'publish', 'open', 'closed', '', 'chexol-amos-i6p', '', '', '2016-12-10 16:58:45', '2016-12-10 14:58:45', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-amos-i6p/', 0, 'product', '', 0),
