(6397, 1, '2016-12-10 16:58:49', '2016-12-10 14:58:49', '<strong>Promate liveBelt-2 Универсальный, гибкий, многофункциональный спортивный чехол-ремень</strong>\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Удобно:</strong> Promate liveBelt-2 является мультифункциональной сумкой-чехлом. Он изготовлен из мягкого, гибкого, дышащего материала, который очень удобно носить. Эластичный и регулируемый поясной ремень подходит под любую талию\r\n<strong>• Водонепроницаемость:</strong> Этот аксессуар имеет защиту от воды, грязи, песка и пота\r\n<strong>• Ультра легкий и компактный:</strong> liveBelt-2 никогда не будет вам мешать, находясь под одеждой\r\n<strong>• Прочный:</strong> Невероятно легкий, но все равно прочный и устойчивый к внешним факторам. Двойное полиуретановое покрытие, обработка лайкрой + DWR + устойчивые молнии позволяют выдержать любые нагрузки\r\n<strong>• Пото и влагозащита неопреновая конструкция:</strong> Разработанный без каких-либо отверстий этот аксессуар обеспечивает отличную защиту от пота во время тренировки и изготовлен из влагостойкого неопрена для повышеной влагозащиты\r\n<strong>• Светоотражение:</strong> Рефлективные ремни и светоотражающие молнии улучшают видимость, позволяя видеть вас заранее в ночное время\r\n<strong>• Легкий доступ для наушников:</strong> Наушники могут быть продеты через специальное "ушко" что позволяет иметь быстрый доступ к ним не октрывая чехол\r\n<strong>• Сенсорный экран:</strong> Прозрачная поверхность позволяет получить доступ ко всем функциям вашего телефона с сенсорным экраном, не вытягивая его из корпуса', 'Чехол liveBelt-2', '', 'publish', 'open', 'closed', '', 'chexol-livebelt-2', '', '', '2016-12-10 16:58:49', '2016-12-10 14:58:49', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-livebelt-2/', 0, 'product', '', 0),
