(6410, 1, '2016-12-10 16:58:55', '2016-12-10 14:58:55', '<strong>Vaultcase-i7 </strong>- защитный чехол для iPhone 7 и банковской карты\r\n\r\n<strong>Особенности :</strong>\r\n<ul>\r\n 	<li>Быстрый доступ к карте: чехол обеспечивает защиту не только смартфона, но и вашей банковской карты, а так же позволяет носить небольшую сумму налички в специальном отделении</li>\r\n 	<li>Защитный корпус: передние приподнятые края защищают экран и углы телефона при размещении лицевой стороной на поверхность, а так же при случайных радениях</li>\r\n 	<li>Простота установки: просто оденьте чехол на ваше устройство и пользуйтесь</li>\r\n 	<li>Сверхтонкий: благодаря супер-легкому дизайну, чехол не будет делать ваш iPhone 7 слишком тяжелым</li>\r\n 	<li>Доступ к кнопкам и портам: этот аксессуар позволяет с легкостью получать доступ ко всем кнопкам и разъёмам вашего телефона</li>\r\n</ul>', 'Чехол vaultCase-i7', '<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Панель</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">iPhone 7</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Пластик</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td>\r\n<td style="padding-bottom: 20px; width: 2%;"></td>\r\n<td style="vertical-align: top; width: 48%;">Да</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'publish', 'open', 'closed', '', 'chexol-vaultcase-i7', '', '', '2016-12-10 16:58:55', '2016-12-10 14:58:55', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-vaultcase-i7/', 0, 'product', '', 0),
