(6468, 1, '2016-12-10 16:59:10', '2016-12-10 14:59:10', 'Оденьте свой новый iPhone 6 в исключительный по качеству, сделанный из термопластичного полиуретана чехол <b>Brace-I6</b> от <b>Promate</b>, и вы перестанете волноваться о сохранности ваших инвестиций! Гибкий, более долговечный, чем силикон, с отличной амортизацией и износостойкостью, он выгодно отличается еще и тем, что очень тонкий.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Классический кожаный чехол с оснасткой из термопластичного полиуретана</li>\r\n 	<li>Встроенная подставка для горизонтального просмотра</li>\r\n 	<li>Специально разработанное внутреннее пространство чехла для оптимальной защиты</li>\r\n 	<li>Полный доступ ко всем кнопкам и портам</li>\r\n 	<li>Доступен в разных цветах<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол Brace-I6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Чехол-книжка</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> iPhone 6/6s</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Кожа</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Да</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-brace-i6', '', '', '2