(6472, 1, '2016-12-10 16:59:10', '2016-12-10 14:59:10', 'Чехол-бампер <b>Promate Bump-I6</b> для iPhone 6 — потрясающий пример минималистского подхода к качественной защите. Внешний край бампера красиво обрамляет корпус iPhone 6. Ничего лишнего — только жесткая оснастка и прорезиненный бампер с ультра-мягким покрытием. Точные технологические вырезы обеспечивают полный доступ ко всем кнопкам и разъемам. Сочетания качества, защиты и стиля в одном неповторимом чехле для iPhone 6.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Минималистский дизайн</li>\r\n 	<li>Исключительная защита</li>\r\n 	<li>Жесткая оснастка</li>\r\n 	<li>Разработан для iPhone 6</li>\r\n 	<li>Полный доступ ко всем кнопкам и портам<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол Bump-I6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Бампер</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> iPhone 6/6s</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Пластик</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте</td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Да</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-bump-i6', '', '', '2016-12-10 16:59:10', '2016-12-10 14:59:10', '', 0, 'http: