(6476, 1, '2016-12-10 16:59:10', '2016-12-10 14:59:10', '<b>Promate Cloud-i6</b> — защитная чехол-накладка для iPhone 6, разработанная с учетом стиля, надежности и комфорта. Чехол плотно облегает ваш смартфон, защищая его от сколов и царапин, при этом предоставляя неограниченный доступ ко всем кнопкам управления, портам и камеры. Это не только уникальный дизайн, но и яркие цветовые решения!\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Прочный защитный чехол</li>\r\n 	<li>Уникальный двутоный дизайн</li>\r\n 	<li>Идеально "сидит" на смартфоне</li>\r\n 	<li>Полный доступ к кнопкам и портам</li>\r\n 	<li>Разные цветовые решения</li>\r\n 	<li>Исключительная защита от сколов и царапин</li>\r\n 	<li>Сделан из высококачественного пластика<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол Cloud-I6', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Панель </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> iPhone 6/6s </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Пластик </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Защитная плёнка в комплекте </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Да</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-cloud-i6', '', '', '2016-12-10 16:59:1