(6487, 1, '2016-12-10 16:59:15', '2016-12-10 14:59:15', 'Promate Crystal изготовлен из чистого, кристально чистого поликарбоната и обработан защитным УФ-покрытием против царапин.\r\n\r\nCrystal поддерживает нетронутым внешний вид вашего iPhone 5/5S и одновременно обеспечивает ему оптимальную защиту. Технические отверстия вырезаны максимально точно и обеспечивают неограниченный доступ к портам и кнопкам вашего iPhone 5/5S. Позвольте вашему iPhone сиять как кристалл!\r\n\r\nОсобенности:\r\n<ul>\r\n 	<li>Модный кристально чистый дизайн</li>\r\n 	<li>Тонкий и легкий</li>\r\n 	<li>Легко одевается на смартфон</li>\r\n 	<li>Точные контуры вашего iPhone 5/5s УФ покрытие против царапин</li>\r\n 	<li>Неограниченный доступ к портам и кнопкам управления</li>\r\n</ul>', 'Чехол Crystal Clear', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Панель </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> IPhone 5/5S </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Пластик </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Да</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-crystal-clear', '', '', '2016-12-10 16:59:15', '2016-12-10 14:59:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-crystal-clear/', 0, 'product', '', 0),
