(6493, 1, '2016-12-10 16:59:15', '2016-12-10 14:59:15', 'С <b>Promate Diver-i6P</b> ваш iPhone 6 Plus/iPhone 6s Plus в полной безопасности. Он прочен и водонепроницаем. Роняйте на землю, в лужу, на пол и еще куда угодно ваш смартфон, он останется целым и невредимым благодаря Diver-i6. Герметичность корпуса позволяет телефону находиться под водой. Ударопрочное стекло никак не повлияет на чуткость сенсорного экрана. Diver-i6 специально изготовлен для вашего iPhone 6, поэтому резиновые кнопки идеально подогнаны к корпусу смартфона, а все технические порты доступны. Убедитесь в оптимальной защите вашего смартфона с Diver-i6.\r\n\r\n<b>Особенности:</b>\r\n<ul>\r\n 	<li>Водонепроницаемый</li>\r\n 	<li>Прост в использовании</li>\r\n 	<li>Внешние резиновые кнопки точно подогнаны к кнопкам на смартфоне</li>\r\n 	<li>Защитное стекло не мешает работе сенсорного экрана</li>\r\n 	<li>Совместим с функцией Touch ID (идентификация по отпечатку пальца)</li>\r\n 	<li>Легкий, но при этом ультрапрочный с уникальной защитой экрана</li>\r\n 	<li>Неограниченный доступ к кнопкам и портам</li>\r\n 	<li>Специально разработан для iPhone 6/iPhone 6s Plus<span id="copyinfo">\r\n</span></li>\r\n</ul>', 'Чехол Diver-I6P', '<table style="width: 100%;"><tbody><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Форм-фактор </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Панель </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Подходит к</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> iPhone 6 Plus/6s Plus </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Материал  </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Пластик + металл </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Особенности </td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;">Водонепроницаемый, Защитная плёнка в комплекте </td></tr><tr><td style="padding-bottom: 20px; width: 48%; vertical-align: top;">Пленка в комплекте</td><td style="padding-bottom: 20px; width: 2%; ">&nbsp;</td><td style="vertical-align: top; width: 48%;"> Да</td></tr></tbody></table>', 'publish', 'open', 'closed', '', 'chexol-diver-i6p', '', '', '2016-12-10 16:59:15', '2016-12-10 14:59:15', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/chexol-diver-i6p/', 0, 'product', '', 0),
