(14093, 6, '2017-04-06 10:29:51', '2017-04-06 08:29:51', '<strong>BarHub-C - высокоскоростной USB 3.1 Type-C Hub с функцией зарядки</strong>\r\n\r\n<span style="font-weight: 400;">Не знаете как подключить периферийные и прочие устройства к вашему новому Type-C ноутбуку?  Не отчаивайтесь, у Promate есть решение - новая линейка высококачественных Type-C хабов, призванных помочь вам в этом</span>\r\n\r\n<strong>Особенности</strong>\r\n\r\n• <strong>Заряжайте через хаб:</strong> BarHub-C обеспечивает полноценную доставку электропитания к устройству, даже при одновременном взаимодействии всех портов SuperSpeed USB 3.0 и HDMI.Хаб\r\n• <strong>Передача сигнала 4K:</strong> переходник USB-C на HDMI обеспечивает полноценное подключение вашего устройства к любому HDMI-дисплею с поддержкой разрешения 1080p (FullHD), 4K (UltraHD)\r\n• <strong>Реверсивный разъем USB-C:</strong> Никогда не беспокойтесь о том, какой стороной подключить коннектор. USB-C - это новый, удобный в использовании разъем, позволяющий подключать кабель к устройству в любом направлении\r\n• <strong>SuperSpeed USB 3.0:</strong> Этот концентратор передает данные по USB с невероятной скоростью, до 5 Гб/с. Этого достаточно, чтобы передать фильм в высоком качестве за считанные секунды\r\n• <strong>Совместимость с USB-C:</strong> предназначен для работы с новейшим поколением компьютеров и прочих устройств, поддерживающих порты USB Type-C\r\n• <strong>Элегантный и компактный:</strong> BarHub-C станет превосходным партнером для вашего нового устройства с разъемом Type-C', 'USB Type-C Хаб BarHub-C', '<strong>• Входной интерфейс:</strong> USB Type-C с полноценной доставкой электропитания\r\n2 USB 3.0 порта, порт HDMI\r\n<strong>• Напряжение USB:</strong> 5V, 900mA\r\n<strong>• Скорость передачи данных:</strong> 5Gbps\r\n<strong>• Поддержка ОС:</strong> 10/8/7 / XP, Mac OS X 10.2 (и выше)', 'publish', 'open', 'closed', '', 'usb-type-c-xab-barhub-c', '', '', '2017-04-06 10:29:51', '2017-04-06 08:29:51', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/usb-type-c-xab-barhub-c/', 0, 'product', '', 0),
