(14098, 6, '2017-04-06 11:54:48', '2017-04-06 09:54:48', '<strong>SyncHUB-C3 от Promate это USB Type-C 3.1 концентратор со скоростью передачи данных 10 Гбит/с</strong>\r\n\r\nSyncHUB-C3 расширяет ваш USB Type-C порт с помощью 3-х дополнительных портов USB, разъема microSD и SD, что позволяет вам подключать USB-устройства, такие как: цифровые камеры, телефоны, внешние жесткие диски, флэш-диски и принтеры одновременно и без каких-либо усилий\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• </strong>Порты USB 3.1 Type-A поддерживают скорость передачи данных до 10 Гбит / с\r\n<strong>•</strong> SyncHUB-C3 не требует никакого программного обеспечения либо сложного процесса установки, просто подключите его и используйте', 'USB Type-C Хаб SyncHUB-C3', '<strong>• Входной интерфейс:</strong> 3 USB 3.1 Порты Type-A, слот для карт MicroSD и слот для SD карт\r\n<strong>• Выходной интерфейс:</strong> USB 3.0\r\n<strong>• Напряжение USB: </strong>5 В, 900 мА\r\n<strong>• Скорость передачи:</strong> 10 Гбит / с\r\n<strong>• Поддержка ОС:</strong> Win 10/8/7 / Vista, Mac OS X 10.2 (и выше)', 'publish', 'open', 'closed', '', 'usb-type-c-xab-synchub-c3', '', '', '2017-04-06 11:54:48', '2017-04-06 09:54:48', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/usb-type-c-xab-synchub-c3/', 0, 'product', '', 0),
(14099, 1, '2017-07-06 11:30:06', '2017-07-06 09:30:06', '', 'USB Type-C Хаб SyncHUB-C3 1', '', 'inherit', 'open', 'closed', '', 'usb-type-c-xab-synchub-c3-1', '', '', '2017-07-06 11:30:06', '2017-07-06 09:30:06', '', 14098, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/Artboard-1-9.png', 0, 'attachment', 'image/png', 0),
(14116, 6, '2017-04-06 12:41:43', '2017-04-06 10:41:43', '<strong>SurfaceHub от Promate - универсальная, портативая USB 3.0 док-станция, разработанная специально для Microsoft Surface</strong>\r\n\r\nС помощью этого ультрапортативного USB-хаба, вы превратите свой планшет Microsoft Surface в полноценную настольную рабочую станцию. Простое подключение к локальной сети или подключение ваших любимых USB-аксессуаров через два USB 3.0 порта, слоты для карт SD/MicroSD всегда будет радовать вас. Вы никогда не потеряете ручку-стилус  благодаря встроенной подставки в док-станциии\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Делайте больше одновременно:</strong> расширьте ваши возможности с помощью 2х портов USB 3.0.  SurfaceHub обеспечивает скорость до 5 Gbps, что в 10 раз быстрее USB 2.0\r\n<strong>• Изысканный дизайн:</strong> Стильный алюминиевый хаб, идеально дополнит ваше устройство\r\n<strong>• Универсальный Хаб:</strong>  SurfaceHub прекрасно подойдет к таким устройствам как USB 3.0 жестким дискам, цифровым и видео камерам а так же HD веб-камерам\r\n<strong>• Ethernet Порт: </strong>RJ45 сетевой интерфейс - позволит вам насладится быстрым и постоянным проводним подключением, более надежным и стабильний, чем  любое беспроводное соединение\r\n<strong>• Plug and Play: </strong>Просто подключите  SurfaceHub в ваш ноутбук и он сразу готов к работе', 'USB Хаб surfaceHub', '<strong>• Интерфейс выхода:</strong> 2 порта USB 3.0 Type-A, слот для карт памяти SD / MicroSD и порт RJ45\r\n<strong>• Интерфейс ввода:</strong> USB 3.0 Micro-B\r\n<strong>• Напряжение USB:</strong> 5 В, 900 мА\r\n<strong>• Порт RJ45:</strong> поддержка сети 10/100/1000 Мбит/с\r\n<strong>• Скорость передачи:</strong> 5 Гбит / с', 'publish', 'open', 'closed', '', 'usb-xab-surfacehub', '', '', '2017-04-06 12:41:43', '2017-04-06 10:41:43', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/usb-xab-surfacehub/', 0, 'product', '', 0),
