(14143, 6, '2017-04-06 13:33:36', '2017-04-06 11:33:36', '<strong>MiniHub-C-4 - концентратор который передает данные по USB с невероятной скоростью, до 10 Гбит/с</strong>\r\n\r\nИспытайте технологию следующего поколения с miniHub-C-4. USB 3.1 Type-C USB Хаб - гладкий и компактный, оснащен 4-мя портами USB 3.1 Type-A для зарядки и синхронизации. Просто подключите miniHub-C-4 к вашим устройствам, поддерживающим USB Type-C и наслаждайтесь технологией будущего!\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Изысканный дизайн:</strong> Стильный алюминиевый хаб, идеально дополнит ваше Type-C устройство\r\n<strong>• Многозадачность:</strong> MiniHub-C4 - 3.1 Type-C USB-Хаб, который оснащен 4 USB 3.1 Type-A для зарядки и синхронизации данных\r\n<strong>• Plug and Play:</strong> Просто подключите MiniHub-C4 в ваш ноутбук и он сразу готов к работе\r\n<strong>• USB 3.1: </strong>Этот концентратор передает данные по USB с невероятной скоростью, до 10 Гбит/с. Этого достаточно, чтобы передать фильм в высоком качестве за считанные секунды', 'USB Type-C Хаб MiniHub-C4', '<strong>• Интерфейс ввода: </strong>4 USB 3.1 Type-A\r\n<strong>• Выходной интерфейс:</strong> USB Type-C\r\n<strong>• Напряжение USB: </strong>5V, 900mA\r\n<strong>• Скорость передачи: </strong>10 Gbps\r\n<strong>• Поддержка ОС: </strong>Win 10/8/7, Mac OS X 10.2 (и выше)', 'publish', 'open', 'closed', '', 'usb-type-c-xab-minihub-c4', '', '', '2017-04-06 13:33:36', '2017-04-06 11:33:36', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/usb-type-c-xab-minihub-c4/', 0, 'product', '', 0),
