(14148, 6, '2017-04-06 13:52:44', '2017-04-06 11:52:44', '<strong>MiniHub - aлюминиевый USB 3.0 Хаб на 4 порта</strong>\r\n\r\nMiniHub расширяет ваш USB 3.0 порт с помощью 4-х дополнительных портов USB,  что позволяет вам подключать устройства, такие как: цифровые камеры, телефоны, внешние жесткие диски, флэш-диски и принтеры одновременно и без каких-либо усилий. miniHub не требует никакого программного обеспечения либо сложного процесса установки, просто подключите его и используйте\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Делайте больше одновременно: </strong>расширьте ваши возможности с помощью 4х портов USB 3.0.  MiniHub обеспечивает скорость до 5 Gbps, что в 10 раз быстрее USB 2.0\r\n<strong>• Изысканный дизайн:</strong> Стильный алюминиевый хаб, идеально дополнит ваше устройство\r\n<strong>• Универсальный Хаб: </strong>miniHub прекрасно подойдет к таким устройствам как USB 3.0 жестким дискам, цифровым и видео камерам а так же HD веб-камерам\r\n<strong>• Plug and Play:</strong> Просто подключите miniHub в ваш ноутбук и он сразу готов к работе\r\n<strong>• Обратная совместимость: </strong>Он так же совместим с устройствами USB 2.0\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'USB 3.0 Хаб miniHub', '<strong>• Интерфейс: </strong>USB 3.0\r\n<strong>• Напряжение USB:</strong> 5 В, 900 мА\r\n<strong>• Скорость передачи данных</strong>: 5 Гбит / с\r\n•<strong> Поддержка ОС:</strong> Windows 10/8/7 / Vista / XP, Mac OS X 10.2 (и выше)', 'publish', 'open', 'closed', '', 'usb-3-0-xab-minihub', '', '', '2017-04-06 13:52:44', '2017-04-06 11:52:44', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/usb-3-0-xab-minihub/', 0, 'product', '', 0),
