(14157, 6, '2017-04-06 14:52:32', '2017-04-06 12:52:32', '<strong>CoreHub-C - высокоскоростной 8в1 USB 3.1 Type-C Хаб с функцией зарядки</strong>\r\n\r\nПользуйтесь новыми технологиями привычным для себя способом. USB Type-C Хаб CoreHub-C позволяет использовать старые USB-устройства, преобразуя USB-порт Type-C в три порта USB 3.0, USB- Type C с зарядкой, слот для SD-карты, карты Micro SD, порт HDMI и порт Ethernet. Заряжайте ноутбук и одновременно используйте этот Хаб с периферийными устройствами, а также картами SD и Micro SD. С помощью CoreHub-C вы легко можете получить доступ к своим медиафайлам - и никаких драйверов не потребуется! Всегда найдется выгодное решение с Promate CoreHub-C\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Новые технологии:</strong> Promate CoreHub-C функциональный и компактный Type-C хаб 8в1 следующего поколения\r\n<strong>• Изысканный дизайн:</strong> Стильный алюминиевый хаб, идеально дополнит ваше Type-C устройство\r\n<strong>• 8в1:</strong> В CoreHub-C присутсвует - USB 3.1 Type-C порт с функцией зарядки, 3 - USB 3.0, HDMI, LAN 1Гбит/с, а также слоты для карт памяти SD/MMC и microSD\r\n<strong>• Заряжайте через хаб:</strong> CoreHub-C обладает функцией зарядки, поэтому вы можете пользоваться всеми портами хаба и заряжать ноутбук одновременно\r\n<strong>• Plug and Play:</strong> Просто подключите CoreHub-C в ваш ноутбук и он сразу готов к работе\r\n<strong>• SuperSpeed USB 3.0:</strong> Этот концентратор передает данные по USB с невероятной скоростью, до 5 Гбит/с. Этого достаточно, чтобы передать фильм в высоком качестве за считанные секунды', 'USB 3.1 Type-C Хаб CoreHub-C', '<strong>• Разъемы:</strong> USBType-C с функцией зарядки, 3- USB 3.0, HDMI, LAN 1Гбит/с, SD, MicroSD.\r\n<strong>• Напряжение USB:</strong> 5В, 900мA\r\n<strong>• Скорость передачи данных:</strong> 5Гбит/с\r\n<strong>• Поддержка ОС:</strong> MacOS 10.5 и новее, Windows 7/8/8.1, Android', 'publish', 'open', 'closed', '', 'usb-3-1-type-c-xab-corehub-c', '', '