(14177, 6, '2017-04-07 08:02:24', '2017-04-07 06:02:24', '<strong>UniLink-CAF – сверхмощный, армированный премиум кабель синхронизации USB 3.0 Type-C</strong>\r\n\r\nИспытайте новую технологию зарядки и синхронизации с uniLink-CAF - медным армированным кабелем USB 3.1 Type-C - USB-A. С uniLink-CAF переносите ваши данные с устройства с помощью USB-A порта на устройство с портом USB-C с молниеносной скоростью 5 Гбит / с. UniLink-CAF поддерживает быструю зарядку. Медный кабель покрыт плетеной сеткой из гибкой ткани flexShield ™. Погрузитесь в новую технологию с uniLink-CAF\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Cупер-скорость: </strong>Потрясающая скорость передачи данных и зарядки\r\n<strong>• Сверхмощный, армированный кабель: </strong>Не беспокойтесь о разрывах и перегибах, так как uniLink-CAF протестирован и защищен сверхпрочной сетчатой броней\r\n<strong>• Реверсивный коннектор Type-C: </strong>без проблем подключайте ваше устройство\r\n<strong>• Стабильность:</strong> ощутите стабильную скорость синхронизации и зарядки\r\n<strong>• Безопасный кабель:</strong> uniLink-CAF обеспечивает защиту от короткого замыкания и перезарядки\r\n<strong>• Совместимость:</strong> uniLink-CAF совместим со всеми устройствами, поддерживающими USB 3.1 Type-C Connector', 'кабель uniLink-CAF', '<strong>• Тип:</strong> Кабели синхронизации\r\n<strong>• Совместимость: </strong>USB/USB Type-C\r\n<strong>• Разъем 1:</strong> USB\r\n<strong>• Разъем 2:</strong> USB Type-C\r\n<strong>• Длина кабеля:</strong> 1.2', 'publish', 'open', 'closed', '', 'kabel-unilink-caf', '', '', '2017-04-07 08:02:24', '2017-04-07 06:02:24', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-unilink-caf/', 0, 'product', '', 0),
