(14209, 6, '2017-04-07 10:05:58', '2017-04-07 08:05:58', '<strong>linkMate-LTC - кабель нового поколения для зарядки и передачи данных с разъемами Apple Lightning и USB Type-C</strong>\r\n\r\nИспытайте самую последнюю технологию зарядки и синхронизации с помощью linkMate-LTC. Используйте устройство Android с устройствами Apple на сверхбыстрых скоростях. Ощутите скорость передачи данных до 5 Гбит / с. С легкостью заряжайте смартфон с помощью другого смартфона.\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Поддержка полноценной доставки электропитания:</strong> с легкостью заряжайте смартфон с помощью другого смартфона\r\n<strong>• Поддержка Universal Sync:</strong> синхронизация данных между любыми устройствами Android и iOS\r\n<strong>• Plug &amp; Play:</strong> Внешний источник питания или драйверы не требуются. Просто подключите кабель к вашим устройствам, и связь между устройствами будет настроена автоматически\r\n<strong>• Реверсивный разъем USB-C:</strong> Не беспокойтесь о том, какой стороной подключить кабель. USB Type-C - это новый, удобный в обращении разъем, позволяющий подключать кабель к устройству в любом направлении\r\n<strong>• Стабильность:</strong> Обеспечивает стабильную и быструю синхронизацию данных и зарядку\r\n<strong>• Безопасный:</strong> linkMate-LTC обеспечивает защиту от короткого замыкания и перезарядки\r\n<strong>• Совместимость:</strong> linkMate-LTC совместим со всеми устройствами, оддерживающими USB 3.1 Type-C\r\n<strong>• Светится в темноте: </strong>кабель белого цвета (linkMate-LTC White) светится в темноте', 'Кабель linkMate-LTC', '<strong>• Тип: </strong>Кабели синхронизации\r\n<strong>• Совместимость:</strong> Apple\r\n<strong>• Разъем 1:</strong> Apple Lightning\r\n<strong>• Разъем 2:</strong> USB Type-C\r\n<strong>• Длина кабеля:</strong> 1.2', 'publish', 'open', 'closed', '', 'kabel-linkmate-ltc', '', '', '2017-04-07 10:05:58', '2017-04-07 08:05:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/kabel-linkmate-ltc/', 0, 'product', '', 0),
