(14236, 6, '2017-04-07 11:16:38', '2017-04-07 09:16:38', 'Новаторское решение для пользователей, которым требуется дополнительное экранное пространство.\r\n\r\nПодключите стандартный монитор, проектор или ЖК-дисплей с разъемом HDMI или VGA.\r\n\r\nВы сможете использовать внешний дисплей для расширения своей рабочей области, либо можете использовать проектор в зеркальном режиме, и вы с аудиторией увидите одну и ту же картину.\r\n\r\nОтличное качество изображения и звука.\r\n\r\n2 в 1 адаптер: VGA и HDMI.\r\n\r\nПоддержка режима Dual Mode, Mini DisplayPort - HDMI и VGA.\r\n\r\nНе требуется внешнего источника питания, заряд напрямую от Mini DisplayPort.\r\n\r\nПоддерживает HDMI 4K X 2K @ 30Hz и 1080P @ 120Hz.\r\n\r\nПоддержка HDMI 1.4B; Поддержка HDCP1.2.\r\n\r\nПоддержка 3.D.\r\n\r\nПоддерживает Hot Plugging.\r\n\r\nПоддерживает вход 1.2a порта Mini Display и выход HDMI 1.4b.\r\n\r\nПоддерживает display port dual model v1.2.\r\n\r\nПростота в эксплуатации - не требует программного обеспечения, внешний адаптер питания не\r\n\r\nтребуется.\r\n\r\nДизайн в строгом соответствии со стандартом Mini DisplayPort.\r\n\r\nСтабильный и надежный сигнал.\r\n\r\nСовместим со всеми устройствами VGA.\r\n\r\nДвунаправленная скорость передачи 6.75 ГБ / с, поддерживающая до 1080 пикселей.', 'Переходник thunderMate-HV', '', 'publish', 'open', 'closed', '', 'perexodnik-thundermate-hv', '', '', '2017-04-07 11:16:38', '2017-04-07 09:16:38', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/perexodnik-thundermate-hv/', 0, 'product', '', 0),
