(14242, 6, '2017-04-07 13:57:23', '2017-04-07 11:57:23', 'Мощная резервная батарея: встроенный литий-ионный аккумулятор емкостью 10000 мАч\r\n\r\nЗарядка в пути: заряжайте устройства с помощью VolTag-10 где бы вы ни были\r\n\r\nАвтоматическая регулировка напряжения: Не беспокойтесь о том, что энергия будет\r\n\r\nраспределятся неправильно. volTag-10 решит эту проблему благодаря автоматической\r\n\r\nрегулировке напряжения\r\n\r\nКомпактная и легкя: элегантный дизайн и легкий вес - выделяет VolTag-10 среди других\r\n\r\nUltra-быстрые USB-порты: заряжайте 2 устройства одновременно при помощи сверхбыстрых\r\n\r\nпортов USB\r\n\r\nБезопасная и надежная: VolTag-10 является полностью безопасной и надежной, так как имеет\r\n\r\nфункцию защиты от перезарядки и короткого замыкания', 'УМБ volTag-10', '', 'publish', 'open', 'closed', '', 'umb-voltag-10', '', '', '2017-04-07 13:57:23', '2017-04-07 11:57:23', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-voltag-10/', 0, 'product', '', 0),
