(14288, 6, '2017-04-07 14:51:43', '2017-04-07 12:51:43', 'Мощная резервная батарея: встроенный литий-ионный аккумулятор емкостью 15000 мАч\r\n\r\nЗарядка в пути: заряжайте устройства с помощью Tag-15 где бы вы ни были\r\n\r\nАвтоматическая регулировка напряжения: Не беспокойтесь о том, что энергия будет\r\n\r\nраспределятся неправильно. Tag-15 решит эту проблему благодаря автоматической регулировке\r\n\r\nнапряжения\r\n\r\nКомпактная и легкая: элегантный дизайн и легкий вес - выделяет Tag-15 среди других\r\n\r\nUltra-быстрые USB-порты: заряжайте 2 устройства одновременно при помощи сверхбыстрых\r\n\r\nпортов USB\r\n\r\nБезопасная и надежная: Tag-15 является полностью безопасной и надежной, так как имеет\r\n\r\nфункцию защиты от перезарядки и короткого замыкания', 'УМБ Tag-15', '', 'publish', 'open', 'closed', '', 'umb-tag-15', '', '', '2017-04-07 14:51:43', '2017-04-07 12:51:43', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/umb-tag-15/', 0, 'product', '', 0),
