(14313, 6, '2017-04-10 07:57:07', '2017-04-10 05:57:07', '<strong>Tribe от Promate</strong> это эргономичные стереонаушники в тканевой оплетке.\r\n\r\nОсобенностью их является непосредственный энергичный дизайн в «диком» стиле – так называемый «<strong>tribe</strong>». Благодаря Tribe вы прочувствуете каждый бит и ноту вашей музыки.\r\n\r\nСовершайте звонки в дороге с помощью кнопки вызова и встроенного микрофона. Контролируйте воспроизведение музыки с помощью кнопок управления громкости и кнопки <strong>play/pause</strong>. Универсальная совместимость со всеми устройствами, поддерживающими 3,5 мм Jack. Tribe упрощает ежедневные поездки и тренировки.\r\n<p style="text-align: center;"><strong>Почувствуйте себя легко с Promate Tribe<em>.</em></strong></p>', 'Наушники Tribe', '', 'publish', 'open', 'closed', '', 'naushniki-tribe', '', '', '2017-04-10 07:57:07', '2017-04-10 05:57:07', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/naushniki-tribe/', 0, 'product', '', 0),
