(14326, 6, '2017-04-10 08:50:00', '2017-04-10 06:50:00', 'Halo от Promate – компактная и незаметная Bluetooth-гарнитура с высоким\r\n\r\nкачеством передачи звука.\r\n\r\nМногофункциональная: совершайте вызовы на ходу, а также слушайте\r\n\r\nлюбимую музыку. Избавьтесь от проводов!\r\n\r\nУниверсальные возможности: универсальная совместимость позволяет\r\n\r\nвам наслаждаться возможностями беспроводного подключения.\r\n\r\nФункция Hands-free: встроенный микрофон обеспечивает кристально\r\n\r\nчистый звук для вашего собеседника.\r\n\r\nСтильная гарнитура: ультра-маленький размер и элегантный дизайн.\r\n\r\nПодключите 2 устройства одновременно: Halo поддерживает\r\n\r\nмноготочечное сопряжение, то есть вы можете подключать два устройства\r\n\r\nодновременно.\r\n\r\nПортативная Bluetooth-гарнитура: не беспокойтесь о том, что Halo займет\r\n\r\nвесь карман! Halo - это ультра-миниатюрная Bluetooth-гарнитура, которую\r\n\r\nвы можете легко хранить в своем кошельке или даже в сумке.\r\n\r\nКомфортная подушечка для уха: удобная и мягкая подушечка\r\n\r\nобеспечивает удобство прилегания.\r\n\r\nДолгоиграющая Bluetooth-гарнитура: аккумуляторная батарея\r\n\r\nобеспечивает 5 часов беспрерывного использования.', 'Bluetooth гарнитура Halo', '', 'publish', 'open', 'closed', '', 'bluetooth-garnitura-halo', '', '', '2017-04-10 08:50:00', '2017-04-10 06:50:00', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-garnitura-halo/', 0, 'product', '', 0),
(14327, 1, '2017-07-06 11:30:10', '2017-07-06 09:30:10', '', 'Bluetooth гарнитура Halo 1', '', 'inherit', 'open', 'closed', '', 'bluetooth-garnitura-halo-1', '', '', '2017-07-06 11:30:10', '2017-07-06 09:30:10', '', 14326, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/Halo-Black-4.jpg', 0, 'attachment', 'image/jpeg', 0),
(14349, 6, '2017-04-10 10:19:58', '2017-04-10 08:19:58', 'BlueClass-2 Bluetooth-гарнитура с высоким качеством передачи звука.\r\n\r\nМногофункциональная: совершайте вызовы на ходу, а также слушайте\r\n\r\nлюбимую музыку. Избавьтесь от проводов!\r\n\r\nУниверсальные возможности: универсальная совместимость позволяет\r\n\r\nвам наслаждаться возможностями беспроводного подключения.\r\n\r\nФункция Hands-free: встроенный микрофон обеспечивает кристально\r\n\r\nчистый звук для вашего собеседника.\r\n\r\nСтильная гарнитура: компактный размер и элегантный дизайн.\r\n\r\nПодключите 2 устройства одновременно: blueClass-2 поддерживает\r\n\r\nмноготочечное сопряжение, то есть вы можете подключать два\r\n\r\nустройства одновременно.\r\n\r\nПортативная Bluetooth-гарнитура: не беспокойтесь о том, что blueClass-2\r\n\r\nзаймет весь карман! blueClass-2 - это компактная Bluetooth-гарнитура,\r\n\r\nкоторую вы можете легко хранить в своем кошельке или даже в сумке.\r\n\r\nТовар, который упростит вашу жизнь\r\n\r\nКомфортная подушечка для уха: удобная и мягкая подушечка\r\n\r\nобеспечивает удобство прилегания.\r\n\r\nДлительный срок службы: Аккумуляторная батарея обеспечивает\r\n\r\nдлительное использование.\r\n\r\nДолгоиграющая Bluetooth-гарнитура: аккумуляторная батарея\r\n\r\nобеспечивает 4 часа беспрерывного использования.\r\n\r\nВстроенный регулятор громкости: вам не нужно снимать гарнитуру,\r\n\r\nчтобы изменить уровень громкости, так как blueClass-2 оснащен\r\n\r\nрегулятором громкости в боковой части корпуса\r\n\r\nBlueClass-2 доступен в двух классических цветах.', 'Bluetooth гарнитура BlueClass-2', '', 'publish', 'open', 'closed', '', 'bluetooth-garnitura-blueclass-2', '', '', '2017-04-10 10:19:58', '2017-04-10 08:19:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-garnitura-blueclass-2/', 0, 'product', '', 0),
