(14365, 6, '2017-04-10 11:54:57', '2017-04-10 09:54:57', 'Превосходная защитная пленка для долговременной защиты экрана.\r\n\r\nДанная пленка защищает от пыли, отпечатков пальцев, пятен и царапин.\r\n\r\nУстановка без особых трудностей, без образования трещин и пузырьков.\r\n\r\nКомплект поставки включает чистящую салфетку и пластиковую карточку для установки пленки.\r\n\r\nНовое и улучшенное адгезивное покрытие обеспечивает абсолютную прозрачность, не искажает\r\n\r\nцвета.\r\n\r\nПредназначен для защиты экрана MacBook Pro 13 with Touch Bar\r\n\r\nИзготовлена из тонкого листа ПЭТ-материала.\r\n\r\nУльтратонкая пленка 0,2 мм гарантирует абсолютное совершенство в использовании\r\n\r\nРазмер специально подогнан для обеспечения идеальной посадки на экран вашего MacBook Pro\r\n\r\n13 with Touch Bar.', 'Защитная пленка для MacBook Pro 13 with Touch Bar Macguard-pro13', '', 'publish', 'open', 'closed', '', 'zashhitnaya-plenka-macbook-pro-13', '', '', '2017-04-10 11:54:57', '2017-04-10 09:54:57', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zashhitnaya-plenka-macbook-pro-13/', 0, 'product', '', 0),
