(14396, 6, '2017-04-11 09:55:01', '2017-04-11 07:55:01', 'Promate Urbaner-MB - многофункциональная водонепроницаемая сумка для ноутбуков до 15.6&amp;quot; с\r\n\r\nмножеством карманов и отделений, разработанный специально для городской жизни.\r\n\r\nОсобенности:\r\n\r\nЧрезвычайно легкя, сумку легко носить с собой\r\n\r\nМногоцелевая, портативная и удобная сумка: подходит для любых целей, в том числе для\r\n\r\nпутешествий.\r\n\r\nВодостойкая, изготовлена из прочного нейлона с водоотталкивающей пропиткой для защиты от\r\n\r\nдождя.\r\n\r\nПревосходное качество внутренней отделки.\r\n\r\nГлавный отсек со специальным плотным наполнителем для безопасного хранения ноутбука.\r\n\r\nПередний карман на молнии служит для небольших предметов первой необходимости.\r\n\r\nКарманы быстрого доступа для необходимых мелких вещей.\r\n\r\nУдобная ручка сверху и регулируемый ремень для дополнительного комфорта.', 'Сумка для ноутбука Urbaner-MB', '', 'publish', 'open', 'closed', '', 'sumka-dlya-noutbuka-urbaner-mb', '', '', '2017-04-11 09:55:01', '2017-04-11 07:55:01', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/sumka-dlya-noutbuka-urbaner-mb/', 0, 'product', '', 0),
