(14405, 6, '2017-04-11 12:10:30', '2017-04-11 10:10:30', 'Универсальный автодержатель с технологией беспроводной зарядки\r\n\r\nQi.\r\n\r\nШирокая область зарядки: встроенные 3-жильные катушки\r\n\r\nобеспечивают широкие возможности беспроводной зарядки.\r\n\r\nЗарядное устройство и держатель 2 в 1 - этот уникальный продукт\r\n\r\nможет действовать не только как зарядное устройство, но и в качестве\r\n\r\nдержателя телефона, когда это требуется.\r\n\r\nУниверсальное подключение: AuraMount совместим со всеми Qi-\r\n\r\nустройствами.\r\n\r\nБезопасность: AuraMount оснащен интеллектуальной схемой, которая\r\n\r\nобеспечивает защиту от перегрева, перегрузки по току и короткого\r\n\r\nзамыкания.\r\n\r\nПросмотр 360⁰: Этот держатель оснащен поворотной головкой,\r\n\r\nкоторую можно наклонить в соответствии с желаемым углом обзора.\r\n\r\nУстановка на любую поверхность: AuraMount – не обязательно\r\n\r\nкрепить только на приборную панель. Вы можете установить его на\r\n\r\nлобовое стекло или любую другую гладкую поверхность.\r\n\r\nМощная присоска: AuraMount можно прикрепить на любую\r\n\r\nповерхность, и не волноваться, что он упадет, даже при жестких\r\n\r\nусловиях вождения.\r\n\r\nСупер-совместимость: подходит для всех устройств шириной от 5 до 9\r\n\r\nсм, таких как Apple iPhone / iPad / iPod, Samsung Galaxy / Note Phones\r\n\r\nand Tablets. Поддерживает все популярные устройства Sat NAV / GPS\r\n\r\n/ Dash Camera.', 'Автодержатель AuraMount', '', 'publish', 'open', 'closed', '', 'avtoderzhatel-auramount', '', '', '2017-04-11 12:10:30', '2017-04-11 10:10:30', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhatel-auramount/', 0, 'product', '', 0),
