(14414, 6, '2017-04-13 13:07:10', '2017-04-13 11:07:10', '<strong>Promate  VentGrip-2 - универсальный держатель для смартфона на вентиляционное отверстие </strong>\r\n\r\n<strong>Особенности</strong>\r\n\r\n<strong>• Простота в использовании: </strong>Безопасность вашего устройства всегда под контролем благодаря технологии быстрой установки. Просто прикрепите входящий в комплект поставки, клеящийся металлический диск на заднюю панель смартфона, и поместите диск над центром магнитного держателя\r\n<strong>• Универсальность:</strong> В компании Promate специально запатентовали зубцы предназначенные для надежного сцепления с любым вентиляционным отверстием любого автомобиля\r\n<strong>• Простая конструкция:</strong> Нет защелок, кронштейнов, зажимов! Только магнитная сила, которая может обеспечить безопасность эксплуатации\r\n<strong>• Безопасность:</strong> VentGrip-2 надежно держится даже при жестких условиях вождения\r\n<strong>• Универсальная совместимость: </strong>VentGrip-2 поддерживает смартфоны всех размеров — в том числе iPhone 6 Plus / 6 / 5s / 5 / 5C, Samsung Galaxy S7 / S6 и практически любой другой смартфон', 'Автодержатель VentGrip-2', '', 'publish', 'open', 'closed', '', 'avtoderzhatel-ventgrip-2', '', '', '2017-04-13 13:07:10', '2017-04-13 11:07:10', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtoderzhatel-ventgrip-2/', 0, 'product', '', 0),
