(14507, 6, '2017-05-12 07:59:25', '2017-05-12 05:59:25', '<strong>TissueBox</strong> - держатель для салфеток в салон автомобиля.\r\n\r\nЭлегантный дизайн: простой и модный дизайн, полностью функциональный и практичный.\r\n\r\nМатериал, устойчивый к атмосферным воздействиям: изготовлен из водо- и термо- стойкой PU\r\n\r\nкожи, которая не выцветает и не разрывается даже в самых жарких условиях.\r\n\r\nБезопасное вождение: хранение ценных предметов в одном месте экономит ваше время и может,\r\n\r\nдаже, предотвратить несчастный случай.\r\n\r\nПодходит для большинства автомобилей: благодаря специально разработанному гибкому корпусу\r\n\r\nвы можете установить <strong>TissueBox</strong> в любом автомобиле.\r\n\r\nПростота в использовании: с легкостью уберите и повторно установите <strong>TissueBox</strong>, когда нужно\r\n\r\nоткрыть или закрыть козырек.\r\n\r\n<strong>Характеристики:</strong>\r\n\r\nПремиум Эко-Кожа;\r\n\r\nСпособствует безопасному вождению;\r\n\r\nЛегкая установка;\r\n\r\nЭкологически чистый материал;\r\n\r\nМесто установки – солнцезащитный козырек;\r\n\r\nВодонепроницаемый материал.', 'Автомобильный держатель для салфеток Promate TissueBox', '', 'publish', 'open', 'closed', '', 'avtomobilnyj-derzhatel-dlya-salfetok-promate-tissuebox', '', '', '2017-05-12 07:59:25', '2017-05-12 05:59:25', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/avtomobilnyj-derzhatel-dlya-salfetok-promate-tissuebox/', 0, 'product', '', 0),
(14508, 1, '2017-07-06 11:30:13', '2017-07-06 09:30:13', '', 'Автомобильный держатель для салфеток Promate TissueBox 1', '', 'inherit', 'open', 'closed', '', 'avtomobilnyj-derzhatel-dlya-salfetok-promate-tissuebox-1', '', '', '2017-07-06 11:30:13', '2017-07-06 09:30:13', '', 14507, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/TissueBox-Black_11.jpg', 0, 'attachment', 'image/jpeg', 0),
(14541, 6, '2017-05-12 08:16:58', '2017-05-12 06:16:58', '<strong>AuraDock-2 </strong>от Promate – это универсальная беспроводная зарядная станция, которая работает с\r\n\r\nлюбым Qi устройством.\r\n\r\n<strong>Настраиваемая область зарядки:</strong> Встроенная регулируемая полочка обеспечивает более удобный\r\n\r\nрежим беспроводной зарядки.\r\n\r\n<strong>Зарядное устройство 2 в 1: auraDock-2</strong> может выступать не только как зарядное устройство, когда\r\n\r\nваш телефон нуждается в подзарядке, но и в качестве подставки для телефона.\r\n\r\n<strong>Адаптивная технология зарядки:</strong> выходная мощность адаптируется к вашим устройствам,\r\n\r\nобеспечивая максимальный уровень для каждого порта.\r\n\r\n<strong>Универсальное подключение: AuraDock-2</strong> совместим со всеми Qi-устройствами\r\n\r\n<strong>Безопасность: AuraDock-2</strong> оснащена интеллектуальной схемой, которая обеспечивает защиту от\r\n\r\nперегрева, перегрузки и короткого замыкания.\r\n\r\n<strong>Технические характеристики.</strong>\r\n\r\n<strong>Вход:</strong> DC 5V, 2A;\r\n\r\n<strong>Выход:</strong> DC 5V, 1A;\r\n\r\n<strong>Расстояние зарядки:</strong> 4 ~ 10 мм;\r\n\r\n<strong>Частота:</strong> 110-205 кГц.\r\n\r\nДоступен в черном цвете.', 'Беспроводное зарядное устройство Promate auraDock-2', '', 'publish', 'open', 'closed', '', 'besprovodnoe-zaryadnoe-ustrojstvo-promate-auradock-2', '', '', '2017-05-12 08:16:58', '2017-05-12 06:16:58', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/besprovodnoe-zaryadnoe-ustrojstvo-promate-auradock-2/', 0, 'product', '', 0),
(14542, 1, '2017-07-06 11:30:13', '2017-07-06 09:30:13', '', 'Беспроводное зарядное устройство Promate auraDock-2 1', '', 'inherit', 'open', 'closed', '', 'besprovodnoe-zaryadnoe-ustrojstvo-promate-auradock-2-1', '', '', '2017-07-06 11:30:13', '2017-07-06 09:30:13', '', 14541, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/AuraDock-2-01_1024x1024.jpg', 0, 'attachment', 'image/jpeg', 0),
(14544, 6, '2017-05-12 09:20:07', '2017-05-12 07:20:07', '<strong>UniStation</strong>  - 12000mA сверхмощная зарядная станция с 10 портами USB.\r\n\r\n<strong>UniStation от Promate</strong> это 12000mA сверхмощная зарядная USB-станция, которая позволяет\r\n\r\nзаряжать до 10 устройств одновременно.\r\n\r\nИнтеллектуальная схема UniStation обеспечивает оптимальную защиту от перегрева, перегрузки\r\n\r\nпо току и короткого замыкания.\r\n\r\nКроме того, она изготовлена из огнезащитного материала ABS и встроенных алюминиевых\r\n\r\nрассеивающих тепло панелей. Таким образом, обеспечивается оптимальная защита.\r\n\r\n<strong>UniStation</strong> совместим со всеми USB-устройствами.\r\n\r\nВстроенный переключатель поможет выбрать оптимальную силу электрического тока.\r\n\r\nПереключайте между 1A или 2.4 A с помощью тумблера.\r\n\r\nИнтерфейс быстрой зарядки USB.\r\n\r\nПолная мощность без ограничений.\r\n\r\n<strong>Технические характеристики:</strong>\r\n\r\nвход: 100-240 В ~ 1,6 А 50-60 Гц;\r\n\r\nвыход: DC 5V 1A x 10, DC 5V 2.4A x 5;\r\n\r\nвходной интерфейс: штепсельная вилка переменного тока;\r\n\r\nвыходной интерфейс: 10 USB-портов для зарядки.', 'Зарядное устройство Promate uniStation', '', 'publish', 'open', 'closed', '', 'zaryadnoe-ustrojstvo-promate-unistation', '', '', '2017-05-12 09:20:07', '2017-05-12 07:20:07', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/zaryadnoe-ustrojstvo-promate-unistation/', 0, 'product', '', 0),
(14545, 1, '2017-07-06 11:30:13', '2017-07-06 09:30:13', '', 'Зарядное устройство Promate uniStation 1', '', 'inherit', 'open', 'closed', '', 'zaryadnoe-ustrojstvo-promate-unistation-1', '', '', '2017-07-06 11:30:13', '2017-07-06 09:30:13', '', 14544, 'http://1076992.bc254240.web.hosting-test.net/wp-content/uploads/2017/07/uniStation_Black_41.jpg', 0, 'attachment', 'image/jpeg', 0),
(14778, 6, '2017-06-29 07:17:09', '2017-06-29 05:17:09', '<strong>CoolClassic - веселый и многофункциональный Emoji-динамик станет сердцем и душой вашей вечеринки</strong>\r\nДостаточно маленький для того, чтобы поместиться в кармане и достаточно громкий для того чтобы удовлетворить любого меломана. Его беспроводная технология соединяется с совместимыми устройствами на расстоянии до 10 м и позволяет вам управлять музыкой с помощью простых кнопок на корпусе динамика, поэтому вам не придется вынимать телефон из кармана. Его забавное оформление выступает в качестве идеального подарка, позволяющего кому-то узнать, что вы думаете. Постарайтесь вдоволь позабавиться с этим веселым динамиком emoji.\r\n\r\n<strong>Особенности:</strong>\r\n\r\n<strong>• High Definition Speaker:</strong> многофункциональный 3-ваттный динамик с улучшенными звуковыми характеристиками\r\n<strong>• Несколько вариантов подключения:</strong> воспроизведение ваших любимых треков с помощью Bluetooth, через 3,5-мм аудиоразъем или через карту microSD\r\n<strong>• Функция вызова:</strong> задействовать функцию вызова стало как никогда просто, а встроенный микрофон оснащен усовершенствованной технологией шумоподавления\r\n<strong>• Долговечная батарея:</strong> Воспроизводите ваши любимые треки в течение 3 часов с помощью литий-полимерной батареи емкостью 250 мАч\r\n<strong>• Универсальная совместимость:</strong> этот динамик совместим со всеми устройствами с поддержкой Bluetooth', 'Bluetooth динамик Promate CoolClassic', '<strong>Tехнические характеистики:</strong>\r\n\r\n<strong>• Bluetooth версия:</strong> v2.1 + EDR\r\n<strong>• Bluetooth чипсет:</strong> JianRong\r\n<strong>• Bluetooth частота:</strong> 2.4GHz\r\n<strong>• Bluetooth профили:</strong> A2DP,AVRCP,HSP\r\n<strong>• Тип аккумулятора:</strong> Lithium-Polymer\r\n<strong>• Емкость аккумулятора:</strong> 250mAh\r\n<strong>• Вход:</strong> 5V, 1A\r\n<strong>• Выход динамиков:</strong> 3W\r\n<strong>• Сопротивление:</strong> 4 Ω\r\n<strong>• Рабочая дистанция:</strong> 10m\r\n<strong>• Время использования:</strong> 3 часа\r\n<strong>• Время зарядки:</strong> 2 часа', 'publish', 'open', 'closed', '', 'bluetooth-dinamik-promate-coolclassic', '', '', '2017-06-29 07:17:09', '2017-06-29 05:17:09', '', 0, 'http://1076992.bc254240.web.hosting-test.net/product/bluetooth-dinamik-promate-coolclassic/', 0, 'product', '', 0),
