(14780, 1, '2017-07-06 12:27:48', '2017-07-06 10:27:48', '<div class="form-group">[text* clientname placeholder "Ваше имя"]</div>\r\n<div class="form-group">[email* email placeholder "Ваш e-mail"]</div>\r\n<div class="form-group" id="billing_phone_field">[tel* tel class:billing_phone placeholder "(___)___ __ __"]</div>\r\n<div class="form-group">[textarea comment placeholder "Ваш коментарий"]</div>\r\n<div class="form-group attach-event">[file file limit:2048]<a class="attach-open" href="#">Добавить</a><span class="attach-value">Прикрепить файл</span></div>\r\n<div class="form-group">[submit "Отправить"]</div>\n1\npromate клиент "[clientname]"\nnbilanenko@1076992.bc254240.web.hosting-test.net\nok@promate.ua\nName: [clientname]\r\nTel: [tel]\r\ne-mail: [email]\r\nMessage: \r\n[comment]\r\n\r\n[attach]\n\n[attach]\n\n\n\npromate "[your-subject]"\npromate <wordpress@1076992.bc254240.web.hosting-test.net>\n[your-email]\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта promate (http://1076992.bc254240.web.hosting-test.net)\nReply-To: nbilanenko@gmail.com\n\n\n\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nПоле обязательно для заполнения.\nПоле слишком длинное.\nПоле слишком короткое.\nФормат даты некорректен.\nВведённая дата слишком далеко в прошлом.\nВведённая дата слишком далеко в будущем.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nФайл слишком большой.\nПри загрузке файла произошла ошибка.\nФормат числа некорректен.\nЧисло меньше минимально допустимого.\nЧисло больше максимально допустимого.\nНеверный ответ на проверочный вопрос.\nКод введен неверно.\nНев